(0x7642466f72756d5f506f7374, 7368, 0, 4747, '[QUOTE=mehdi;220729]@Mujtaba    Try to find it in " Blue Minaret" Lahore. You can get it from UK also.T.W Chambers & co.\n[URL="http://www.gunspares.co.uk"]www.gunspares.co.uk[/URL] .The spring for Diana 45 is about 11 pounds in U.K from T.W Chambers & co.This is a treasure trove for original Diana Spares\n\n@Chauhadry  you will also find your gun spares here.\nForesight      15 Pounds\nMain Spring   8.39 Pounds[/QUOTE]\n\n', '', '835771bdebb5d91a7a18fbb9b17a0a65', 1318786268),
