(0x7642466f72756d5f506f7374, 888, 0, 1408, 'My Home defence is 6 layered i will only discuss 3 of those but with out interlinking them\n\nDog(s)\nFalse entry points\nLighting system designed to confuse intruders and inflate the number of responders\n\n\n', '', 'f13eb77de81fd6251af04b7f709dfd04', 1318777081),
(0x7642466f72756d5f506f7374, 6637, 0, 4833, '[QUOTE=S.M.R;214246]Thanks Hussain.\n\n\n\nWhenever I have travelled, the ASF guy brings wire and seal the locked bag.[/QUOTE]\n\n\n[QUOTE]mnkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkk mnjkkkkkkkkkkkk\n\n[/QUOTE]', '', '0b5d15eb2331287f7ba10c3906ff1870', 1318777429),
(0x7642466f72756d5f506f7374, 4766, 0, 580, '1. No weapon comes in a sealed packag', '', '3799960a00cb041033050c106528d8a0', 1318592844),
(0x7642466f72756d5f506f7374, 7381, 0, 490, 'i can just imagine a PIG of ankle height killed after some time...a true advice please don''t get carried away by this ankle high victory and try shooting a slightly larger one with that airgun specially on foot.:)\r\ngood shooting tough. \r\nP.S. why does this story remind me of the saying " knib the evil in the bud. :)', '', '10306544b504908e63fdf77ad28f9a5c', 1318855214),
(0x7642466f72756d5f506f7374, 7303, 0, 1, 'As a stereotype Hunters are a breed apart. There is a reason they drive 200 km''s, get up at 4 am, wear special clothes, hide in cold swampy water for hours to hunt a few birds they could have delivered to their home. It''s for the spirit of adventure, accomplishment and the hunt. Naturally these gentlemen have a free independent spirit and like to challenge the status quo. \n\nOur humble request is perhaps best explained by an example. PakGuns is a welcoming home to all friends that wish to come here. You are welcome to share your stories, your conquests, your experiences, make new friends and learn. However in exchange for all these benefits which you avail for free, we request that you adhere by a couple of rules of this home. If the owners/management say a certain thing is not allowed, please don''t go arguing or asking why and to change it. It is the same as if a guest came to your house and asked you why your favorite sofa is in your favorite corner and demand that you move it elsewhere. What would your response be ? Specially if you have opened your home to him purely for his benefit alone and at your own cost ?\n\nThis is how we feel. You''re back from the hunt now, it''s required you drive on the road rather than make your own ;)\n  \n\n\n', '', 'd6a32859e979617a8060be5bdcf16d58', 1319055938),
(0x7642466f72756d5f506f7374, 7364, 0, 5526, 'try settig up a specialty bodyguard company...only target the', '', '2a10e3295ee14d45fe1ddb99bf9f5ac3', 1318839364),
(0x7642466f72756d5f506f7374, 7244, 0, 1013, '@Talpur1\nWater Floating jackets are easily available at any Sports Shop.\n\nI bought a cheap one at Rs:300 from Sunway Lagoon water park a year back', '', '642311d8aa7161693f9bfb07263105c8', 1318865548),
