(0x7642466f72756d5f506f7374, 0, 224945, 5467, '[QUOTE=HussainAli;224853]Dear Furrukh Bro,\n\nAs per law & constitution of Pakistan we have 2 NPB Arms Lic issuance authorities\n\n1. Ministry of Interior MOI or Federal Govt.\n2. Home Department or Provincial Govt.\n\nUpon application federal can "Approve /Issue" NPB Arms Lic lic to any individual and this lic is known as MOI Lic or Federal Govt. Lic\n\nProvincial Govt. (All 4 Provinces) also Approve /issue NBP lic upon request of individual.\n\nThe difference is, when a federal govt. issue a lic it can be issue to any part of the country therefore it has the "Valid For All Pakistan" status.\n\nProvince issues a Lic "Valid for that Particular Province" but when one needs to travel from one province to another then we request the provincial Govt. (Upon official Fee) to allow us to carry our lic & weapon to another province....thus this permission is know as "All Pakistan Carrying Status" of provincial Lic.\n\nNow to your question, of Carrying & Purchase......................\n\nKeeping in view that status & issuing authority, MOI lic allows you to purchase from anywhere in the country......provided you fulfill the "Prerequisite" of NBP registration & follow-up on DC /DCO entry....(So you are restricted to your home town technically).\n\nProvincial Lic allows you to purchase with the "Issued Province /Area City /District of Approval" ............but prerequisites are the same ...i.e NBP & DC /DCO etc.......... (So you again restricted to your home town technically".....\n\nNow talking about "Carrying" both the Lic allows the lic holder to carry within the "Limits of Approval Authorities"............but the "Problem child is "Section 144 Banned on Weapon Carry /display" law.....................\n\nSo, under such condition law, both the Lic enjoy the same "Ban" & both needs "Section 144 Exemption Permission" to carry ................\n\nYes the difference is there while "Renewal Fee" and freedom to carry etc............but I always think why MOI lic is "Without" the Lic holder picture ???\n\nRest is all same as per law and legally both enjoys the same "Allowed Limits" as per City /District Govt......\n\nHopes this clear......\n\nRegards[/QUOTE]\n\nWonderful knowledge. Very informative post. Again thanks Hussain Bhai.\n\n[B]Hussain Bhai kindly tell me; after conversion All Sindh to All Pakistan, can i go for re-validation to Nadra?[/B]', '', 'f02643996bcde274ee59fa14f4c7520b', 1321002512),
