(0x7642466f72756d5f506f7374, 0, 223603, 1955, 'Salam,\r\nMehdi Bro, broadly speaking there are three kinds of people who own guns. People who own guns for sport/hunting, for SD and for collection. Now, for people who own guns just for collection, this suggestion would make sense. For people who own guns for Sport/Hunting this suggestion MIGHT be valid as if the gun fails to perform, its just a missed shot.\r\nComing to people who own guns for SD, this suggestion is totally invalid, IMHO, as you cannot afford a gun to malfunction on you in such a scenario.\r\nThis has been discussed profoundly throughout PG and we all know that the issue is not of Patriotism but of low quality control. The base metals/alloys used are not of good quality and the processes are not stansardized. In such a situation, if a weapon is needed for defense, I would go for cheapest available weapon that has some sort of QC, i.e. a used TT. \r\nIn fact the only Pakistani company that is making good weapons is Daudsons Armoury, now a suggestion from my side would be for someone to open a state of the art weapon production unit in Pakistan with stringent QC, so that its weapons may make us proud, not only as owners but as exporters. :D We may even name the company Pakguns. How about it Abbas Bhai?\r\n\r\nRegards.', '', 'd5dd46d8b3434a4c7bd1683c2a6b31a1', 1320136248),
