(0x7642466f72756d5f506f7374, 3101, 0, 2515, 'This most probably is the dealer ''Guns n Accessories'', or one of his ''aides'', located at Zamzama, Karachi. Might be helpful if kept under observation for commercial activities etc.\n\n\n[QUOTE=g&a;224381]Glock 26 is now availble in market for 250K, saw 3 days back in zamzama dealer[/QUOTE]', '', '5467cdf4eb368edcda392770990e7866', 1320654263),
(0x7642466f72756d5f506f7374, 7517, 0, 861, '[QUOTE=Dragunov-svd;224377]Thats awful, such beautiful animals killed for noone other than mere sport- shame on people who condone such a thing. \n\nYou should know the price in africa to ''hunt'' a black person is cheaper than a exotic animal like above :der:[/QUOTE]\n\nThe Rhino was not killed it was only shot with a dart which put him to sleep for a few minutes it was explained in the pictures.\nDear Dragunov if you follow the old posts you will realise if these animals do not become a self sustainable resource they will be eliminated. The African countries where hunting is not allowed, the animals have been eliminated by local poachers who kill for the pot round the year whether male or female.\nThe high price charged for the trophy animals results in prevention of poaching by Wild Life deptt which gets the pays and funds from the trophy fee.  The locals realise that every trophy animal is worth tens of thousands of dollars and it is better to eat a goat worth a few dollars than let a trophy animal be wantonly killed which keeps the whole tribe paid abrings electricity and roads.\nLook at Pakistan, some 10 to 12 years ago the Markhore was almost gone , the Himalayan Ibex hardly left then.\nNow with our efforts of past 25 years the Trophy hunting was allowed and now masha Allah ( by the grace of Almighty God ) the mountain sides are sprawling with Ibex and the Majestic Markhore is now in hundreds in all ranges of its domain.\nThis because the locals were killing as if it was grass and would keep growing. Now they guard the Markhore as it fetches a trophy fee of from 60,000/ to 80,000 USD  a major part of which is shared by the Village Organisation where the animal was hunted, also the outfitters charge something like 20 to 30,000 USD again a lot of money goes to the villagers who have no other means of living in the high mountains as they get paid as  ', '', '08979769451606716ea5dc701eb402eb', 1320657785),
(0x7642466f72756d5f506f7374, 7293, 0, 3330, '[QUOTE=AirSoft;222622]Dear taha, I am glad you have asked this question I will be happy to explain:\n\nA bag of 0.25g WE Precision BBs weighs 1Kg, let&#8217;s suppose you find a website on the internet which is offering this bag for $10, first thing you will have to check is whether that site will ship to Pakistan as 95% of the internet sites do not ship Airsoft products to Pakistan. In this scenario we assume that it does then the next thing will be the mode of payment; again most of the sites only accept Paypal. Third and most important aspect you will have to consider will be the Shipping Cost, the cheapest Airmail from Hong Kong (largest Airsoft goods market in Asia and may be in the world) will not be less than $20.\n\nLet&#8217;s suppose you have managed all of the above and your bag of BBs has finally reached Pakistan, now comes the Pakistan Customs in picture. I am assuming that the Custom&#8217;s Officer inspecting your Parcel is in a very good mood so he will impose the minimum possible duty on the package which will be around Rs. 500 including the ST and resealing.\n\nFingers crossed everything is going smoothly so far so we take it that the parcel has finally reached your doorstep after around a week to 10 days of waiting, now after paying &#8220;Eidi&#8221; to the postman your bag of BBs will cost you around [B]Rs. 3500[/B].\n\nTaha, I have personally been through the above scenario a couple of times so I would request you to order a bag from the site you have located on the internet and please let me know the actual price you end up paying.\n\nBelieve me even after a total monopoly in this field the prices I have calculated for these products do not leave me with more than 5% to 7% profit. After such a huge investment only an injudicious person like me would be selling at this margin.\n\n [B]Airsoft is more of a hobby to me than business.[/B]\n\nHave you ever wondered why a Glock or Beretta cost what it costs in USA and why does it cost what it costs here in Pakistan?[/QUOTE]\n\nNow that''s an explanation :)', '', 'ec6b41e6c217106386a760e70e3d7029', 1319657059);
