(0x7642466f72756d5f506f7374, 304, 0, 6249, '[TABLE="class: MsoNormalTable, width: 175"]\n[TR]\n[TD="width: 80%, bgcolor: transparent"][CENTER][TABLE="class: MsoNormalTable, width: 518"]\n[TR]\n[TD="bgcolor: transparent"][CENTER][CENTER][B][I][FONT=Arial]Cartridges That Are Used in the Handguns[/FONT][/I][/B][B][I][FONT=Arial][/FONT][/I][/B][/CENTER][/CENTER][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n [CENTER][TABLE="class: MsoNormalTable"]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent, colspan: 2"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Caliber:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial].17 HM2[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Introduced:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]2004[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Type:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rimfire, bottleneck[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Made for:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rifle[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Velocities:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]2010[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]2100[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft/sec[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Energies:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]152[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]166[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft-lb[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Weights:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]17[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]17[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]gr[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent, colspan: 6"][B][COLOR=black][FONT=Arial] [/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"] [/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Cartridge Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1.000[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.714[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.226[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.172[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n[FONT=Times New Roman].17 HM2 (.17 Mach II) :[/FONT] [FONT=Times New Roman]This cartridge is based on a .22 caliber LR rimfire case that is necked down to seat a 17 grain, .17 caliber Hornady V-Max bullet. Although the overall length of the .17 Mach 2 is the same as the .22 LR, the necked portion of the casing is extended to support the smaller projectile. Keeping the overall size the same as the .22 LR made it easier for manufacturers to re-tool .22 caliber rimfire guns to the new .17 Mach 2 cartridge. This is a lightweight supersonic varmint round that, as its name indicates, travels almost twice the speed of sound. Its speed and weight provide a near-flat trajectory to 100 yards, but past that distance it looses effective energy. [/FONT][/TD]\n[TD="width: 254, bgcolor: transparent"][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n [CENTER][TABLE="class: MsoNormalTable"]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent, colspan: 2"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Caliber:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial].17 HMR[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Introduced:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]2002[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Type:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rimfire, bottleneck[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Made for:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rifle[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Velocities:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1966[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]2375[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft/sec[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Energies:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]146[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]250[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft-lb[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Weights:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]17[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]20[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]gr[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent, colspan: 6"][B][COLOR=black][FONT=Arial] [/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"] [/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Cartridge Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1.349[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1.060[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.238[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.172[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n[FONT=Times New Roman].17 HMR (.17 Hornady Magnum Rimfire) :[/FONT] [FONT=Times New Roman]This cartridge is based on a .22 Magnum (WMR) rimfire case that is necked down to seat a 17 grain, .17 caliber Hornady V-Max bullet. As done with the .17 Mach 2, the .17 HMR is sized such that manufacturers can easily re-tool .22 WMR gun designs to the new .17 HMR cartridge. This is a supersonic varmint round that travels over twice the speed of sound with near flat trajectory to 100 yards. The larger cartridge and load gives the .17 HMR more than 1-1/2 times the energy at 100 yards than the smaller .17 Mach 2. [/FONT][/TD]\n[TD="bgcolor: transparent"][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n [CENTER][TABLE="class: MsoNormalTable"]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent, colspan: 2"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Caliber:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]5.7x28mm FN[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Introduced:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1989[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Type:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rimless, bottleneck[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Made for:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rifle[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Velocities:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1890[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]2790[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft/sec[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Energies:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]222[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]538[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft-lb[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Weights:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]23[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]40[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]gr[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent, colspan: 6"][B][COLOR=black][FONT=Arial] [/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"] [/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Cartridge Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1.710[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1.130[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.310[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.220[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n[FONT=Times New Roman]5.7x28mm FN :[/FONT] [FONT=Times New Roman]This cartridge was developed by Belgium gunmaker Fabrique Nationale for its new personal defense gun, the P90 and its companion pistol, the FN Five-Seven. The military armor-piercing variant of the round is claimed to be far superior to the NATO standard 9mm cartridge. The civilian variants of this cartridge are not available with armor-piercing bullets, and as such have a much weaker performance, closer to that of the .22 WMR (.22 Magnum). [/FONT][/TD]\n[TD="bgcolor: transparent"][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n [CENTER][TABLE="class: MsoNormalTable"]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent, colspan: 2"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Caliber:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial].22 Short[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Introduced:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1857[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Type:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rimfire, straight[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Made for:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Revolver[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 110"]\n[TR]\n[TD="width: 40%, bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Velocities:[/FONT][/COLOR][/B][/TD]\n[TD="width: 8%, bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 11%, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]560[/FONT][/COLOR][/B][/TD]\n[TD="width: 3%, bgcolor: transparent"] [/TD]\n[TD="width: 3%, bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 11%, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1164[/FONT][/COLOR][/B][/TD]\n[TD="width: 3%, bgcolor: transparent"] [/TD]\n[TD="width: 9%, bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft/sec[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR