/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]32[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]40[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]gr[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent, colspan: 6"][B][COLOR=black][FONT=Arial] [/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"] [/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Cartridge Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.975[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.600[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.226[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.223[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n[FONT=Times New Roman].22 LR (.22 Long Rifle) :[/FONT] [FONT=Times New Roman]The Stevens Arms Co. developed the .22 Long Rifle rimfire cartridge from the .22 Long cartridge case developed 16 years earlier, with a 40 grain round nose bullet loaded to a higher velocity than the older 29 grain .22 Long bullet. Modern .22 Long Rifle High Velocity cartridges drive a 40 grain copper-plated bullet at a muzzle velocity of 1255 fps and muzzle energy of 140 ft-lbs from a rifle barrel. This rimfire cartridge has become the most popular sporting and target shooting cartridge in the world. [/FONT][/TD]\n[TD="bgcolor: transparent"][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n [CENTER][TABLE="class: MsoNormalTable"]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent, colspan: 2"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Caliber:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial].22 Hornet[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Introduced:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1930[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Type:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rimmed, bottleneck[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Made for:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rifle[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Velocities:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolo