olor: transparent"][B][COLOR=black][FONT=Arial]Cartridge Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1.720[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1.400[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.294[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.223[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n[FONT=Times New Roman].22 Hornet (5.6x36Rmm) :[/FONT] [FONT=Times New Roman]This cartridge is the oldest of the centerfire .22 calibers in use today. It was developed from an old black-powder cartridge called the .22 Winchester Center Fire. Although not quite as powerful as the .218 Bee, the .22 Hornet has begun to acquire new popularity as a varmint round. It has a mixed reputation for accuracy and its range is limited to about 200 yards. [/FONT][/TD]\n[TD="bgcolor: transparent"][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n [CENTER][TABLE="class: MsoNormalTable"]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent, colspan: 2"][TA