LOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.224[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n[FONT=Times New Roman].22 Magnum (.22 Winchester Magnum Rimfire (WMR)) :[/FONT] [FONT=Times New Roman]This cartridge pushes the limits of pressure possible with a rimfire case. Also referred to as the .22 WMR, the .22 Magnum was initially offered with 40 grain FMJ and JHP bullets at an advertised muzzle velocity of 2000 fps from a rifle barrel and 1550 fps from a pistol barrel. Due to the high supersonic velocity, .22 WMR cartridges are loaded with jacketed bullets. The various 30-40 grain JHP bullets are best for varmint hunting, but are overly destructive on small game. [/FONT][/TD]\n[TD="bgcolor: transparent"][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n [CENTER][TABLE="class: MsoNormalTable"]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent, colspan: 2"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Caliber:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial].218 BEE[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Introduced:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1938[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Type:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rimmed, bottleneck[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Made for:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rifle[/FONT][