D="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1.760[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.373[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.224[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n[FONT=Times New Roman].223 Remington (5.56x45 mm NATO) :[/FONT] [FONT=Times New Roman]The 223 Remington was developed as an experimental military cartridge for the Armalite AR-15 assault rifle. It is now a US military standard as well as an extremely popular commercial sporting round. The cartridge is nearly identical to the 222 Remington Magnum with the only difference being a slightly shorter case. Classified as a long range centerfire 22 round, its velocity is still supersonic at 500 yards. Note that while the military version (5.56x45mm NATO) is dimensionally the same, its higher pressure loads may be unsafe in civilian guns designated only for the .223 cartridge. [/FONT][/TD]\n[TD="bgcolor: transparent"][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n [CENTER][TABLE="class: MsoNormalTable"]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent, colspan: 2"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Caliber:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial].25 Automatic[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Introduced:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]1908[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Type:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Rimless, straight[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Made for:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]Semi-Auto[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Velocities:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]750[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]900[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft/sec[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Muzzle Energies:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]62[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]73[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]ft-lb[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Weights:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]from[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]35[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]to[/FONT][/COLOR][/B][/TD]\n[TD="width: 30, bgcolor: transparent"][B][COLOR=blue][FONT=Arial]50[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]gr[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent, colspan: 6"][B][COLOR=black][FONT=Arial] [/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"] [/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[TD="bgcolor: transparent"][TABLE="class: MsoNormalTable, width: 100%"]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Cartridge Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.910[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Length:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.615[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Case Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.278[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[TR]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]Bullet Diameter:[/FONT][/COLOR][/B][/TD]\n[TD="bgcolor: transparent"][B][COLOR=blue][FONT=Arial]0.251[/FONT][/COLOR][/B][/TD]\n[TD="width: 10, bgcolor: transparent"] [/TD]\n[TD="bgcolor: transparent"][B][COLOR=black][FONT=Arial]in[/FONT][/COLOR][/B][/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n[FONT=Times New Roman].25 Automatic (6.35mm Browning) :[/FONT] [FONT=Times New Roman]This cartridge was introduced in the United States along with the Browning-designed, Colt manufactured ''Vest Pocket'' pistol. Also referred to as the 6.35mm Browning, this semi-rimmed centerfire cartridge has fairly high velocity for such a small size. However, the energy it delivers at any range is quite low. This, combined with the full metal jacketed bullet, adds up to a very poor stopping or killing power on anything. The .25 ACP is not powerful enough for hunting anything but pests, nor is it adequate for serious self defense. However, the .25 auto caliber pistols are popular because of their small size and low cost. [/FONT][/TD]\n[TD="bgcolor: transparent"][/TD]\n[/TR]\n[/TABLE]\n[/CENTER]\n[/TD]\n[TD="width: 10%, bgcolor: transparent"][COLOR=#555555][FONT=Symbol][B]                                 [/B][/FONT][/COLOR][B][COLOR=#555555][FONT=Arial] [/FONT][/COLOR][/B][/TD]\n[TD="width: 9%, bgcolor: transparent"] \n[/TD]\n[/TR]\n[TR]\n[TD="width: 80%, bgcolor: transparent"] [/TD]\n[TD="width: 19%, bgcolor: transparent, colspan: 2"] [/TD]\n[/TR]\n[/TABLE]\n ', 'Cartridges That Are Used in the Handguns', '1d9db896977f5aaa473fbd18a4741635', 1321000703);
