(0x7642466f72756d5f506f7374, 7479, 0, 861, '[QUOTE=Abbas;223629]Salams, lovely rifle and excellent groups. The scope looks great, so in all the package cost you Rs. 300 k ?  That''s pretty decent ! I''m 380 K + out and still waiting on the rings and the ammo ! :(\n\nI specially like this picture:\n\nIf the shooter anchors or rests both elbows on a larger and higher table and uses a chair to sit o the test groups would be much better.\nI only wish the  cute CZ Rifle in Cal 223 had a 1 turn in 7 or 8 or even 9 inches it would accurately shoot the 62 grain military ammo cheaply available. Unfortunately it is rifled to one turn in 12 inches and suitable for 55 grain and lighter  bullets. It would how ever shoot hunting bullets of 60 or 62 grain bullets fairly accurately as the game bullets are shorter in length and are stabilized by the 1 in 12 rifling the military 62 gr. bullets have a steel core and are much longer relatively and are not stabilized thus taking away the advantage of using cheap military ammo. \n\n[IMG]http://i577.photobucket.com/albums/ss220/denovo87/CZ-527 day out 29-10-11/007.jpg[/IMG][/QUOTE]', '', 'a731e374c7b38619032e3ce11e6aa1d1', 1320485368),
