(0x7642466f72756d5f506f7374, 3140, 0, 6770, '[QUOTE=Gilani;105669]This really is not a standard test. [B]I shot in a hurry just before maghrib in bad light conditions, standing, with both hands, without any rest.[/B].  In all other tests, I fired sitting with my elbows resting on the table and in good light conditions. I should therefore not be posting this results because its not fair with Steyr, but just for the reference sake, I am doing it. On top of it, it was quite a used handgun with around 9000 rounds already through it. See the result for yourself............ :)\n\n\nFirer:         Gilani\nHandgun:    [B]Steyr M-A1[/B] \nCondition:    Good. 80%\nBarrel:        102 MM\nSize:        183x130x30 mm\nDist:        10, 20 & 30 M\nAmmo:        POF1Z\nSequence:    5 shots from 10 M, 5 from 20M and 5 from 30M on the same target, Standing with both hands.\nStoppages:    None out of 15. \n[B]Score:        112 / 150[/B] [B](74.6 %)[/B](total on target sheet is 111 which is incorrect)\n[B][U]Groups[/U][/B]\n   -  10 M................1.5 inches (50/50 pts)\n   -  20 M................4.0 inches (40/50 pts)\n   -  30 M................7.6 inches (25/50 pts)\n   -  ....................... [B]115/150 (76.66%)[/B]\n[B]Overall Score[/B]......... 112+115=[B]227 / 300 (75.66%)[/B]\n\n[B]Accuracy Rating:    FAIRLY ACCURATE[/B]\n\nhttp://i206.photobucket.com/albums/bb136/sualeh/Comparative%20Shooting/DSCN6052.jpg\n\n[IMG]http://i206.photobucket.com/albums/bb136/sualeh/Comparative%20Shooting/DSCN6052.jpg[/IMG]\n\nGentlemen, had it not been Steyr trapezoid sights, I would have not been able to shoot in such low light conditions. Even under these sub-standard conditions, the pistols performed quite well. Under better light conditions and with more focused firing, this pistol will surely perform far far better and would have easily been around 130 points. I have fired Glocks also, but this is a special pistol, no doubt about it. This is the second Steyr I have fired, the first one belonged to Bader Janjua sahib. To say the least, this is an excellent and very accurate pistol, specially for shooting under low light conditions and rapid fire.[/QUOTE]', '', '400948333360ee4b3a509dc988a83203', 1327664748),
