(0x7642466f72756d5f506f7374, 0, 295988, 3593, '[QUOTE=Masroor;295872]Great Nice Thread,,,,,,,,,,,, beautiful Discussions.............  But I think when You got a good Spot For partridges, Ducks Ect...... Than You Can Get good Bag Even With Desi Guns Or Sunshine Cartridges Too. I have believe In It. Actually In My Opinion True Hunting sports Guns Are S*S or over Under. Still A large Numbers of Good hunters In Europe Specially Like to Shoot Birds With Fix Chokes Side By Side or Over Under. Even Bretta Auto Loaders mother Land is In Europe. USA Is The Country Where Most common Wing shootings guns are Auto loaders.[/QUOTE]\r\n\r\nMasroor sb, u r lucky indeed to have seen those kind of waterfowl waves back in 1988 and around. Since when have these birds become this scanty as we see nowadays during migration especially. \r\n\r\nMigration times should not affect those waves as all ducks HAVE to pass our routes and then reach Sind waters....BUT this does not happen now. Now either too high flights are seen passing over your blinds or, few days (very few) available for those ideal duck migration and decoying. By that, I don''t mean no duck shooting opportunity now... I have had some really good shooting myself in the last few years including last season too, but, situations are quite competitive and dicey now... DICEY meaning they can shift either way anytime unexpectedly - in b/w khawari & a good shoot.\r\n\r\nYes, reason for autoloaders in USA is: steel shot and magnum etc cartrgs for waterfowling, & even turkey hunting. Thats where the real advantage of repeater is. Europeans are as I know more into upland, grouse, quail, pheasant, and this craze of using magnums and high powered stee In USA there is a duck/geese craze both which require semis. No harm with semis actually. But the pleasure of shooting a classic SxS English for example with fixed (say 1/4 & 1/2) chokes and double trigger is matchless. But Masroor sb, who will pay 10 lacs plus for such guns nowadays and go into hunting areas which have additional security problem always. These classic guns are beyond one''s budget in general, if bought new. Majority in use are inherited by hunters from their seniors. So the world is shifting to practicality & economies of scale with soaring labor costs and that has a certain cost to it. Even in England and Europe, these so called classics (SxS, NIB) are afforded by Lords/Nobility there, not the commoner. But then there is another issue ....What is the weapon one is so used to firing since childhood? You would have been using a SxS since start probably. I have been using for example autoloaders since start (Remington 1100 at early age, then Ber A303 & then Teknys)... How can a person so used to the feel of a single sighting plane since childhood, suddenly adapt to double guns such as SxS even if he does. So, there is another angle to it too.\r\n\r\nAlso, the gunfit issue??? SxS or O/U unless properly fitted to a shooter especially LOP/DAC/DAH/Cast...will create problems with one''s shooting espec at flushing game which essentially requires the perfect gunfit. Aya#4 or Aya#2 e.g. have a certain fixed dimensions. Except the LOP, nothing can be changed whereas majority of repeaters have shims etc for that purpose. So, not every classic SxS even if available at a good price will fit perfectly too. Thats a real problem. \r\n\r\nIf one is looking for a classic SxS (European/English) with fixed chokes (1/4 & 1/2), sidelock or boxlock, ejector, NIB or slightly used mint condition, 26" or 28" barrel, neutral balance or slight fwd weight bias, LOP 14.25", Cast Off 1/4", DAC 1.5", DAH 2.4-2.5", weight 6.25-6.75 lbs at a reasonable price, what are the options for a shooter?', '', '2862ae13d7b6c2e688c6da1bae9309c8', 1347000080),
(0x7642466f72756d5f506f7374, 8406, 0, 3199, '[QUOTE=Mavrick;252592]And about omkhan bro''s incident , Allah was on your side bro you got a new life ! ... \n\nBut on the other hand , Not intending to offend , i wanna ask , if you had killed a guy or two out of the three who came ,  how would live without the fear of more of them seeking revenge since they arnt alone... Since its a profession for them , not for us ...  What would you do ? Plus Most of the time they have backup covers lurking nearby ..[/QUOTE]\nThen probably you should have security guards guarding your home afterwards.', '', '1954781dbc5a74d9c7af8dba54e2e7bf', 1330971880),
(0x7642466f72756d5f506f7374, 11511, 0, 9434, '[U][B]Transfer Port[/B][/U]\n\n-- I think the most complex area from design perspective ... anyway here is what i learned from net \n\ngenerally the gun designers keep transfer port half the size of internal barrel dia i,e a .22 air rifle has a internal barrel dia of 5.5mm so the transfer port dia is around 2.75mm.. lately (yr 2000 onwards) this barel dia has been slightly reduced to snug fit the pellets but for calculation sake 5.5mm is considered as the standard \n\n-- when springer fires, the spring moves the piston towards transfer port and the air is reaches a high velocity due to small size of this port -- as a tuning aspect this transfer port dia is increased with a concept that it will give more air pressure to pellet and more fps but this is a very sensitive area and doesn''t always happen like this .. here are a few stats to clarify \n\nA Weihrauch hw80 has a std transfer port size of 2.80mm and an increase in dia to 3.175 gives optimum force i''e an increase of 30-50fps then uptil 3.5mm the output is almost constant but ahead of 3.5mm it starts to decrease so much so that you might loose the original fps at 4.00mm by a slight margin \n\n"A thumb rule is that transfer port for springers be increased to 3/4 of internal barrel dia and no more"\n\nother variations in this field are :\n\n-- offset transfer port which is generally considered a power loosing option yet high power rifles do have offset transfer ports \n-- polishing the transfer port .. not recommended again (explanation includes desired eddies and swirling effect)\n-- inside of a transfer can be made a funnel shape, bell shape, step ladder shape and many more but i was unable to find any usefull review on their advantages\n\n--- transfer port dia is increased by drilling and the precautions include :\n   ---- keep the straightness while drilling \n   ---- the original hole should not be offset in dia increase process \n\nsome pics and drawings for understanding transfer port\n\n', '', 'cda5e3b512eb9d23be2b7d975a50265a', 1371324323),
