(0x7642466f72756d5f506f7374, 8394, 0, 5467, '[B]What does "caliber" refer to?\n[/B]Caliber is used to describe the diameter of a bullet. In the U.S., caliber is generally given in inches, with 1.0 equaling one inch. Other handgun calibers include: .22, .25, .38, and .45. \n\n\n[B]What''s the difference between automatic and semi-automatic guns?\n[/B]A semiautomatic weapon fires one shot every time the trigger is pulled. An automatic weapon fires continually until the trigger is released.\n\n\n[B]What is the difference between a pistol and a revolver?[/B]\nBoth are handguns. A revolver contains a revolving cylinder in which bullets are loaded. Revolvers usually hold six shots. The ATF defines a pistol as any handgun that does not contain its ammunition in a revolving cylinder. Most pistols have a removable magazine into which bullets are loaded. The magazine is then inserted into the hollow handgrip of the gun.\n\n\n[B]What does "dropfire" mean?\n[/B]A dropfire is an accidental discharge of a firearm caused by a gun hitting the ground or other surface. For a pistol, the shock from impact causes the gun''s spring loaded striker mechanism to jump loose from its safety and snap forward, striking a bullet in the gun''s chamber and firing the round.\n\n\n\nRef: http://www.pbs.org/wgbh/pages/frontline/shows/guns/more/faq.html\n\n', '', '917e5c5c66e484fd1b7be19e80d18b19', 1331141264),
