(0x7642466f72756d5f506f7374, 8431, 0, 6974, '[QUOTE=Qaisrani;253042]AOA. Please tell me that which is the best 9mm pistol? or any other good choice in this price range?\nAlso tell me Price of these handguns too. Thanks[/QUOTE]\n\nMP 446:\nMP-446 has a double action trigger with ambidextrous frame-mounted safety lever. External hammer is enclosed from the sides by the rear extensions of the slide, which makes decocking procedure somewhat complicated, as pistol has no decoking mechanism. When engaged, safety locks the sear, trigger and slide, and allows for ''cocked and locked'' carry, with the hammer cocked and safety engaged. Magazine catch is located at the bottom of the trigger guard and can be installed on either side of the gun. Double-stack magazine contains seventeen rounds of 9mm ammunition. Rear sight is dovetailed into the slide and can be had either in fixed or adjustable versions.\n[B]Type:[/B] Double Action \n[B]Calibers:[/B] 9x19 Luger / Parabellum \n[B]Weight unloaded:[/B] 830 g \n[B]Length:[/B] 198 mm \n[B]Barrel length:[/B] 112 mm \n[B]Capacity:[/B] 17 rounds \n\n', '', '775b84202dc3ab12a05af31ddc8d75f4', 1331110067),
