(0x7642466f72756d5f506f7374, 0, 287888, 2623, '[QUOTE=Sniper10;287245]I applied for my manual license on the 15th of june''12 and i finally got it today(8th aug)..but i have a question.The date of issue on the license is 25th june''12 and it will expire on 31st dec''12.Is that alright?Also when i asked the guy about registering it at national bank he said that there is no need to register it right now and when i go for renewal they will register it then.He also told me that he can get it registered in dco after i buy my weapon and he''ll charge 1500.PS entry he said is optional.[/QUOTE]\n\n@Sniper, congratulation for the license. Following examples will help you to understand.\n\nI received my manual license in Oct 09, and was renewed in Dec 09 (Same year) so in your case it is equally OK. BTW, you always enjoy one month grace period as well.\n   \nlicense will be automatically registered with the National Bank Of Pakistan when you will go for its renewal. the Bank cost is Rs 500 per year and you can pay for as much years as you wish.\n\nThana registration is compulsory and not optional.  It is also written on the license too and this should be done  within the specific time. Just walk into the concerned police station and meet the Head Moharrar personally.  Rest will be taken care of by him. normally no charges. I registered two licenses (One Manual and One Computerized) with my concerned police station and no charges paid\n\nfor DCO registration, er buying the weapon, walk into the DCO office, meet the receptionist, submit your license and it will get registered on a manual journal.  please do register with the DCO as well because when you will go for a computerized copy, DCO verification will be asked by the Home Dept.\n\n Hope this will help you in your case.:smile:\n', '', '6095be9ea8ec44e2da36a523bcf4b84b', 1344598082),
