(0x7642466f72756d5f506f7374, 5797, 0, 5846, 'For the benefit of all who are having problems with the point of impact while sighting in their rifles remember the simple rule:-\n\nFor Elevation errors adjust the rear sight up or down the way you want the bullet to impact.For example if the rifle shoots high adjust the sight one notch low, and if shooting low adjust one notch up.\n\nFor errors in azimuth ( left/right) adjust the rear sight"[B]Against the Erro[/B]r" that is if it is shooting left adjust one mark/graduation to the right and vice versa.\n\nDon''t mess with the front sight if at all you have to then" [B]Move in to the Error[/B]" that is move the front sight to the left if you want the impact of the bullet to the left.\n\nBut adjusting the rear sight should suffice and leave the front sight untouched and unadjusted as you received it new from the manufacturer, unless you  really have to because for some reason you have removed it and want to replace it with a new one.     \n\n \n', '', 'b5256a2bf6599cb2dd1b093f61ec30f4', 1322727892),
