(0x7642466f72756d5f506f7374, 6201, 0, 2624, '[QUOTE=Mehdi;228436]@Ameer.\r\n\r\nBro you are right the doves when in full flight require some hitting, same for pigeons.\r\n Labairs are very soft skinned, you must have noticed that many a time when during picking it up,if you grab the Labair from the tail it  comes off very easily, this does not happen with other dove species.It also sheds lot of feather''s when shot.\r\n\r\nI always use No 8 for them and I have brought them down from considerable heights.May be  My favourite  SX 32 "Midland"  which I use for all of my shooting including pass shooting Ducks, Pigeons , Labairs throws a very good pattern better than 27" or 28 " barrel guns.Also as you know the pattern of each gun is different with same Shot Shell.[/QUOTE]\r\nthen u r lucky to shoot labairs with #8,may b the barrel length/pattern is playing important role in it.\r\nwhat i have experienced is that labairs need atleast #6 at long ranges,on my last labair shoot i shot one which was way too high and i was myself not sure that i will hit it', '', 'da2c8ee26944df4f1a6f766c07b70b52', 1322579199),
