(0x7642466f72756d5f506f7374, 7154, 0, 6489, '[QUOTE=Abbas;213284]I took the Brno out on a one day stand kinda outing. I thought I would shoot a few hundred rounds though it, zero the gun, clean it and back into the closet it goes but the results it started giving me me it take it to the range twice more.\n\nDay 3 and about 500 rounds shot total in three days. Targets are all at 50 Meters. On both targets 35 rounds each were fired.\n\n[ATTACH=CONFIG]4019[/ATTACH][ATTACH=CONFIG]4018[/ATTACH][ATTACH=CONFIG]4022[/ATTACH]\n\n\nUsually when you shoot targets like the ones above there is almost always no one there to witness. Luckily it was a Sunday and atleast ten friends were present ;)\n\nI was completely astonished ! One inch groups at 50 Meters is phenomenal accuracy. I''m sure if we had a rifle rest this gun is fully capable of giving half inch groups at 50 metes. \n\nSince this is known more as a hunting gun rather than a target shooting gun (I wonder why) I wanted to see what kind of performance a .22 LR hollow point would give at 50 M. I put a glass bottle of Sprite below my target and shot at it, it exploded ! Did not break, did not shatter, it EXPLODED! \n\n[ATTACH=CONFIG]4020[/ATTACH]\n\nI would not like to be on the receiving end of a .22 hollow point. We tried to make video to share with you guys but it turned out very hazy. Any Rabbit/Hare sized game within 100 Meters is very easy with this gun. It is indeed one of the most value for money guns one can buy. \n\n[B]Verdict:[/B] If you find the Brno .22 anywhere, pick it up instantly. This is a must have for any one of any age and any kind of shooter.\n\n[ATTACH=CONFIG]4021[/ATTACH][/QUOTE]\n', 'i am a new member, read your comments about Brno .22 LR. i possess one, Modle 67. it', '884df5f5980a273ad1df90c350bf8166', 1322497661),
(0x7642466f72756d5f506f7374, 0, 228840, 5467, '[QUOTE=4311446;228634]Bro there is a difference between what law permits and what is safer approach.\nKeeping a license and not buying a weapon on it is allowed. I have two such Lic which are unused and will stay unused till the time I find a great deal.\nBoth of them are registered at police station as I did not want to keep them without registration in PS.\n\nIf any wants to go for safest approach then do re-register the Lic at PS after change of weapon on the Lic.[/QUOTE]\n\nThanks brother for the information.\n\n@Looser: Brother i hav', '', 'dc5742d7a5fe751c68f2179ed21612ae', 1322711725),
