(0x7642466f72756d5f506f7374, 7684, 0, 608, '[QUOTE=hsnmz;229048]in my humble opinion sxp is a fine shotgun and will handle slugs, buck shots just fine.[/QUOTE]\r\n\r\nBro, even a quality desi shotgun can handle slugs. The ability to handle slugs was never questioned. only the ability to launch slug with any decent accuracy was questioned here. without rifle sights, it is extremely difficult to aim single projectiles such as shotgun slugs.\r\n\r\nit goes a little further. A short barrel with only bead sight is very difficult to aim. not a problem with longer barrels due to longer sighting plane. but with 18 inch barrel it is very difficult. that why I wrote that you should try shooting at a man-sized target from 10 yards away and you''ll realize how easily one can miss the broad side of a barn. Hollywood has turned a short barrel shotgun into a cannon of death that destroys everything in its path. lols!\r\n\r\nbead sights are meant for rapid target acquisition but at the loss of accuracy. for longer barrels its fine but for shorter barrels they really cripple the aiming abilities of the shooter because at typical HD distances, the pattern is not much larger than a cricket ball that needs to carefully aimed. now you know why most tactical shotguns used by LE agencies are equipped with quick aiming devices and rifle sights (ghost ring).\r\n\r\nRegards.', '', '703ddf0d9bce71e841eb751b6d3b74a0', 1322815593),
