(0x7642466f72756d5f506f7374, 1204, 0, 3294, '[QUOTE=Zee Black;274823]I have been reading these forums for quite some time and majority of the members are of the view that Pakistan made weapons (including the clones) are not good. They would prefer paying quite a hefty premium for a Glock/ Beretta (which are $500 weapons) but wont go for a local made weapon. \r\n\r\nAgreed that our local crafted weapons may lack the finesse. it is because that our craftsmen lack the technology to make good weapons. They make the guns with their hands as they don''t have any state of the art machinery. Give our craftsmen the technology and they would be able to produce much better products than these foreign manufacturers.[/QUOTE]\r\n\r\nIn America and this somewhat applys in Europe also, they use state of the art equipment to make guns but their goal is to make as many as possible and ignore QC issues. Right now Glock is plagued with bad springs and ejectors, my new german made Sig So', '', 'e896e1231b15e87671b1aa76061b8729', 1341688945),
