(0x7642466f72756d5f506f7374, 7767, 0, 5467, '[QUOTE=Denovo87;231853]Ak bro; most of the incidents of AD I heard about were by the hands of very expert gun handlers ;) secondly its not myself I am worried about but the people around me who I love and care,  since I carry my pc in car so even my driver who washes my car is my concern. \nIn society we live n the culture we have is a bit different than US & Europe where every one minds his own business but in our society every one like to find what other is doing (carrying). You tell me honestly how many times you showed your weapon (or asked to show) to your friend, relative, colleague at other than a shooting range? for me it happens when ever some one close finds me with a gun. \n\nI even am afraid of handing over my chambered gun to a police man at a check post & un chambering a gun in front a police officers at a check post scares me more where they are quite ready to react on the sound of a slide rack. \n\nResponding a threat with un chambered gun will cost me an extra ''second'' but the same extra second can favor me in case my own gun goes into wrong/bad in a hold up situation; in this case I even will have more time as its me who knows the gun is empty not the offender ;)\n\nYes; when you are going through the circumstances where a threat can come from any direction & at any time; you are well justified to carry (a) a biggest possible chambered gun (b) with as bigger magazine as your gun allows & (c) as close as you possibly can.\n\nFor a social person with now known enmities, working class citizen traveling in urban area most of the times, going to civilized places mostly as a part of his job or the circle he moves in etc I dont think carrying a chambered gun is a wise decision. I see white collard people daily indulged in road rage and by seeing their vicious behavior I always thank God that none of the two opted to carry a chambered gun ;) so everything ends in [I][B]slinging the mobiles[/B][/I] to call backup instead of [I][B]slinging loaded Rami''s[/B][/I]  that would end one in police station n other in morgue ;)[/QUOTE]\n\nNicely explained Den brother', '', '9df49a99caa843e584551e04b39a0d40', 1324047282),
