(0x7642466f72756d5f546872656164, 0, 0, 1955, 'Salam All,\r\nThere is a topic which has, surprisingly, never been discussed on this forum; the difference between blowback and locked breech designs. \r\nBlowback; the barrel is fixed with the frame, it is not &#8220;attached&#8221; to the slide in any manner. When you shoot, the bullet ignites, starts its forward journey through the barrel, the rearward momentum pushes the slide (through the case) rearward and gun cycles. \r\nNow, this is all good and not that hard to achieve, but the problem with this design is that it doesn&#8217;t work well with powerful calibers. It works really well in .380 and below. The reason is that force exerted by the round on 2 points; the point at which the barrel is connected with the frame and the point which stops the slide&#8217;s rearward travel. This recoil can actually be absorbed using 2 methods, you can actually make the slide really heavy or you can use a stronger spring. This can be done, but would involve substantial increase in the slides weight (which is not favorable as it will make the weapon extremely heavy) or such a strong spring that might actually hinder (putting it mildly&#61514;) the racking process. Some blowback designs have been employed which have really heavy slides but those are PB so no discussion. Some notable examples are Makarov, Walther PP and PPK. Since the barrel is fixed, these guns are extremely accurate.\r\n\r\nLocked Breech; the barrel is locked with the slide when the gun is in battery. Let me first try to explain how the system works then we&#8217;ll get into the different types. \r\n	&#8216;Short recoil operation \r\nThe short recoil action dominates the world of centerfire automatic pistols, being found in nearly all such weapons chambered for 9x19mm Parabellum or higher-powered cartridges (weaker cartridges, .380 ACP and below, generally use the blow-back method of operation). Short recoil operation differs from long recoil operation in that the barrel and slide recoil together only a short distance before they unlock and separate. The barrel stops quickly, and the slide continues rearward, compressing the recoil spring and performing the automated extraction and feeding process. During the last portion of its forward travel, the slide locks into the barrel and pushes the barrel back into battery.&#8217;\r\nSource: Wikipedia Article &#8220;Recoil Operation&#8221;\r\n\r\nThe first handgun to handle a big caliber was the venerable Colt 1911 in .45 which was designed by John Moses Browning. It used locking lugs on top of the barrel to lock the barrel into grooves inside the slide. There was a linked cam attached to the base of the barrel, which also linked the barrel to the frame via the slide stop. Hence, the barrel was ATTACHED to the frame (of sorts), but allowed the forward/rearward movement of the barrel which was just enough for the short distance the barrel moves back when the gun is cycling. Later on, the design was changed by Browning himself in the Hi-Power; it was found that the link could be completely left out since the barrel is already &#8216;Locked&#8217; with the slide. This locking actually transfers all the energy to the slide but delays the opening of the breech till the bullet has left the barrel and the pressure inside the gun has somewhat subsided. After the barrel moves a short distance, the barrel chamber tips down disengaging the lugs from the groves inside the slide, while the slide continues its travel due to inertia. The spent case is ejected and the slide loads a fresh round into the chamber and goes back into battery.  One other noteworthy example of link system, especially in Pakistan, is the Tokarev TT-33. Ok now coming to link less locked breech system, well in terms of reliability the link less is as reliable as the linked version. Most of the modern semi auto handguns operate using the same link less system. \r\n\r\nOk one other major step in the evolution of this system was brought by SIG Sauer of Germany. Instead of making locking lugs on the barrel, they designed a square chamber for the gun barrel which locked with the slide. The principle is the same; it just reduces production cost, is easier to fabricate and has been tested vastly enough to know that there is no change in accuracy, in fact quite a few modern handguns use the same &#8216;Modified&#8217; Browning link less locking design. Some noteworthy examples are the P226, Glocks, Springfield XD series, CZ 40, CZ 97, CZ P-07, RAMI, the CZ999 and probably many more.\r\nOne other very noteworthy method of attaining locked breech is one employed first in the Walther P-38, later on in the Beretta 951 and subsequently in the 92 series. This is a unique and interesting action. Instead of the chamber side of the barrel tipping down, the guns use a locking lug that FALLS down during the rearward travel. As soon as the lug drops, the barrel becomes stationary and the slide continues. Since this design doesn&#8217;t have the lugs on top, the top of the slide can be completely left out, but the sides of the slides in are under lots of stress since the lugs lock into them. This is why the sides are pretty thick. This system is not as durable as a conventional or modified Browning system, and the locking block of the gun needs to be replaced after a prescribed number of rounds. Initially some failures of the locking block and slide breakage were reported in these guns, but have been addressed by Beretta in the 92FS and onward models, but they still do have a life. This brings me to one of the most important points, all except one of the local 92FS clones that I&#8217;ve seen have been damaged either due to locking block failure or because the area on the slide where the lugs fit into gets deformed.', '', 'dac1776ab9ef509e9819b8f2280476cc', 1323975250),
