(0x7642466f72756d5f506f7374, 9255, 0, 1408, '[QUOTE=Kamranwali;280270]Salam,\nWelcome to the forum, even though I''m not sure i should be welcoming you as you''ve joined in oct 2009. Its good that you''ve decided to end your silence.\n\nBrother, the barrel should be absolutely dry before firing. When you shoot, for every bullet that you shoot there is a small explosion of gunpowder, this produces gases which push the bullet through the barrel. If you''ve ever noticed there is flash from the barrel which is the basically the explosion. If your barrel has oil in it, this explosion ignites the oil as well, which produces carbon particles, which keep on depositing inside the barrel and eventually can cause irrepairable  damage to the barrel.\n\nSo..... please tell all the people that have told you that the barrel should be oiled before shooting that they are wrong and should stop doing it AT ONCE.\n\nRegards.[/QUOTE]\n\nThis \n\nand also avoid lubein the barrel is that it acts like a paste when dirt  and grime and dust mix with it over time, which can interfere with the  operation of the weapon. \n\n\n\n', '', '9cfa80680cf51fd799fdb75ada2750eb', 1342290984),
