(0x7642466f72756d5f506f7374, 8149, 0, 1408, 'I have had quite different experiences with Police and Army as regards to "weapons"\n\nArmy:\n\nIncident 1\nStopped on a checkpoint and asked to step out of the car.Told the jawan i am carrying  a pistol under my seat and the lisence is in pocket.asked me for the lisence.Took the lisence looked at the picture.asked to see the weapon.told him it''s under the seat and the chamber is loaded.takes it out, removes the magazine and matches the number with lisence.Thanks me for cooperation and lets me go.\n\nIncident 2\n\nStopped at another point by MP checkpoint.Asks me to to step out.tell him very nicely that i am wearing my pistol /chambered.asks me for the lisence .I hand over the lisence he checks it against my ID.Tells me to step out and leave the weapon on the seat of the car.Checks the number against Lisence and hand bck the lisence.Jokingly asks why i need a hand cannon(PT1911) i replied "becasue everyone has a TT" We share a laugh and i am on my way.\n\n\nPolice\n\nStopped,declared weapon and hand over the lisence/weapon.Ask me why i carry a gun,ireply that we have personal enimity.Ask me my adress,fathers name and profession despite or may inspite of it all being in the lisence.Wanted to count the rounds in the istol despite the witness holes on the mags clearly showing the rounds.then declared the \n\n', '', '32164e6903dafab7943ad5d4f5501667', 1328072871),
