(0x7642466f72756d5f506f7374, 0, 234883, 998, 'Salamz Dear Colleagues,,,\n\nI was able to get Great Results with My Beretta''s 92FS & Recently Purchased Beretta 90two at the Gun Club Islamabad Range,,shooting Plates at 25Meters\n\n<font color="#2a2a2a"><span style="font-family: Segoe UI">[video=youtube;AxBGU_1LhK0]http://www.youtube.com/watch?v=AxBGU_1LhK0&amp;feature=youtu.be[/video][COLOR=#2a2a2a][FONT=Segoe UI]\n[/FONT][/COLOR]\n<font color="#2a2a2a"><span style="font-family: Segoe UI">[video=youtube;ZJqor2gD0MI]http://www.youtube.com/watch?v=ZJqor2gD0MI&amp;feature=youtu.be[/video][COLOR=#2a2a2a][FONT=Segoe UI]\n\nKindly take some time Out to watch these two Video''s & leave your comments. God Bless,,[/FONT][/COLOR]\n\nSalamz Colleagues,,,I am posting this Video on great Public demand,,,[COLOR=#0000cd][I][B]I am Simply In Love with this Piece of GEM,,its none other than FN 5 7[/B][/I][/COLOR] ,,The World''s Most Accurate Handgun ( not only my claim ),,Its also without Practically Any Recoil,,You are Firing a 30 round Extended magazine with 5.7x28mm ammunition that can Penetrate upto 48Cavlar & when you actually dont see ANY Bullit Drop till 200 Meters,,literally your Jaw drops....\nMind you,,you are not Shooting a very Sophisto Rifle here,,,Its A Handgun,,,\nEnough of My Ranting about this Jewel I own,,lets get on to some Cool Chillin'' & watch''n the Video :)\n\n[video=youtube;NXR268x2jQY]http://www.youtube.com/watch?v=NXR268x2jQY&amp;list=UU_Uj-JFVkxaZO59NHnGeDMg&amp;index=8&amp;feature=plcp[/video]\n\n[COLOR=#0000cd][I][B]CZ 75 Checkmate[/B][/I][/COLOR] is another useful addition in my Weapons Arsenal,,,for shooting with red-dot Sights,,I feel its Okai,,this Video I am posting below shows me shooting my CZ 75 Checkmate Without Zeroing My C-More Sights,nevertheless I feel the Tight Group shows it to be a fairly reliable weapon in Competition Shooting :)\n\n[video=youtube;8p_DhOyTneA]http://www.youtube.com/watch?feature=endscreen&amp;NR=1&amp;v=8p_DhOyTneA[/video]\n\n[video=youtube;EmY9H-8sMS4]http://www.youtube.com/watch?v=EmY9H-8sMS4&amp;feature=mr_meh&amp;list=UU_Uj-JFVkxaZO59NHnGeDMg&amp;lf=plcp&amp;playnext=0[/video]\n\n[COLOR=#0000cd][I][B]Zeroing My T1 Aimpoint Red dot Sights on a Glock 21 ( .45 ) [/B][/I][/COLOR]was a novel experience,,I loved the way it used to hit quite accurately on The bull :)\n\n[video=youtube;EmY9H-8sMS4]http://www.youtube.com/watch?v=EmY9H-8sMS4&amp;feature=mr_meh&amp;list=UU_Uj-JFVkxaZO59NHnGeDMg&amp;lf=plcp&amp;playnext=0[/video]\n\n[COLOR=#0000cd][I][B]Posting yet another video of FN 5 7 on the Target[/B][/I][/COLOR] :),,a tighter Group :)\n\n[video=youtube;QAGorg5KEb8]http://www.youtube.com/watch?v=QAGorg5KEb8&amp;feature=autoplay&amp;list=UU_Uj-JFVkxaZO59NHnGeDMg&amp;lf=plcp&amp;playnext=1[/video]\n\nNow I am Posting My shooting with [COLOR=#0000cd][I][B]Colt Lightweight Commander 4# Barrel at 25 Meters [/B][/I][/COLOR]( 9mm Lousy Chinese Ammunition ).. As you would also Vouch that on two Odd Shots that I missed,,the Bullit Drop was Amazing,,has to do with faulty Ammunition,,I swear it had nothing to do with Moeen Saheb''s Commander ;) or My Lack of Concentration :),,\nKindly be fair in your assesment & Comments,,,watch the link below & judge :)\n\n[video=youtube;49_zP4q9_9c]http://www.youtube.com/watch?v=49_zP4q9_9c&amp;list=UU_Uj-JFVkxaZO59NHnGeDMg&amp;index=6&amp;feature=plcp[/video]\n\nOkaii,,let me Post one Last [I][B]Video of a friendly competition between me & My younger brother[/B][/I],,Mr Awais Leghari,,,he scored a 47/50 with Glock 18 & then challenged me to beat him ,,,well under pressure with 5 ( very Expensive 5.7x28mm SS190 ball Ammo ) Rounds,,,I was able to beat him getting a 47/50 with 2 in 10 & 3 in 9,,,as he had a spread group while mine was a Tighter one ;)\n\n[video=youtube;OcJBso6sNqw]http://www.youtube.com/watch?v=OcJBso6sNqw&amp;feature=autoplay&amp;list=UU_Uj-JFVkxaZO59NHnGeDMg&amp;lf=plcp&amp;playnext=1[/video]', '', '100e3a3170240f5968384da3ef9dd3c4', 1327906774),
