(0x7642466f72756d5f506f7374, 7988, 0, 5855, '[QUOTE=asadraja;239294]Dear all, I am Khalid Mehdi''s youngest son and it was on pure whim that I googled his name, only for it to come up under this thread. I have been out of the country for quite some time and had no idea about his online friends in the forum. After reading through all the condolences, I could not stop the flow of tears. Denovo87, thank you for collecting all the topics he has started. I do not have the heart to read them now.\n I am indebted to all of you for all the kind words and dua''a expressed here. Knowing his departure from this world means I will not hear his joyous laugh and cheerful demeanour has left a void which cannot be filled. My last image of him was almost a year ago, I yearn with all my heart to see him one last time, which will never happen.[/QUOTE]\n\nbro, May Allah grant him peace and a place in heaven. our prayers r with u n ur family, the Almighty who has taken him away from u, will give u the courage to deal with the loss  ', '', '642b77c062a4b9e1622448a5e523f8e3', 1326615756),
(0x7642466f72756d5f506f7374, 9276, 0, 1408, '[QUOTE=Manager;281014]I don''t understand the point of keeping a licensed gun and not using it when you get robbed. \nLets say if i get robbed in a street and the robbers get back on their motorcycles(as always) and then i shoot them from behind with my licensed weapon, so would i be prosecuted for it or would it be counted as self defence, ofcourse i am not that mad to take out my gun when they are already pointing one at me so i will have to take it out and shoot when they are getting away, but again  in that situation would that be called self defence or not? will i get away with it or not?\nPlease reply if you really know the law regarding this issue, DONT ANSWER IN " I THINK" or "MAY BE" !![/QUOTE]\n\nOnce the robbery is over and they move away from you and are leaving the scene then your life is not threatened and you can''t exercise the right of self-defense.However if they turn away and start robbing someone else then you are with law to exercise the  [B]Right of private defence of the body and of property[/B] (section 97)\n\n[QUOTE=Denovo87;281016]You can if you have been shot by themselves first,  [/QUOTE]\n\nNO the right of selfdefence =including death starts the second they initiate offense that puts you under the apprhension of death or injury.\n\n[QUOTE=Khan381;281017]Mr Manager welcome to pakguns.. n kindly introduce ur self...   2ndly wen robbers are fleeing away they posses no danger to u.. so firing at fleeing robber is not self defense instead its an offense..n thrz no point for killing a person for few Ks, or a mobile fone..[/QUOTE]\n\n\n', '', '7144ee08a05262d9e6a7a6684fcd6156', 1342636111),
