(0x7642466f72756d5f506f7374, 7931, 0, 4806, 'I, for one, wouldn''t pay more than 55 grand for a glock. But thats just me I guess. I remember starting a thread similar to the current one asking members of the forums if it were justified to pay 300ks+ for a glock. Most replied negatively. And I think thats the justifiable answer. Strangely to be noted is that even though Caracal is in the same price range, I am willing to pay 20 gs more for it. That shows my inclination towards buying a Muslim-branded gun and agreeing on paying more for it.\n\nLike rightly pointed by Mr. Abbas, let''s not get personal or touchy. We are just discussing. Respect all on their opinions... for everyone has a right to agree/disagree on any given premise. Believe me, no matter what, I will say openly here that putting all my differences and disagreements aside, I respect every single member on this forum and I think Pakguns is a very sociable platform for the gun-lovers in Pak and a great great forum-based site to be a part of. So let''s all keep the sociable and respectful aspect in mind and differ with each others... for its but healthy, the difference of opinion.\n\nOne thing though, a liking is a liking. And there is no argument for or against it. So more power to you AK bhai and others for liking what they like. No criticism of a ''liking'' can be justified. And I don''t take anyone is criticizing anyone''s personal likes or dislikes here.\n\nI have seen this happen before and it does happen usually that disagreement is taken to heart in the society that we live in. I don''t think that should be the case. We can all ''agree'' on our disagreements, if you think about it!\n\nBoth Ak47 and Denovo are our respected brothers and their opinions are significant. So lets all put the persona', '', '51e5e78f9cfe37a82e864d3812183196', 1325679158),
