(0x7642466f72756d5f506f7374, 7924, 0, 2444, '[QUOTE=12GAUGE;236540]AoA Everybody\n\nThis thread has been going great. however the polling option has been closed to make final calculations easy. as we can see that the majority of people have voted for 65K price. This clearly demonstrates the true customer sentiment regarding the price of this product.\n\nNow if the Caracal importers/dealers are viewing this thread, here is a small calculation to a more realistic price of the product: (using weighted mean, NOT SIMPLE AVERAGE)\n\nPrice=(6.15%*85K)+(16.92%*75K)+(46.15%*65K)+(30.77%*55K)\n\n[COLOR="#008000"][SIZE=7]Price = Rs. 64838.5[/SIZE]\n[/COLOR]\nRegards.[/QUOTE]\n\nlolzzz...', '', 'fc52068e9c1c18ff63abe906d021bf1c', 1325786997),
