(0x7642466f72756d5f506f7374, 0, 241365, 998, 'Few days ago I went to Lahore to buy Saiga 12. Naveed bhai was kind enough to take time from his busy schedule and we started looking for saiga. There were only two pieces available in the market and the shopkeepers were charging very high prices. So we ended up buying this gun. Because only these two guns are available in Pakistan with removable mags, we have to compare them with each other. Although there is no comparison of Saiga with Akdal :). Saiga 12 is way out of its league. The Akdal Mka1919 comes in a cheap cardboard box and the packing is very un impressive. But that''s what you get with this kind of money. \n\n[COLOR=#0000cd][I][B][SIZE=5]The Eye Candy [/SIZE][/B][/I][/COLOR]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0138-1.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0139-1.jpg[/IMG]\n\nInside the box you get the gun itself, two mags( 2/34 and 3"),although you can use both with our normal 2 3/4 Shaheen shells. One barrel extension/ full choke and a Flash supressor and user manual. \n\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0141.jpg[/IMG]\n\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0140.jpg[/IMG]\n\n[I][COLOR=#0000cd][SIZE=5]Technical Specifications:\n[/SIZE][/COLOR][/I]\nModel                              : Mka1919\nCaliber.                            : 12 Guage\nOperation.                      : Gas operated, semi-auto\nWeight( empty)               : 3300 g \nOverall length.                : 40.5 inch \nHeight.                             : 7.5 inch \nBarrel length.                  : 19.7 inch \nSight radius.                    : 23.6 inch \nMagazine weight(empty) : 300 g \nMagazine capacity.         : 5 cartridges\n\n\n[I][COLOR=#0000cd][SIZE=5]Field Strip :\n[/SIZE][/COLOR][/I]\nThe Akdal Mka1919 gas operating system is based on Remington 1100 platform, which is not as fast as Saiga 12''s gas system. But it is faster then most of us pulling the trigger. When disassembled, I was not impressed with the machining of the gun. But then again that''s what you expect from budget Turkish weapon. Here see what I mean. \n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0146.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0145.jpg[/IMG]\n\nDisassembling the Akdal Mka1919 is a pain***. I couldn''t even fully disassemble the gun because I didn''t have the required tools. I mean what''s with that. The handguards were very flimsy and are not very durable. \n\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0148.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0151.jpg[/IMG]\n\n\nRange Report :\nThe Akdal Mka1919 gets really really dirty even after firing few rounds. That might be because of the gas operating system or it might be the Shaheen cartridges. I remember my Remington 1100 alway use to jam if not cleaned after each firing session. So I think this gun should be cleaned after each firing sessions if this is your primary HD weapon to avoid jams. See how dirty it gets after firing 50+ rounds. But one thing that I like is the quality of the barrel, its very well made and cromed from inside. \n\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0149.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0150.jpg[/IMG]\n\nThe Akdal Mka1919 is a very ergonomic and very well balanced. When held, it doesn''t feel heavy at all and very comfortable to shoot with. The recoil with Shaheen  2 3/4 SG shells is very low. It''s softer to shoot them normal pump shotguns. I''ve heard that it gives problems when firing light loads. It wasn''t the case with this one. We fired all #4,6,8 and SG/LG Shaheen cartridges with no FTFeed or FTEject. The gun comes alive when you fire it. It puts a smile on your face, it did on mine. You guys will see. When firing Mka1919 you forget about how its made or where its made you just want to keep firing and it eats all you through at it. So my conclusion is that if you can afford the insanely high prices of Saiga 12 then that''s the best money can buy period, Sauga''s firing speed is better, trigger is better, magazines are better, how can I forget the mags. The mags of Akdal Mka1919 are not good, they not well made and are very difficult to load. That''s my experience with them. Might be better to look for some aftermarket ones. Or it might get better after a while. You''ll see in the video later. For now here''s some eye candy.\n\n[IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0155.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0156.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0157.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0158.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0160.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0161.jpg[/IMG]\n [IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/IMAG0162.jpg[/IMG]', 'Review: Akdal Mka 1919', '6bf7c05e05f864e6883d3c97969378af', 1327299363),
(0x7642466f72756d5f506f7374, 7857, 0, 4228, '[B][URL="http://www.pakguns.com/member.php?116-Denovo87"]Denovo87[/URL]; [/B][COLOR=#333333]Ok more later....+++1 I[/COLOR]', '', '73a70de5e8bc21e647d0a016953bc9e0', 1325591474),
(0x7642466f72756d5f506f7374, 7799, 0, 6689, '[QUOTE=armoured;236614]Dear Pakgunners,\n\nMy question to PHSADC is: Is an assault rifle really a hunting & sporting gun? Was there even a single 0.22 cal bolt action rifle displayed by any of the participants (to the best of my knowledge, there was none, as I spend 2 hours finding one). They should have been clear in the first place about what will be allowed to be displayed & what not.\n\nWhat our local industry needs to do is to focus on small/big caliber hunting / target shooting bolt action rifles alongwith improving quality of the 12Gague shotguns, and this is the prime weakness in our local arms industry. \n\nI was surprised to find some 12guage SxS Sidelock shotgun, being displayed by the most reputable armory in Pakistan, with price tag of 400k+ (export only model), and when I asked the reason for such a nice price tag, I was given the example of "Holland & Holland" that see how expensive they are....Well, this cannot justify this price tag. The only thing that can justify such prices is the quality and the art of workmanship put in by the gunsmith, and to my disappointment, when I asked the exhibitor to disassemble the shotgun, so that I could examine the barrel independently,  after struggling with it for around 5 minutes, he excused that the gun is brand new and seems like it needs some oiling... this was the mechanical quality which I saw, and about the quality of the bore, better not discuss it at all. I wonder if there is a proof house in our country?\n\nI have been using shotguns since last 15 years, and I have never put any oil in my shotgun except for the kerosene oil which I use for cleaning purposes. Yet the assembling & dissembling is as smooth as anything... And here, I am referring to a 50 years old, cheapest gun of its time "by Gecado, Germany" which I inherited from my grand father... This doesn''t even have any engraving in it....\n\nBy this post, I do not intend to finger point at any company in Pakistan, but want to give some serious points to ponder for PHSADC. We want to buy Pakistani hunting guns, we want to rely on their brand names for quality and performance, but how can we? Any new gun enthusiast hunter today will go out, get a license (its another story how to get it...), and >80% of the time will opt for an imported gun...\n\nThis is the age of global competition. I am in an engineering sales job and truly understand the consequences of a lesser graded product being hit by the competitors when out in the market...[/QUOTE]\n\nAOA Armoured :\n\nPoints well taken, thanks for the inputs in fact. But few things you have to consider which are beyond imagination of the people who come to expos. \n\n[B].22 bolt action or any other bolt action display :[/B]  you have to consider that we invited all manufacturers, if none of them, present at TOSS Show 2011 was manufacturing the said product, how come they can display it . I mean its so simple to understand. Secondly its not easy to make people invest in which they don''t have expertise or a sizable market.\nOur industry is only in selling things and not marketing them.\n\n[B]Assault riffles :[/B] there was one segment of law enforcement i think it justify. But as far as POF eye is concerned they took special permission for displaying this product.\n\n\n', '', 'ac547da911d6de96c45cc1ff073b4d73', 1326095338),
