(0x7642466f72756d5f506f7374, 0, 233556, 1955, 'Salam All,\r\nFor all practical purposes they are the same when using these terms in day to day life. Actually there are 2 diameters inside a barrel. Cartridges are named in different ways. Some for the bore, some for the caliber of the bullet, and some that are not BOTH :). Please read the following links, i think you will understand.\r\n\r\nThis article tells you abt barrels.\r\n[url]http://en.wikipedia.org/wiki/Rifling[/url] \r\n\r\nThis article tells you how some of the cartridges of the world were named.\r\n[url]http://www.chuckhawks.com/cartridge_names.htm[/url]\r\n\r\nAnd after you read them both, you''ll come to the conclusion that there is no hard and fast rule.\r\nOne example that comes to mind straight away, is the .308 Winchester which is called 7.62X51mm in Europe. Now if you convert 7.62 mm to inch, it is equal to .\r\n\r\nRegards.', '', '43d77574907395225dd129403878e8a0', 1324749559),
