(0x7642466f72756d5f506f7374, 494, 0, 6766, '[QUOTE=hdaackda;241925]Husband throwing knives on wife''s pic, all were missing the target...\nSuddenly he received call from her:"Hi What are you doing?"\n\nHis honest reply:"Missing You...."\n\n-----\n\nEinstein and Santa are sitting next to each other on a long flight.\n\nEinstein says, "Let''s play a game. I will ask you a question. If you don''t know the answer, you pay me only $ 5 and if I don''t know the answer, I will pay you $500."\n... \nEinstein asks the first question: What''s the distance from the Earth to the Moon?\n\nSanta doesn''t say a word, reaches his pocket and pulls out a $ 5...\n\nNow, it''s Santa''s turn. He asks Einstein, "What goes up a hill with 3 legs and comes down on 4 legs ?"\n\nEinstein searches the net and asks all his smart friends. After an hour, he gives Santa $500...\n\nEinstein going nuts and asks, "Well, so what goes up a hill with three legs and comes down with four ?"\n\nSanta reaches his pocket and gives Einstein $ 5 !!\n\n---\n\nAn avid duck hunter was in the market for a new bird dog. His search ended when he found a dog that could actually walk on water to retrieve a duck. Shocked by his find, he was sure none of his friends would ever believe him.\n\nHe decided to try to break the news to a friend of his, the eternal complainer who refused to be impressed with anything. This, surely, would impress him. He invited him to hunt with him and his new dog.\n\nAs they waited by the shore, a flock of ducks flew by. they fired, and a duck fell. The dog responded and jumped into the water. The dog, however, did not sink but instead walked across the water to retrieve the bird, never getting more than his paws wet. This continued all day long; each time a duck fell, the dog walked across the surface of the water to retrieve it. \n\nThe complainer watched carefully, saw everything, but did not say a single word.\n\nOn the drive home the hunter asked his friend, "Did you notice anything unusual about my new dog?"\n\n"I sure did," responded the complainer. "He can''t swim."[/QUOTE]\n\n\n\ncant stop my laugh on santa one ', '', 'ca3648c891878dc53424badababb5f1f', 1327811979),
