(0x7642466f72756d5f506f7374, 9032, 0, 6464, '[QUOTE=shahzebfaheem;273334]A general Reply to All : \n[LIST=1]\n[*]The 1st Price we tell to our customers is not final, You know every customer demands discounts so some margin has to be kept before conveying the prices,which are reduced accordingly if it seems he is a serious buyer else the customers think we are taking too much from them, but eventually the price charged is most economical. \n[*]Sometimes some dealers tell very low prices when they dont have the weapon only in order to attract customers so dont qoute these vague prices here, We show the weapons to the customer and then tell the prices so customer knows what is he getting for the stated price. \n[*]Sometimes dealers sell clones of the original weapons to people instead of the original. these dealers charge extremely low prices and state the weapon as original so many times people qoute wrong prices for original weapons . \n[*]There are times when the market goes up ,you cannot compare another city''s market to ours, we try our best to beat the lowest local price if we can and you will get the lowest price in the market  from us if ur attitude is serious. \n[/LIST]\n[/QUOTE]\nthese tr good justifications but pls take care of customers,who earn hard and mostly\n\n\n', '', '623f3f701278ce8d4dd8c4a16cd4c195', 1339518356),
