(0x7642436d735f41727469636c65, 0, 0, 4563, 'The new Arsenal Firearms company debuted at the IWA 2012 expo, and immediately amazed the world with two great novelties: the AF-1 &#8220;Strike One&#8221; selfloading pistol and AF2011-A1 &#8220;Second Century&#8221;, a 1911-style .45 ACP caliber handgun... with two barrels!         \nThe AF-1 &#8220;Strike One&#8221; is not the only new product that the Arsenal Group of Companies will introduce on the market in 2012. True collectors and aficionados of novelties and items unique more than rare (specifically since its price will definitely make it exclusive) can not miss the AF2011-A1 &#8220;Second Century&#8221;. As simple as it might sound from the name itself, the AF2011-A1 &#8220;Second Century&#8221; is a derivative of the most classic American design, the Colt M1911 &#8220;Government&#8221;-type .45 ACP semi-automatic pistol designed by John Moses Browning which enters its second century of life in 2012. But Arsenal Firearms will celebrate this icon in its own unique way: creating the first perfectly worlking side-by-side double-barrel pistol to be ever mass-produced.\nArsenal Firearms based its work around the AF2011-A1 &#8220;Second Century&#8221; pistol project on the concepts of Vivian Mueller, a Swiss gunsmit who conceived a single, double-barrel SIG P-210 sample about ten years ago; Arsenal Firearms'' technical capabilities in the fields of SLA (stereolithography), 3D printing. solid imaging and part machining allowed six mere months to pass between the R&D and designing phase to the creation of the final working prototype: an incredibly short amount of time to come out with an extremely high quality product based upon machined metal &#8220;double&#8221; part made in house &#8220;as-they-are&#8221;: a &#8220;double&#8221; guides frame, a sixteen-rounds .45 caliber &#8220;double&#8221; magazine with two single-columns holding eight rounds each, a &#8220;double&#8221; barrel with a single bushing. \nThe AF2011-A1 &#8220;Second Century&#8221; remains however compatible with a wide array of components manufactured in series by third party companies for 1911-type derivatives, so to make spare parts handling easier: the list includes, as an example, the firing pins in all its parts, the trigger groups, the main spring housings and their inner components, the return springs and their guide rods, the magazine bodies, springs and followers, the rear sights (of either standard and adjustable/competition models, or of any other type available on the market), the grip panels and their screws. \nSome of the unique components specially manufactured for the AF2011-A1 &#8220;Second Century&#8221;, other than just the slides and the frames, include the special double hammer with single crest, the single or double magazine wells and their elongated, double push-pin release buttons, the single housing for the double main spring, the hold-open lever and the double frame mounted safety, as well as the single or double trigger groups activated by either a single or a double trigger, available upon request.\nThe AF2011-A1 &#8220;Second Century&#8221;, with its Deep Blue mirror or 3400 nitric White Ash finish, is not only a beautiful sight and an exceptional display piece, but also a perfectly functional target machine capable of giving great range satisfaction to its owner, featuring unbelievable accuracy performances with a pleasantly moderate recoil despite the fact that each shot of this behemoth discharges an overall payload of about 460 grains, enough to take down a bull; its entire double magazine can be emptied in rapid fire in about three seconds, resulting in over 4000 grains of lead on target!\n\n', 'Arsenal Firearms AF2011-A1 &#8220;Second Century&#8221;', 'd87d67fc030793fa868e87a65d7455c0', 1348829574),
