(0x7642466f72756d5f506f7374, 8193, 0, 162, '[QUOTE=Ahnab;246123][B]So from what I understand, under the current definition of the law, [COLOR=#ff0000]I CANNOT even pull my gun out until & unless I see the perpetrator pull his gun out[/COLOR]; which basically means that, realistically, by the time I manage to draw my gun, the perpetrator would probably have shot me.[/B] Similarly, if somebody sneaks into my house in the middle of the night to rob me blind, I [B]CANNOT[/B] shoot his brains out! That''s complete horse crap! \n\n[B][COLOR=#ff0000]The bottomline is that, by law, I am practically NOT allowed any form or level of self defence. I have to wait for a guy to shoot at me first BEFORE I''m able to retaliate[/COLOR][/B] and I have to let a thief off with nothing more than a stern warning.[COLOR=#ff0000][B] I''m sorry, but what kind of screwed up law is that[/B][/COLOR]!?[/QUOTE]\n\nAhnab bro, theoretically, yes, it''s a crappy affair from the defendant''s point of view. In practical situations, you sadly have to fight for the better legal odds. At least sacrifice a [I]shalwaar[/I] with a couple of holes, lolz!\n\nYou for sure have to vindicate the use of force. It''s tricky, yet not difficult.\n\nLet me just say, it all depends on the potential of your counterpart. In cases of enmity, your counterpart is most likely your own social class or above. Hence, you''ll see quite some resistance and then the greeenback (blue-back) has it''s own role to play, in addition to your personal connections. One of these has to be in order.\n\nI''d however still ask Hamid bhai to enlighten us on the night affair and burglary. According to my limited knowledge, one can gun down an intruder at night, since you never know his intents. If he''s armed, he should be gunned down. If un-armed, I suppose pacifying him seriously would be i place.\n\nBro, leave alone these clauses, tell me honestly, is anything else working correctly in the favor of the common man? What the heck is our entity????\n\nI personally just got exonerated from the court 5 days back, in a bogus firing case. That too, after the bogus witnesses were given a couple of pills and refused to witness, leaving the \n\n\n\n\n\n\n\n', '', '478250ce8c34e32d6071e07f41b22912', 1328899637),
