(0x7642466f72756d5f506f7374, 9078, 0, 534, 'Hardly one nowadays ships to Pakistan, and you certainly cant get them to ship you pellets and scopes. The last thing I got delivered by mail was an after market spring and spring guide for oe of my Weihrauch HW30''s, and that was a good five years ago.\n\nJust a word of caution for those wanting to overhaul airguns and change main springs etc. If you are even slightly mechanically inclined, watch some tutorials on Youtube or any other site, do lots of research online  and then do the job yourself. The local gunsmith, at least in Karachi, are total butchers. They will scratch your gun, put dents in the stock, maul the screws, use dirty tools and rags, leave you a dirty and chamber, and finally, overlube it with some totally unsuitable oil. If you must resort to a gunsmith', '', '01e8a83140dcb3618d607470d62ade87', 1339711710),
(0x7642466f72756d5f506f7374, 9172, 0, 861, 'The pattern will not be effected on a game gun.  I think the scratches may still be left over lead but I do not recommend Scotch Bright.\nUse any of the solvents and soft cloth several times and you will have a shiny bore.\nLead is very hard to remove without proper solvents, if nothing is available WD 40 will help spray and leave over night and work hard with a brush and later soft cloth and your bore will shine.\nGood Luck ', '', 'ddb5b6d76a980397495a82bdc3cf01ef', 1340908640),
