(0x7642466f72756d5f506f7374, 9160, 0, 608, 'Welcome to the Forum Bro. I hope you''ll enjoy your time here and we all will learn from each others experience.\r\n\r\non to Baikal IZH-27 / MP-27:\r\n\r\n[QUOTE=oziris;276323]ejecting both shells after firing only one, especially when the gun gets hot after a long shooting session. Possible solution: a thorough cleaning of internal parts or polishing ejector which somehow touches the  forestock as it moves. Another possible reason is that the carrier pushes the barrel selector too far, in such case, shortening the carrier&#8217;s tail will be necessary.\r\n\r\nejectors tend to crack (?)\r\n\r\nejectors can crack. you can get new ones made or you can o\r\n\r\n&#8226;     the metallic part which is located between the over and under barrel (it&#8217;s the part which fills the space between the barells &#8211; sort of rail &#8211; sorry, I couldn&#8217;t find a proper word in English) &#8211; tends to get loose after several hundred of shots...\r\n&#8226;     during first 500 rounds, some kind of red colored sand or dust (perhaps the same preservative which can be found in the receiver of new uncleaned gun) comes out from the space between barrels (as described above). How can I avoid this?\r\n&#8226;     if two slugs are shot respectively from both barrels on a paper target, they do not hit the same spot. I consider this as normal but some people report a 1.5 feet difference (!) Is this possible?\r\n&#8226;     doubling (both barrels shoot at the same time). Possible problem: either bad technique when pulling the trigger or cleaning and lubing of internals is required &#8211; anything else that comes into your mind?\r\n&#8226;     curved rib (not aligned with the upper barrel)\r\n&#8226;     sometimes the gun tend to open spontaneously right after the shot is made (especially when magnum cartridges are used) &#8211; how can be avoided this?\r\n&#8226;     some users report that the empty shell can get under the ejector after being fired, then it&#8217;s a hell to get it from the barrel &#8211; that&#8217;s what I am most worried about &#8211; I suppose the solution would not be an easy one?\r\n&#8226;     the under barrel&#8216;s hammer strikes weakly which results in failing the primer to ignite. This is caused either by some kind grease or a mess present in the internals (cleaning) or it can occur when the hammer spring comes in contact with the internal part of the stock on its way, hence it looses some portion of energy and when it finally hits the primer, the hit is not sufficient enough to ignite the primer. The Russians recommend fine polishing the right or left internal side of stock (the spot where the hammer spring comes into contact with the wood). Any other possible issues?\r\n&#8226;     after several hundreds of shots made in a short time (and especially if the outside temperature is high), it&#8217;s impossible to open the gun. Some people say all they have to do is wait like 20 seconds and then it&#8217;s possible to break the barrels. This happens when using cartridges with high brass (some other people state the contrary though). Possible solution: a thorough cleaning, lubing of internals or polishing the chambers with the steel wool\r\n&#8226;     the forestock finish tends to flake away after a couple of months\r\n&#8226;     front sight is not located right in the center of rib &#8211; what to do? I would like to install the Tru-glo sight but how, is that complicated?\r\n&#8226;     some people report that the chambers are too large which causes the shell would expand after the shot and consequently, the ejector is unable to remove it. Basically, when inserting the cartridge into the chamber, there should be no free space at the sides of the shell.\r\n&#8226;     stiffness, stiffness, stiffness...\r\n&#8226;     barrel selection not working at some guns\r\n&#8226;     safety is too rigid, reported problems with spontaneous activation/deactivation after the first shot.. how can this be cured?\r\n&#8226;     material used on some barrels is not equally distributed along the whole circumference. E.g. if you are looking down the barrel from the front sight, you can see some parts of the barrel rim are thicker while the rest is thin.\r\n \r\nThat&#8217;s it for the known issues. I know it is very unlikely to encounter all of these problems at the same time but I prefer to know about them and to have a solution if something happens. I think that a lot of these issues can be avoided  right in the shop by eliminating defective IZHs (provided the choice is wide enough). This is the list of things to be checked before purchasing the gun at the shop (I will skip the part regarding the proper gun fitting as this is a general question which applies to any shotgun). What to check:\r\n \r\n1.   quality of material used, mainly the equal diameter of the barrel rims\r\n2.   check the inside of the barrels if it is clean and equal\r\n3.   no signs of corrosion\r\n4.   quality of wood and finish\r\n5.   if the barrels are straight (sometimes the under barrel is not aligned with the upper one)\r\n6.   check if the gun is not &#8222;wobbly&#8220;, if all parts stay together\r\n7.   correct center position of the front sight\r\n8.   check the correct position of the rib (has to be straight)\r\n9.   check the diameter of both chambers by inserting the cartridge if it fits perfectly\r\n10. check the function of both ejectors and extractors using an empty shell. First, &#8222;fire&#8220; both barrels and check if both shells are ejected, then repeat with only upper/under barrel.\r\n11. check the correct function of the under hammer. The Russians do that this way: they would cock the hammer by breaking the barrels, then remove the forestock, barrels off, then they would put an empty shell on the spot where the under hammer strikes, and then they would shoot. The empty shell is supposed to fly at least one meter high provided the stock is pointed to the roof. If it only flies like 1 feet, the hammer is not strong enough => problem.\r\n12. what else?\r\n \r\nMaybe some of you would think I am crazy and anxious by editing these long lists but there is a lot of problems related with this shotgun. I understand I can&#8217;t expect Beretta quality but what I am looking for is a reliable gun which will serve well without apparent problems like doubling, ejecting full shells or jammed opening. I also know I am not buying the prettiest gun of the world but I still believe this gun is a good product with quality material used. I am ready to clean the internals of the IZH right after the purchase. However, this brings me to another question: will I loose the warranty when cleaning the receiver? Am I allowed to disassemble the gun? I also would like to make some modifications like fine polishing of all internal parts using Dremel, shorten the ejector springs to reduce the stiffness etc. However I don&#8217;t think this can be done without loosing warranty. I would also like to improve the finish of the stock and the forestock. \r\n \r\nI apologize for this long post but I would be grateful for any information you can provide re this shotgun. Please feel free to comment and/or to complete the lists above. Thanks in advance.[/QUOTE]', '', '5d98dc6418888b904357648722598622', 1340818881),
