(0x7642466f72756d5f506f7374, 10862, 0, 1408, '[QUOTE=Abbas;344571]It''s been a few days so I thought I should call up the Caracal people and ask if their analysis was done and ask when the replacement would be given since I last heard that Kkhan and BBH brothers have met Col. Azhar. I was quite surprised to learn from the pissed off Caracal representative that the gun was never handed over to them and that the gun owners want to get the gun tested themselves [I]whenever they get time[/I]. \n\nIs this true ? Also even after all the positive response by Caracal to resolve this issue this thread is being sent/posted/quoted on international forums like the link given by Faisji above. Why is this so ??[/QUOTE]\n\nI found this entire event fishy from the beginning but that aside i believe that ppl have a right to know both sides of the coin since Caracal actively sought out blog like TFB for publicity and product Unveiling<it''s only fair that they also get t hear about issue with the product.\n\nJust to be clear i have nothing against Caracal(Go through the thread about the recall where i defended them)Having  said that they will have to learn about customer service not customer badgering turning into bribing when the proverbial shit hits the fan\n\nAlso to be fair OP withheld information from forum members as well and made it all too difficult to draw valid conclusions.I am yet to see the picture of the case from the final shot from that gun.Also OP should have sent the parts to Caracal for analysis but again our "conspiracy against us" mentality comes in.\n\nI believe that this failure was a important news hat needed to be reported.So other caracal ownrs are aware and could make educated judgements about their weapons\n\n\n\n\n\n', '', '6bf219c754f15f44971cf160150c980c', 1361461827),
