(0x7642466f72756d5f506f7374, 9560, 0, 6111, '[QUOTE=Salman_Ahmed;291657]Ahnab Bhai, I think a Grown Adult is smart enough to understand two basic things:\n1. Keep your finger off the trigger\n2. Keep the Muzzle of the gun pointed in a Safe Direction EVEN when you know the gun is empty. [/QUOTE]\n\nBro, if all grown adults were so smart, we wouldn''t have any N\n\nIF these two things are too complex/confusing/difficult to understand and practice, then NO gun is Safe. only Good fortune can prevent a ND, and in a lot of cases it does.\n\nA few days Before Eid , I went to NeelaGunbad went inside a Shop and sat down after pleasantries, while sitting Down I noticed a customer had  a gun Pointed in the direction of my seat with his Finger in the trigger Guard, albeit off the Trigger . On my part I did ask him in a rather strong tone of voice to point it in a safe direction, preferably away from me. Maybe my tone, or posture, or the way I said it, rubbed the chap the wrong way, and he replied in coin, Janab Sahib, safety ON ha.\nThen he proceeded to Remove a A loaded mag, And with his Finger Still in the Trigger guard( still off the trigger I presume) disengage the safety and pulled the slide back and Shook a round out of the gun. I swear to you , I was about to Flip.\n\nAnother Event, a friend of mine after making an expensive handgun purchase popped over to show off his New toy, he was wearing it in his IWB holster, he pulled his Gun out and while pointing it in my general direction, asked , ''Oye check it mate, you like? ''\nI asked him to point it else where, He replied , ''safety on ha'', checked his , gun, and then with an embarrassed look went like,'' Yaar Main ne on ki thi'' , and snapped it into safe. It turns out while tucking his Shirt in/pulling his pants up , He had inadvertently knocked the safety off.\n\n\n\n[U]I''m not building a case for the Caracal, I''m just trying to change this mindset, where people Behave Carelessly when they "[B] think[/B]" their gun is Safe[/U] \n\n\n\n[U]When did safe handling of a firearm become mutually exclusive to external safeties?[/U]   Drills and practice are for dummies who want to learn how to safely handle a tool designed primarily to kill/wound.\nAlso , You don''t need Drills, just Education. Keep your finger outa the trigger guard, How hard can that be? \n \n[B]For all New user''s For the first couple of months, if you feel like you cant trust yourself/ or your firearm, then keep it un-chambered, while consciously making an Effort that whenever you handle Your firearm, to keep you Booger finger off the boom boom switch.\nIn no time, you will hv learnt to keep the you finger resting Safely on the slide/frame.[/B]\n\nDear Sophisticated Bhai, [B] Which Ever gun you Buy[/B] pls Just consciously make an Effort to handle the gun safely, that''s all I ask , and that''s All I''ve been trying to say, If you do that, ALL the guns you listed Are Safe and Secure, IF not, then None of them are.\n\nAlso , Most (modern) Guns come with generally 3 safeties :\n1. Drop safe\n2. Firing pin block\n3.Some form of external safety/de-cocker.( this includes the Glock/caracal safe trigger set-up)[/QUOTE]\n\n\n', '', '754741d0395dbbccd6b532ee751e3ab8', 1345707912),
