(0x7642466f72756d5f506f7374, 0, 247748, 1, '@Trigger Happy, KamranWali Thank you.\n\nQuite frankly I agree with all Skeeter sahib is saying.\n \nI was personally a bit disappointed with the results but IMHO the reason for the accuracy concerns was not really the barrel but the trigger and human error. In all fairness we should have tested a new piece but the only one we had available was the one which underwent the torture test. I think Skeeter sahib and I were also shooting a little off that day as even with our beloved CZ''s we were not getting anywhere near the results we are used to. \n\nAlso the rest we were using was a rifle rest and not a pistol rest, kudo''s to Skeeter sahib for being able to use it. I could not hit black at 15 m''s using that rest. The trigger is without doubt creepy and unpredictable. I did not clean the gun myself as I assumed it would be given to me cleaned. Did not check\n\nI plan to get a Caracal F for myself soon, when I get it InshAllah will get a little used to the gun first and then try the accuracy.', '', '5ec978e3ddd6d8196b648aa4c34feaed', 1329472741),
(0x7642466f72756d5f506f7374, 9171, 0, 8145, '[QUOTE=Ameer;277407]I agree, keep a chambered gun e safety off and be vigilant.[/QUOTE]\n\n+1 on that Ameer Bro. \n\nI''m sure we all agree that using a weapon is the last resort; as the term SD suggests, it is indeed when personal safety is threatened. However, I have often wondered how to take the call whether an armed offender is approaching you for abducting you or your some of your belongings (vehicle / cellphone / wallet etc).\n\nAs a personal preference, i''d be happy to give away my car and avoid an armed conflict however, when it comes to being abducted - it may just be the best time to put your weapon and your skills to use.\n\nI''d appreciate opinions based on experience ...', '', 'da6f4912170c02d10706a874b469e7bd', 1344804432),
