(0x7642466f72756d5f506f7374, 9560, 0, 8123, '[QUOTE=Enigmatic Desires;291414]@ Joney\n\nI explained the concept of the firing pin safety mechenism in your original thread in the same section I am re-posting the same here for reference purposes:\n\nFiring pin block\n\n[I]A firing pin block is a mechanical block used in semi-automatic firearms and some revolvers that, when at rest, obstructs forward travel of the firing pin, but is linked to the trigger mechanism and clears the obstruction to the pin just before the hammer or striker is released. This prevents the firing pin from striking a chambered cartridge unless the trigger is pulled, even if the hammer is released due to a faulty sear or the pin is dropped or struck by another object.[/I][/QUOTE]\n\nMy appologies ED Bro....\n\nTell me 1 more ti', '', '106441ee9e24ea9ab9fc33f9b1e7d8ba', 1345659538),
