(0x7642466f72756d5f506f7374, 0, 367140, 608, '[B]On The Skeet Field:[/B]\r\n\r\n[URL=http://s998.photobucket.com/user/12gauge-pakguns/media/Mistral%203/Image21_zpsd720c888.jpg.html][IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/Mistral%203/Image21_zpsd720c888.jpg[/IMG][/URL]\r\n\r\nUsually with autoloaders I am hardly ever at ease on the skeet field but with this one I was literally having fun. playing doubles was no different than with an over and under. its super light weight and excellent balance truly made it a fun experience. \r\n\r\n[URL=http://s998.photobucket.com/user/12gauge-pakguns/media/Mistral%203/Image22_zpsa196de96.jpg.html][IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/Mistral%203/Image22_zpsa196de96.jpg[/IMG][/URL]\r\n\r\nI really liked how it pointed. it was as if I am literally poking the targets out of the sky with a large pointy stick. the recoil was pretty much nonexistent and the gun jumped to shoulder as if I had a lot of prior practice with it. \r\n\r\n[URL=http://s998.photobucket.com/user/12gauge-pakguns/media/Mistral%203/Image24_zps51727208.jpg.html][IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/Mistral%203/Image24_zps51727208.jpg[/IMG][/URL]\r\n\r\n[URL=http://s998.photobucket.com/user/12gauge-pakguns/media/Mistral%203/Image25_zps5bba26fc.jpg.html][IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/Mistral%203/Image25_zps5bba26fc.jpg[/IMG][/URL]\r\n\r\nThe gun cycled wimpy 24g skeet loads flawlessly with the exception of a few instances where cartridge''s hull expanded and was stuck inside the chamber, only to be removed by pushing a cleaning rod down the barrel. It only happened a couple of times. it could be the ammo or since the gun was brand new, it might just need a break-in before 100% reliability can be expected.\r\n\r\n[B]Final Thought:[/B]\r\n\r\n[URL=http://s998.photobucket.com/user/12gauge-pakguns/media/Mistral%203/Image19_zps80327552.jpg.html][IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/Mistral%203/Image19_zps80327552.jpg[/IMG][/URL]\r\n\r\nNot much too say here except that I am truly impressed. if you want an Italian Gun and don''t want to break your bank in the process, you should seriously consider this shotgun. Currently available at 70-80K range depending upon location, this gun provides you the Italian gun experience (a very costly affair under most circumstances) with the least amount of money involved.\r\n\r\nRegards.', '', '1802139ee5753f25d69101abbd9077d5', 1369606100),
