(0x7642466f72756d5f506f7374, 0, 289514, 3593, '[QUOTE=Dr Hanif Malik;289482]it depends on shot accuracy,shot placement is the key of boar hunt either with shotgun or rifle,with shot gun you have a choice of running shot also.[/QUOTE]\r\n\r\nBut Dr sb, when a 4x4 soft top is chasing these herds or singles, running at top speed at night (as most of boar hunting is done at night under spotlights here; it is legal in USA too), going over all sorts of bumpy 4x4 terrain, even an above average shooter like yourself is 95% likely to injure it. The vital area is the neck and front side of shoulders only for this tough animal. With deer, the vitals are a bit more and you can take heart lung shot with deer. For boar, unless bullet or SG/LG pellets hit neck or front sec of shoulder (which breaks the shoulder bone), an adult male does not fall to the ground instantly. Majority of shots with a shotgun usually hit the center region and hind legs when chasing on jeeps at top speed due the misjudged speed of this animal. Thats why many injured animals escape the hunters on these jeeps and die later slow death or many young ones amidst the firing mayhem fall there too.', '', 'db7cf70c581e24398a1119d08ccfb4b6', 1345007074),
