(0x7642466f72756d5f506f7374, 0, 295321, 8338, '[QUOTE=Enigmatic Desires;295313]The license is a non transferable document. That is to say that it is as transferable as your CNIC or your pass port or your driving license. Ergo the gun registered on it is equally non-transferable.  Don''t think of it as a car bro. Think of the gun/ license combo as a  CNIC. Can u transfer yours to anyone else?\n\nAs regards NADRA. Well.. The MOI  will verify your antecedents and check  your records and only then issue a demand note. The weapon will then be transferred to the demand note and subsequently entered at the MOI. \n\nAnd then the demand note will end up at the NADRA office where they will issue the card within 30 to 90 days. In Karachi some dealers handle the process and charge around 25-30k and take a few months or so for completion of the process. But remember they are essentially facilitators. The process has to be followed. Weather u take the help of a dealer or do it on your own. There are NO shortcuts to the process. \n\nSorry and all that. but talking about a gun and holsters is pretty superfluous till u get a license.[/QUOTE]\n\nOf course I know that the license is non-transferable, I''m just confused as to all the different procedures i''ve been hearing/reading. That''s why i joined the forum, so i can clarify everything so that I don''t end up doing something wrong and end up in hot water. Not trying to cut corners by any means. That''s also why i asked if someone could please explain the step by step process of applying for a license. As i take it, this is the process I''ve come up with (correct me if i''m wrong):\n1-fill out the form on the interior ministry website, and attach all supporting documents\n2-submit form to ministry along with any fees\n3-demand note is issued after a certain time\n4-take the demand note to a dealer and buy the gun i want, dealer will stamp demand note and write down all corresponding info\n5-submit demand to ministry and any fees\n6-nadra will issue the actual license after all the processing?\n\nIs this the correct process?\n\nAnd there''s no harm in talking about a holster before actually getting a license :)\n\nEDIT:\n\nAlso, why does the form "Application for grant of new arms license" ask in number 19 on the form "Do you already possess a weapon? If yes please attach copies of all license/information of the weapon with this form"\n\nWhat i''m trying to say is, if I''m not even supposed to have a weapon before i submit this form, then why ask this question. \n', '', 'cf86a668cac0a1c0b9975f8f0fc3843a', 1346790071),
