(0x7642466f72756d5f506f7374, 0, 292726, 116, 'Thanks brothers; was a great show arranged by GoC of 8 Div with excellent range arrangements; rifle shooting was an open competition for 200 mtrs free rifle (but service rifles were not allowed; only personal rifles).\nPistol shooting was at 20 meters standing; we (Avais n me) will definitely be doing better in next competition Inshallah. It was mixed competition with army officers & members of clover skeet shooting club competing shoulder to shoulder; I really appreciate & thank GoC 8 Div. for arranging everything and taking special interest in promotion of this healthy sport activity not only for army personals but giving civilian enthusiasts equal opportunity to enjoy this beautiful sport.\n\nBelow is the short videos of prize distribution ceremony & pistol shoot, more photos n vids will be posted shortly by brother Laino as he was official PG photographer for this event ;)\n\n[video=youtube;BJaGgXqNyYE]http://www.youtube.com/watch?v=BJaGgXqNyYE&amp;feature=youtu.be[/video]\n\n\n', '', '0fbff4e6d167a1eb9682b020b819efbf', 1346059829),
