(0x7642466f72756d5f506f7374, 0, 287192, 4053, '[QUOTE=Abbas;287153]Kindly explain brother, why would I have a bias towards Caracal ?\n\nOn another note, I was getting so sick of the Caracal bashers that I went out and bought one for myself today. \n\nI''m a little tired of the ''armchair experts'' brigade who go around reading reviews on the internet and then base their arguments on what others said. If you have owned a Caracal, shot one extensively then by all means provide your input here, if you haven''t then perhaps it''s better to keep quiet.[/QUOTE]\n\nHeartiest congrats on the Caracal Chief. I knew it that you''ll go for the Caracal, the way you kept holding my Caracal F again and again at Sami bhai''s house. So which one did you get model F or C? looking forward to the pics and your range report. Happy Shooting sir..\n\nP.S love your comment about the ', '', '4a534f0a5850017fab14f2b76eaf9ed7', 1344446690),
