(0x7642466f72756d5f506f7374, 9447, 0, 6844, '[QUOTE=AK47;287765]@ED.....Lolz on the Gilgit saga!\n\nThis explains to me clearly that more than any Hollywood affair, it''s exactly Gilgit, yeah our very own local Gilgit, that is the volcanic source of your safety concerns, hahaha!\n\n@Faisji......+1 on all!\n\n@Tatur......once through an ordeal like that, those are the feelings. Nobody said, don''t carry chambered, we just said, gain the proficiency to do this.\n\nFire off a mag full and use the empty shells to practice drawing, racking, decocking, disengaging safety and letting go off 1.st DA shot, etc. Or better, buy some 5 snap caps for this.\n\nWith empty shells / snap caps, you''ll have peace of mind, so would we, and practice a 1000 times my friend, before you decide carrying red.\n\nRegards.[/QUOTE]\n\nvery well said AK bro.\n@tatur1.... I also own a stoeger. lovely weapon. i carry chamber loaded, hammer decocked and safety on. u can start that when u are more acquainted with u r weapon. practice racking the slide repeatedly on empty weapon. that will smoothen u r reflexes, when u do it smoothly and in a swift manner u wont have stuck bullets again. start carrying empty chamber. in a few days time u ll be confident enough to carry loaded chamber. shoot a few mags n ull be better versed with u r weapon.\nalways remember\n1. Safety First\n2. Always be aware of the status of weapon u r carrying i.e. status of chamber, safety button, hammer and position of u r weapon ( if it is safe and approachable )', '', '0cfae18d2a6d862c5288fbf738a274bb', 1344592147),
(0x7642466f72756d5f506f7374, 164, 0, 1, 'Salams Brother, I replied your email but perhaps you missed it, copy and pasting for your convenience here. \n\n[COLOR=#000000][FONT=monospace]Wsalams Brother,[/FONT][/COLOR]\n\n[COLOR=#000000][FONT=monospace]Thank you for your email. Religious and Political discussions are not allowed on our forums as policy. There are dozens of religious forums and millions of religious websites online, if anyone wishes they are welcome to seek knowledge and guidance there as our is a hobby oriented forum.[/FONT][/COLOR]\n\n[COLOR=#000000][FONT=monospace]As far as your question about having a NPB weapon on a PB license, theoretically you can but no one does it as it''s a waste of a P.B license. If you want a NPB just get a NPB which costs 1/5 as much as a P.B. Licences are open currently.[/FONT][/COLOR]\n\n[COLOR=#000000][FONT=monospace]Regards,[/FONT][/COLOR]\n\n[COLOR=#000000][FONT=monospace]Abbas[/FONT][/COLOR]\n\n[COLOR=#000000][FONT=monospace]Quoting Muhammad Ali Anwar Muhamamad Ali Anwar <maa_llm@yahoo.com>:[/FONT][/COLOR]\n\n[COLOR=#000000][FONT=monospace][COLOR=#3162A6][FONT=Verdana][Hide Quoted Text][/FONT][/COLOR][COLOR=#000088]Asslam u Alaikum Warahamtullahi Wabarakatuh!\nBr Abbas, first of all I would like to appreciate you on your work in PakGuns. you are really very helpful.\nBr, secondly I am emailing you for two reasons.\n1st is that, when I joined PakGuns couple of days back, I found In OFF TOPIC thread that  "NO POLITICS, NO RELIGION".\n\nBr, with due respect, Islam is the most important thing in our lives in fact more important than our lives. And it is complete code of life, we can find many teachings which are directly related to subject and object of the PakGuns. For example, Islam strictly prohibits aiming a weapon towards a believer, Islam encourages having weapons etc and many more of such beautiful information provided by Islam. Which All PakGunners should know including me.\nSo, I very humbly request and suggest you that kindly Islamic discussions should be made and allowed, who knows how many get guidance and Abbas Bh you will be rewarded for that. Also, it will be a source of spreading the message of Islam. \n\n2ndly, Can you kindly tell me that is it possible to get Non-Prohibited bore handgun on a prohibited bore licence. As I am allowed to get Prohibited bore licence, so what do you suggest that I got PB Licence and then get NPB handgun on it or for that I have to get another NPB licence? and are the licence are issued now days? ( I mean koi ban to impose nai aaj kal?) Thanks.\n\nHope to see your kind and positive reply quite soon. In Sha Allah.\n\nSincerely,\nMuhammad Ali Anwer\nLahore.\nmaa_llm@yahoo.com[/COLOR]\n[/FONT][/COLOR]\n\n', '', 'e5e4b4f757d0187150db30250ac745c7', 1344439531),
