(0x7642466f72756d5f506f7374, 8406, 0, 5254, '[QUOTE=Omkhan;254163]please share some details of the attempted invasion and defense for our learning and info if you are comfortable with it. Thanks[/QUOTE]\n\n1st Attempt\nAround 8-10 days after moved into our new home last year, the first attempt was made. Even our furniture and fixtures were not done at 100% since we (Me, my father and 2 elder brothers) all have tight schedules and work hours. I was sunday night, 3:15 a.m in night I was asleep in my room when I woke up hearing my dad while rushing into my room that there is someone inside our home. Before I proceed with what happened next i must share what had already happened before this.\nOur home is a double storey infrastructure with separate floors. My Elder brother lives on the 1st floor with his wife and kids and me, my mom dad and the other brother lives on ground floor. \nOn 1st floor, My Bhabi woke up at around 3:10 and went to kitchen to get something to eat for my 4 year old bhateeja. When she stepped into the lounge she heard a slight sound of door of 2nd bedroom (supposed to be the kids'' room but was empty since the kids sleep with their parents) being moved and almost closed by someone as she stepped out in the lounge. She quickly woke up my elder brother. When my brother stepped into the lounge the door was completely closed at that time. He quickly dialed dads'' cell phone, while he locked his room door. He had no weapon with him on 1st floor.\nSo, coming back...after informing me dad took out his old licensed revolver he bought 18 years back, and tried to step out to take stairs and go to the first floor. Before he could do that, I said to him that there might be more than 1 crooks already standing outside the ground floor door, so we should first fire some shots in the air. We went to the backside duct from where we could see the window of the room in which the crook was present and fired a couple of shots. All this', '', '2701df8bc84de030bc642e56db64874b', 1331705575),
