(0x7642466f72756d5f506f7374, 0, 255250, 3593, '[QUOTE=Trigger_happy78;255177]@ Francolino bro. The issue I have with duck shooting is the amount of lead that you have to give on a bird. The most difficult is the crossing duck which is decoying. I agree with you on the area thing.[/QUOTE]\r\nOhh...the ''crossers'' (left to right and R to L) are the ones bothering you. Is it? Which cartrg and choke are you using. The gun is Urika2 (Opt) I guess. I would suggest IC choke + 6# Shaheen regular cartrg. The spread will be to your advantage and #6 lead shell has enough penetrating power for a duck. So...keeping this cartrg/choke pellet spread in mind, crossers shd not be a problem if you shoot just a 1''-1.5'' lead ahead of bird with a fluid gun swing keeping the swing maintained after firing. Approximate distance  The common problem we all make in such shots is: that we stop the swing and start looking for second bird to take down in a hurry. Actually ducks when decoying give ample time for 3-4 shots and all shd be fired with lot of patience..''sakoon se barrel mila ke'' as they say. I had several multiple 3-4 bird hits (dead drops) in my last 2 shoots which I enjoyed thoroughly. Hurried shots are what cause ducks to go by scot free. Thats my humble observation and suggesion. Mian Mobin (H1) can throw further light on that as he is an avid duck hunter himself.', '', '71bfcb49233d6f20833b89f73cfbcb35', 1331835577),
