(0x7642466f72756d5f506f7374, 8399, 0, 6105, '[QUOTE=MK47;255607]Guys just to make you aware. Regarding the CF98. I have two CF98''s. 1 is a clone made in Peshawar and the 2nd one is the original which was purchased for me after I came back from Pak. Anyways when I bought the clone while I was in Pak I never got a chance to test it due to my busy schedule and it remained new in the box for over a year. Afew days ago my cousin tested it and told me over the phone that it was a complete let down. Disappointingly it kept miss-firing etc. He rang the dealers who we purchased it from. As we are on friendly terms with him he said bring it down to our factory and we will get it sorted out. This morning they took it to their factory in peshawar n they changed the spring and afew other parts and got it sorted out. was told its firing OK now. But here comes the interesting bit. He told me their new production batch that they now make is being sold around in the market as the original ones because they are producing exact identical clones. Not not only that they are even putting computerised numbers on them. Then they sell them to different dealers for anything between 20-25K a piece and the dealers are then selling them in the markets for anything between 30 to 40K. Its not a rumor but confirmed news or info. They told him all that themselves this morning. So just be aware.[/QUOTE]\n\nThanks bro. for words of caution. I 100% believe what ever you said. I\n', '', '54db15ea4a5aa67246ee09f05e28f522', 1332082197),
