(0x7642466f72756d5f506f7374, 9348, 0, 3593, 'When switching from one eye closed to both eyes open , in shotgunning at birds , I have felt that it takes a lot lot lot practice to master it for consistent hitting. My opinion is if a shooter (except a skeet shooter) is good with original one eye closed style of shooting, then he should not change it for the sake of it because text book says that. Many shooters (hunters) are quite good in field with one-eye-closed style. But for skeet shooting, the fast clay, it is need of the sport to have a wider/full field of vision when hitting certain clays or doubles from station 1-8.', '', '65f6379b82f3cf9a774a69b34c3ad7a2', 1343840632),
