(0x7642466f72756d5f506f7374, 8928, 0, 6388, '[QUOTE=Salman_Ahmed;272013]Since i don''t really hv credibility here , i thought i wud post a Few videos of people that are professionals (gunsmiths , gun sellers) for an objective view.\n\n1.First off...i dont really understand the point of these accuracy tests, is the purpose to test Combat effectiveness or Range accuracy.\n\nGroupings would matter if ur thinking in terms of getting a range gun.\nCombat Effectiveness for Every other use outside a range.\n\nIn that Regard Both Guns are Combat effective, However the Glock really pulls some nice tight Groups giving it the edge when u take it down range( it is still not a great range gun though, Good, but not Great.) Also im Pretty Sure the 40k -55k priced guns like Canik, cz999 can pull off the same kinda groups as the glock.\n\nso here''s my problem , Why wud any1 buy a glock  or the Caracal?  save ur self a lot of money and buy the reasonably priced alternatives.\nThe answer to this is simple, if i were to buy an 1800cc car ONLY, i wud buy the accord, and then look for some obscure figures and what not to justify how its better than an 1800cc merc or Bmw ( which actually hv no bearing on the real world performance of that car compared to the competition), and its obviously better then the 1800cc civic .... \nOr simply tell people i love the way the accord looks , Period.\n\n2. People really need to lighten up regarding the caracal, its a good gun , is it a Glock killer ...... Meh\nAll the the negative inputs etc is actually Good, helps improve the product and educate people at the same time.\nthe Caracal people stand behind their product by giving a 1 year warranty which in Pakistan is Awesome , and As far as the Glock goes\nPls check this Video and You ll understand.\n\n[URL]http://www.youtube.com/watch?v=WHDISO0oeyY&feature=BFa&list=UUWJHDMgKWWvOsdyRF3HPVEw[/URL]\n\nRegards.[/QUOTE]\n\nVery well put sir. Very few of us may actually be looking for a Glock killer specifically. The everlasting debate may be reclassified as an attempt to assess ', '', '1ea1a8ce1ecf8430bbdac9aab1bf8442', 1338920015),
(0x7642466f72756d5f506f7374, 8996, 0, 1013, '[QUOTE=Salman_Ahmed;272076]\n\nI mean Seriously , How is a 4 Rounds tube mag shotgun NPB, and  a 5+ round Shotgun PB, does the 4 round one shoot roses ? what is in that additional one Round that makes it so .... OMG NOOOooo!!!!! \n\nIf there was a sound reason For the restriction, Id understand, Like FULL AUTO AR''s ... yeah , i can understand making them a little harder to procure.\n\nAlso , there are PB licences, so they aren''t actually making anything illegal , Just making them insanely hard to acquire by people  that are most likely never going to break the law in the first place. \n\nMost of us are educated , We talk the Talk but we are unwilling to walk the walk ,and Most of us are not poor, we can , and we shud legally challenge any such proposal before is becomes law. Talk to our local representative, exert pressure in our official capacities, Vote for people that share our view point ...... MY security is a fundamental Right, and the Government has FAILED to provide for it time and Again and at the same time is trying to disarm the law abiding citizenry with some Half assed disarmament drive.\n\nThis APATHY is the single reason why Pakistan is in a lot of mess in General , not just in this particular case.  \n\nAs a side Note , a lot of influential people Dont really care what kinda Laws are brought in, Beuz they Will always be able to own ANY kind of weapon, and there seems to be a monopolizing mind set to make it difficult for normal people to enjoy the same privileges/rights they hv.\n\nTIME TO LAWYER UP.[/QUOTE]', '', '353ad7bf480b9b262dc16a7fddfbd0fe', 1338892263),
(0x7642466f72756d5f506f7374, 8953, 0, 559, '[QUOTE=Avais;271946]So the query is solved. Brother I am not expert in swords. My passion is restricted to the utility and hunting blades. However I know many people in this Industry specially in Wazirabad who are doing these swords from beginners to professional level for exports or local supplies to be used as souveniers. There are hundreds of designs in these swords. Carbon steel and Spring steel with sharp edges are expensive and also requires the license in Pakistan. As per my understanding you are looking few models for your practice and training so I suggest you to buy a 8 chrome or maximum 12 chrome blade without the sharp edge. These blades are cheap and good for practice. You may get it around Rs.1200 / good quality sword from Wazirabad.[/QUOTE]\n\nNice Info br.\n\n\n', '', '0349e43bf1828726e3a2a5118861aa9a', 1338890032),
