(0x7642466f72756d5f506f7374, 8830, 0, 2362, '[QUOTE=AzamAgha44;265810]I started duck shooting at a place called Sattoki (off Lalliani canal, Kasur road Lahore) back in 76/77. it was a large lake 4 to 10 feet deep bordered on one side by village Sattoki and on the other side by a sprawling marsh fringed with rice fields towards canal end. Methodology for the morning shoot was for the gunners to line up at the border of marsh and the lake, and intercept ducks flying over from the marsh after night feeding to the lake side for day''s rest. Later on everyone got dispersed to their respective favourite spots with their bunch of decoys and then serious gunning would ensue till 11 or 12. Most of the shots taken were between 15 to 25 yards, and my limited supply of 8s and 6s exacted a very heavy toll on unsuspecting birds at point blank range. We were so selective at that time to have avoided shooting Shovellers and Pochards while concentrating on Pintails, Mallards, Widgeons and the like. Later on we shifted to Islamabad and I bid farewell to the marshes around Lahore and Chunian after 10 years of duck hunting. Now came a switch to river shooting with its newer requirements and techniques, even though I keep visiting marshes of Mianwali etc for ducks driven over "Rassi" or rope. Notwithstanding the very successful shoots in this newer form of shooting for which now i am fully geared including trailers, boats, OBMs, rafts of decoys etc, but still sometime pangs of remorse on an almost forgotten art of marsh shooting over decoys surfaces and I wish to try out the form of hunting  I grew up on once again. the only regret is ......its not there anymore. Gone are the marshes of Sattoki, Lahore, Sundar, Lahore, Hallerke, Chunian, Budh Nala, Sargodha, Nabi Shah Lake, Bhalwal etc. Any more out there sharing my grief????????[/QUOTE]\n\n\n\nN', '', 'eef0886f202188e344af3db6818496da', 1336369646),
