(0x7642466f72756d5f506f7374, 8854, 0, 116, '[QUOTE=AK47;267495]I personally find DSA POS, as I find anything local, like it or not. These things were only worthy of anything as long as Turk guns were not common in market. Price-wise, and value-for-money wise, Turk hardware offers much more than local guns and local manufacturers still have long way to go, since it''s not just about having the CNC facilities. We have to agree, metallurgy standards and quality, both,  are still missing in our local items, something that even POF still not has been able to deliver fully upon, leave alone Darra, Peshawar, etc.\n\n[B]OP should have set his expectations at a due level.[/B]\n\nThread should be cleansed, and since I do not specifically find any such accusations about monetary gains, kindly leave defending a finger that probably wasn''t raised in the 1.st instance.\n\nWe all know the credibility of our members and 12G is an established branch of our family-tree here.\n\n\nRegards.[/QUOTE]\n\nAbsolutely correct AK bro but all of us (mediocre''s) had\n\n\n', '', '608ad599dde1cb0dd1d7b75c9a3d8502', 1336746482),
