(0x7642466f72756d5f506f7374, 0, 271258, 3199, '[QUOTE=jog3ee;271142]Use any pellet above 11 grain for long and you can kiss your rifle goodbye :)[/QUOTE]\nMake that 10k pellets. Don''t think any spring gun could ever reach that number. Still instead of kissing it goodbye you can free 2,000rs to buy a new one.\n[QUOTE=Khan09;271146]where can i find the UTG and 5th generating scope for my 350mag.does anyone know where to find these[/QUOTE]\n5th generating? I don''t know about that but 5th generation ones are available in USA exclusively. Same with the mounts.\n[QUOTE=raja yasir;271153]These things a discussed a million time and Chauhdary bro even bought the scope and mounts after a lot of hassle and a long time,but is it wise to buy a gun that can be used with only one scope in the world think about it.[/QUOTE]\nYes I don''t know why PG is a place where the same thing would be discussed every day if not hour.\nBTW just got my RWS 1 piece lockdown mount yesterday - yeah the same one youre talking about. Replaced my Diana 1pc mount (the 8000rs one from Baksh Ellahee) it kept sliding a little back after a couple of hundred shots and I noticed it was not a lockdown mount...\n[QUOTE=raja yasir;271201]Yes there was a used 52 for 18k tried it ,but did not buy it cause it was about the same power as my diana 35 and 36 not a huge difference in power and its a bulky and heavy gun.Its better in accuracy as compared to break barrel air guns. According to the chrony tests i did with 14.3 g pellet here are the figures of different airguns.diana 35 690fps,diana 350 mag 790fps,diana 56th 780fps,hw80 760fps and bsa s10 pcp 860fps.[/QUOTE]\nNo point in 48/50/52 they all suck. 54/56 are one to look for.\nWell it''s a point to ponder that all big wig online retailers like pyramidair, umarex, airgundepot, airgunsofarizona, airgunpyramid, airgunsbbs, bla bla have written with their 350 adverts that "It was tested at 840fps with 14.3gn lead pellets) and Diana claims them to shoot at 920fps.\nAnd if I remember you saying your 56th shoots at 30fpe (in the airgun wildboar hunt thread) I claimed it should be around 25. Sadly, the specs you provide, are evidence that your 56th is achieving JUST 19.3fpe. \n- And your tested 350 (and I believe mine too) at a low 19.8fpe.....OMG Diana sucks ****. And us shooters were soothed by it being a 24-25fpe springer.\n- Also your test shows there is just a minimal difference b/w the ft/lbs of Diana magnums and Weihrauch HW80, if this is the case then Weihrauch all the way due to it''s superb accuracy.\n[QUOTE=jog3ee;271233]how much did you get the pump for??? I was considering a Hill pump and benjamin maurauder setup but it was going beyond my budget without a scope :/ $400 for the gun and $ 290 for the pump.. add a decent scope and pellets & you''re talking another $200 :( My wife is travelling to US next month but i dont wana burden her with carrying all this stuff along with my little one :p[/QUOTE]\nBetter check the rules even if thinking of this as I don''t think JFK permit this sort of goods transportation specially to 3rd world countries - An acquaintance in the NYPD told me you can''t carry pellets let alone airgun.', '', 'e964b8b426bf8d1eae9c58df6e4c5716', 1338475444),
