(0x7642466f72756d5f506f7374, 8953, 0, 1408, '[B]Japanese sword Laws[/B]\n\nIn order to legally own a sword in Japan it has to be registered in  accordance with the Ju-t-h (Japanese Firearms and Sword Law). This  applies to both antique and newly made swords (Shinsakut). Exempted are  blades under 13 cm (5.1 inches) that have no Mekugi-ana (peg hole), and  Iait / Mogit (training and decorative swords made from a  zinc-aluminum alloy that can''t be sharpened).\n\nThe certificate / license issued - Juh-tken-rui-trokush (in short  "Trokush") - has to stay with the sword at all times. Most collectors  attach it to the Shirasaya-bukoro or Koshirae-bukoro (storage bags).  It''s the blade that is registered, not the owner; however, the  Prefectural Education Board (Kyiku-inkai) has to be notified within 20  days if there is a change of ownership.\n\nLicensing is done by the Prefectural Education Board during a Shinsa  (evaluation). The judges conducting the Shinsa are sword experts  contracted by the Education Board, usually senior members of the local  NBTHK branch ([B]N[/B]ippon [B]B[/B]ijutsu [B]T[/B]ken [B]H[/B]ozon [B]K[/B]ykai = Society for the preservation of the Japanese Art Sword).\n\nIt should be noted that the Trokush is [I]not[/I] a certificate of  authenticity; only the measurements, number of Mekugi-ana etc. and the  Mei (name inscribed) are stated, whether it''s authentic (Shshin) or  false (Gimei).\n\nOnly traditionally made Nihont can be licensed, i.e. swords made from  Tamahagane (a special kind of steel). This means in effect that it has  to be either an antique or made by a contemporary, licensed smith. Mass  produced WWII swords (so called Shwat) and foreign made swords are not  eligible for Trokush.\n\n\n[B]Sword export from Japan[/B]\nSwords for export must be submitted to the Bunka-ch-bijutsu-kgei-ka  (Art and Craft Section of the Cultural Agency). The Trokush is handed  in, and an export permit (Kobijutsuhin-yushutsu-kansa-shmei) is issued  in return. This export permit is valid for one month; within that time  all customs and export procedures have to be completed or otherwise the  permit becomes void.\n\nWith this permit it is possible to either send the sword via  mail/private carrier abroad, or to personally carry it through customs  when leaving Japan. The latter is in most cases not possible for those  who just visit Japan since issuing usually takes at least two weeks. In  this case the dealer/seller has to apply for the export permit.\n\nCosts\n \nWith this permit it is possible to either send the sword via  mail/private carrier abroad, or to personally carry it through customs  when leaving Japan. The latter is in most cases not possible for those  who just visit Japan since issuing usually takes at least two weeks. In  this case the dealer/seller has to apply for the export permit.\n\nCosts\nNihont (Sword) anything from $10000 to 35000(More likely to be at around 20000-27000)\n\nShipping through fed Ex(Not everyone will carry it) is $200 with $750 insurance on a $15000 for UK the insurance quote for Pakistan is likely to be 1/3 of the price.\n\nExport permit will be don\n\n\n\n', '', '5f4b28b5c9734739bdc4e2fb17b9c41e', 1338382395),
