(0x7642466f72756d5f506f7374, 200, 0, 7509, '[QUOTE=ArmsLover;3120]Does anyone know about the license in Sindh ? When does the Sindh Government allow submitting docs to give the civilians ?\n\n\n[B][COLOR=#381C50]"PROCEDURES FOR ISSUANCE OF ARMS LICENSE\n[/COLOR][/B]\n\n[COLOR=black]1. [/COLOR][COLOR=black]Fill up Arms License Form ([URL]http://pportal.punjab.gov.pk/punjabcms/servlet/PunjabCMSServlet?CMDCMS=V_T_DOCS_BROWSER_VIEW&txtDocID=6125&txtVersionID=1&CMDDOCTYPE=3&txtUserID=407[/URL])[/COLOR]\n[COLOR=black]2. [/COLOR][COLOR=#000000]Attach one copy of Identity Card with the duly filled up Forms. \n3. Get verification from Police Station, DSP and SP concerned on filled up Arms License Form. \n4. Applicant himself should appear before the Deputy Commissioner alongwith the copy of I.D. Card.\n5. Deputy Commissioner will order for the issuance of Arms License on the Form. \n6. Pasting of Tickets equivalent to Rs.1500/- for Arms License Form is required. Submit the forms in Arms Licensing Issuing Branch in the D.C. Office concerned and the copy of the Arms license will be issued and applicant will purchase Arm from Arms Dealer and its entry will be made in the Post Office and renewal thereof will be made annually with fee."[/COLOR][/QUOTE]\n\n\n', 'What is the miniman age for getting an arms liscence, provincial and national?', 'b149c0993e5fb9779fac0a74263b3d48', 1338566651),
