(0x7642466f72756d5f506f7374, 9875, 0, 3561, '[QUOTE=francolino;305332]I don''t think with an SG/LG, neat consistent kills (on boars) are possible at +50 yards.....or are they? Even with Rottweil SG/LG, the usual EFFECTIVE RANGE one can surely kill an adult boar is not more than 50 yds. I would say Shaheen SG/LG would have an EFFECTIVE RANGE of 35-40 yards on adult sized animals. Smaller ones or juveniles which can possibly be killed with 4# at point blank ranges with a hit behind the ear are usually not sought as game by hunters in general, so I would not talk about them.....\n\nI have found MOD choke to be very effective always, but have heard FULL choke is the best for allround boar hunting with shotguns with an SG/LG. I guess some patterning (Mod vs Full) needs to be done at 40 and 50 yds to see clearly the difference if any.[/QUOTE]\nFrancolino bro according to choke contraction companys if you want good patte', '', '5688f252a374b7d637c859526fdc1bf3', 1349901226),
