(0x7642466f72756d5f506f7374, 10006, 0, 7679, '[QUOTE=shahid khan rarasham;308228][SIZE=4]simple is that suppose consider a scope with axb specification ,.....\n1:"a" defines the magnification power of scope,... greater the magnification power ,larger the object being viewed will be.\nAlmost all scopes provide some level of  magnification.  Some have a fixed power and some with varia[SIZE=4]ble power,[/SIZE] the power is generally  denoted like this: &#8220;ax&#8221; meaning the scope enlarges the image by "a" times what you see with the naked eye.   "a" can be any number.\n2:,"b" is actually the diameter of objective lens (  The lens that collects the light that goes through your scope),........the diameter of the objective lens is very important.   Generally the higher the magnification the larger the objective lens  diameter must be.  Also, a larger objective lens let in more light and is  better for shooting in low light situations. [/SIZE][/QUOTE]\nthanks Shahid Khan rarasham for \n\n', '', '351a66b5225b14753edf96d3d3a6696e', 1349963830),
