(0x7642466f72756d5f506f7374, 10329, 0, 608, '[QUOTE=Faisji;319625]Custom made/handmade weapons have very tight fittings/tolerances hence they require longer break-in periods[/QUOTE]\r\n\r\nexactly! but ask yourself this why custom/handmade high precision equipment has such tight tolerances? the answer is simple: it is easier to tone down then build up. you need tighter fitting to ensure precision movement so how do you get tighter fitting? by asking your CNC machines to makes them on the higher end of their extremely small tolerance range. so, in effect, you are asking your machines to make them very slightly larger than their original size. thats why such parts need even more attention while hand fitting and break-in.\r\n\r\n[QUOTE=1mran;319651]Sir the reading r different because the guages n the measurement tools r inaccurate. accurate ones are very very expensive. This also goes for the bits n other tools used by most of the mavhinest. Cnc machines nowadays operate under very very tight tolerences hence are Very very accurate. So my take on thematteris the firearm is designed to work like its supposed to from the first shot[/QUOTE]\r\n\r\nBro, kindly refer to the example that I have given:\r\n\r\nsingle 1/8 inch drill and multiple holes. in that example you are taking all measurements from a single measuring device. no multiple tools are involved. single drill, multiple holes, single vernier caliper/screw gauge so in theory all drilled holes should have similar dia right? well.... I am afraid bro, every time you drill, you''ll end up with a different number. thats the game one needs to understand. measurement in reality is never an absolute value, it is always a range.\r\n\r\n[QUOTE=Salman_Ahmed;319674]Sir , not at all , normal combat handgun, designed for which ever calibre generally require no break in periods. All you need to do is perform a function check and they are good to go.\r\nGlock''s internationally and locally with Lea''s don''t get broken in, they are generally issued and used as per need\r\nThe Zastava M57 and CZ999 will go bang every single time you press the trigger with any type of ammo.\r\n\r\nMy opinion in all honesty is The "Break in" theory is mainly designed to justify failures in the 1911 platform and might just be lawyer talk.  [/QUOTE]\r\n\r\nBro, I think you misunderstood the point here. a break in is not a requirement. it is therefore unfair to expect a combat firearm to function flawlessly only after a break-in. any mechanical device is supposed to function the way it is supposed to from the moment of its inception. however performance will go up as it breaks-in.\r\n\r\n\r\n[QUOTE=Salman_Ahmed;319676]Ok Sir lets go from here, lets try to apply the scientific method. The break in process generally involves Running upto 500 rounds thru a handgun, FTE/FTF are generally to be ignored. \r\n\r\nBro, a break-in does not mean live rounds. you can always use snap caps. the whole point of break in is to ensure that all working parts settle with one another. if you can do that without live rounds thats good enough.\r\n\r\nthe 500 round benchmark is mostly a theoretical reference\r\n\r\n\r\nLets say some1 buys a new Pt1911 and loads up the magazines with 16 snap caps and manually cycles the firearm, Dry fires it, then repeats this process of cycle-dry fire 500 times. Would that qualify as a a break in ?\r\n\r\nDoes a live round do something that dry runs cannot do? Friction associated Smoothing of contact surfaces should be achievable by both means. \r\nAs far as my limited knowledge and internet research is concerned in-order to change the physical/chemical properties of steel , or alloys you need temperatures in excess of 500-1100 degrees Celsius . \r\nis the objective of live firing vs dry run to attain some high temperature associated change in properties of the material used to make handguns? ( in my opinion there is a problem with that hypothesis too )[/QUOTE]\r\n\r\n\r\n\r\n[QUOTE=sharp-shooter;319682]once again a nice topic from Salman Ahmad bro ,interesting to read the comments of heavy weights like Ak47 ,12 guage and faisji bro...well GENTS allow me to give my two cents in very  few words "break in period is for perfectionest only (those who are not satisfied with only bullseye those who strife for groups tighter than an inch) rest i ll have to agree with S_A combat pistols are good to go from the very first round been using glock since ages never done any breaking in and it worked flawless having said that some very authentic source while attending a workshop conducted by a "gora" was told that breaking in is needed to polish in the very micro pores in the barrel which were created while rifling the barrel the process not only requires firing of some good number of rounds but also a pattern of barrel cleaning after every 5 odd shots :( quite time consuming i would say[/QUOTE]', '', '6c7b7c815180ad4852bef220fd1ce15c', 1353123857),
(0x7642466f72756d5f506f7374, 10410, 0, 6235, '[QUOTE=Ahnab;322511]Oh for the love of God! Ok, although I condemn the wanton & senseless killing of [B]ANY[/B] living being, I think [B]imdad ali[/B] has adequately explained his reasons for taking the shot. His actions may not have been chivalrous, but he took a decision to the best of the circumstances he found himself in. I myself have shot at (and managed to kill) some crows who had attacked my grandfather twice; that may make me a cold-blooded murderer in the eyes of those PETA hippies, but quite frankly when it comes to the security & well-being of my loved ones, I don''t give a damn.\n\nEnough. Let''s all move on now...[/QUOTE]\n\ni second what ahnab has said!!!\n\ni have hunted wild boars in isb!!! The most common reason people who want to be seen as rightous and all in this country, give is that wild boars destroy fields. Yes its true, but can someone please point it out to me as to who is ploughing fields around sector E-11 or even in the posh sectors of isb?!? last week my  frind who lives in the outskirts  showed me dead carcasses of 6 wild boars which were lying dead in the middle of a large open space away from any settlements.\nPeople still kill/ hunt wild boars even though we dont eat them and even when they are living not even near populated areas! but nobody shouts out for them being killed coz on the hunting license this is what is written:\nKILL WILD BOARS, JACKALs AND HEDGEHOGS, they are a menace to the environment!!!\n\nalthough the above point is complete bull crap!!!!! wild boars and jackals are an integral part of the eco system!!!!\n\n i killed a kite 5 years ago with my desi made air gun why because its favourite pass time was to sit on my Sun tv antenna and move it away from the direction of Damn e Koh hence screwing the reception. i ignored this once, twice.....hell even thrice! next time it came around, it was dead! \nWHY DID I KILL IT? coz for me getting on the roof again and again, risking my own safety or the safety of my domestic staff along with avoiding the tiring & exhausting job was more important(while we engaged in fixing the sun tv antenna) than a kite!!!!\n\nnow everyone was after imdad ali coz he mentioned eggs.........why did everyone forget to see the OR when he said "kite was only defending his nest OR eggs"\n\nyes imdad ali should''ve explained his reasons in his first thread at once but the way everyone joined the band wagon of ridiculing him was also wrong!!!\none person against sooo many, is a little uncalled for!!!', '', '78c4cfd45ee665bbdf25487160a69526', 1353954673),
