(0x7642466f72756d5f506f7374, 0, 311926, 9102, 'I have been benefitting from this forum since almost a year now and joined yesterday mainly because I wanted to compliment 12guage on his wonderful effort on that airgun thread. During the time I have been here I felt there are some areas where this forum can improve and feel i should share my suggestions with management.\n[LIST=1]\n[*]There is too much emphasis on posting pictures of collections. example I introduced myself yesterday and immediately received requests to post pictures of my guns. The guns i have are not unique and everyone here must have already seen pictures of those guns hundreds of time. Such environment creates a culture of show-off-ism.\n[*]Too many threads about the same thing. Useful information is lost. Time is wasted in searching of relevant info which is burried deep under alot of unnecessary posts.\n[*]Wrong focus. A quality thread by 12 guage on comparison between 2 air rifles attracts few posts versus another thread "I have bought a SIG P226" attracts three times the number of posts. Even the majority of posts in 12 guages thread are mostly compliments, no quality discussion generated.\n[*]Less emphasis on improving skills. Forum should promote more and more visits to range, more shooting, more emphasis on improving shooting skills, discussion on shooting techniques, members posting their targets and discussing their mistakes, etc.\n[*]Less emphasis on conservation and responsible/ethical hunting. Forum should promote these things for our future generations.\n[*]Forum should hold regular shooting competitions in different cities.\n[/LIST]I am sorry if any thing i wrote above hurt anyone but this was in good spirit and with the intention for benefitting all members of this great forum.\n\nThanku\n\nWS\n\n\nPS.. I just came across this post and think is relevant \n\n[QUOTE=AK47;311856]This was long awaited. Good step. May I add, that in addition to the spam detected by you, I personally have a feeling there''s more to it, in form of needless "non-objectionable" spam in the shape of new threads on topics already discussed multiple of times on the forum. This, as per my feeling, [B]to disturb the rhythm of useful discussion on the forum.[/B] All such treads being posted by totally new, "god-sent" members. Usually the questions and titles of such threads are totally "childish", answers almost "self-understood", not needing any discussion at all. Just check along the forum, the flooding of such threads, and the "uselessness" they make to the appearance of the first few pages of "what''s new", which also, generally, is the 1.st impression of the professionalism/quality of affairs going on, on any forum.[/QUOTE]\n\nModerators shoudl request members to use search option as much as possible instead of opening new threads for basic things. You can also create a dedicated section "Newbie? Ask your question here" and dedicate one mod just to address their queries. This will spare us from the "childish" and "useless" posts, a', '', '886c8e29f5aca80d4e2ca05d2ef5cd43', 1350722862),
