(0x7642466f72756d5f506f7374, 0, 307498, 1408, '[QUOTE=internetsaint;307490]salam all pakgunners,\ni don''t carry my weapon but i have heard that we can''t shoot someone above the naval even if a criminal shots you in your head ( god forbid)....\ni would be thankful if anyone can comment about that .[/QUOTE]\n\nThe guiding law about self defense in Pakistan is:\n\n[TABLE]\n[TR]\n[TD][B]96.[/B][/TD]\n[TD][B]Things done in private defence:[/B]\nNothing is an offence which is done in the exercise          of the right of private defence.[/TD]\n[/TR]\n[TR]\n[TD="colspan: 2"][/TD]\n[/TR]\n[TR]\n[TD][B]97.[/B][/TD]\n[TD][B]Right of private defence of the body and of property:[/B]\nEvery person has a right,          subject to the restrictions contained in Section 99, to defend;                    [TABLE]\n[TR]\n[TD]                First:[/TD]\n[TD]His own body, and the body of any other person, against any offence affecting the                human body;[/TD]\n[/TR]\n[TR]\n[TD]                Secondly:[/TD]\n[TD]The property, whether movable or immovable, of himself or of any other                person, against any act which is an offence falling under the definition of theft, robbery,                mischief or criminal trespass, or which is an attempt to commit theft, robbery, mischief or                criminal trespass.\n[/TD]\n[/TR]\n[/TABLE]\n[/TD]\n[/TR]\n[/TABLE]\n\nAlso shooting at legs is a big no no if you are trying to end a situation or neutralize a threatThink about what is beyond the target,whafemorat are you aiming at and alo remeber th if you hit \n', '', 'd2ec13493853d00b2a09e0ba1a6d81cd', 1349759450),
