(0x7642466f72756d5f506f7374, 9993, 0, 116, '[QUOTE=AK47;307600]Absolutely agree on the "gift" part.\n\nLet me point out that as per my best info, any announcement of sect.144 imposition, for any period of time, and announced for any sectional jurisdiction, IS ALWAYS MARKED WITH CLEAR [I]STIPULATIONS[/I] about the EXTENT to which it applies.\n\nHence, a 144 imposition can be for a simple thing as PILLION RIDING [B]only[/B], for political congregations [B]only, [/B]or, for all things combined, as per the momentarily will of the local "Gora" announcing it/putting it into effect, as per conditions of law and order under his jurisdiction.\n\nHence, and sadly, even the LEO''s don''t bother to check out the stipulated announcement as to the extent of the imposition, and KOTA, GHODHA, all are treated under same [I]guillotine[/I].\n\nMeans, if the 144 imposition is for motor bikers only, along in the net, you''ll find the SD requiring gunners as well.\n\nYou can always check out the [I]extent[/I] of the imposition from your local authorities, when ever imposed, but I must say, explaining the extent to the Goras upholding it in the streets, may be as impossible/difficult, as back during colonial rule.\n\nI personally do not find any grain of logic in the chambered carry stipulations with a 144 permit along.\n\nAnd I agree on the 217 lbs part as well. Lol!\n\n\nRegards.[/QUOTE]\n\nSection 144 gives powers to civil administration to mutilate [B][I]any of the rights[/I][/B] constitution gives to a citizens; in the name of maintaining law n order; it basically is blackest of the laws foreign rulers imposed on their slaves in the time of need. I am not sure if this section still is in effect in India & Bangladesh but in Pakistan it shines every now and then with full glory of british rule. You cant have better section of law than 144 to keep slaves under the thumb.\n', '', 'c9ea7907d2645552a8a0775a837d7940', 1349778960),
