(0x7642466f72756d5f506f7374, 0, 309724, 608, '[B]AoA Everybody[/B]\r\n\r\nI was thinking the other day [I](yup! I do that every once in a while, though its not a regular thing)[/I] What would I do if I were to wake up one day only to find out that the un-dead now walk the earth, consuming every human being in their path as the zombie apocalypse spreads from one city to the another.\r\n\r\n[IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/DSA%20Pump%20Action%20Shotgun%20Slug/ZombieApocalypse.jpg[/IMG]\r\n\r\nNow before we proceed, kindly allow me to shed some light on a Zombie for those who are unable to follow me [I](I don''t see how that''s possible cause zombies are a well known fact, right next to vampires and werewolves)[/I]. Zombie, a former dead person is re-animated by some sort of a virus outbreak, they hunt and consume anyone alive and their extremely low IQ can only be maintained by consuming human brain matter which is why they always reach for your head first.\r\n\r\n[IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/DSA%20Pump%20Action%20Shotgun%20Slug/zombie-apocalypse.jpg[/IMG]\r\n\r\nNow don''t get me wrong, I am not a Zombie hater. I just don''t want my brain to end up on somebody''s menu. Infact, I just might consider becoming friends with a zombie if he/she is decent enough to [B]NOT EAT ME AS I KICK n SCREAM MY LUNGS OUT DUE TO THE PAIN AND AGONY EXPERIENCED WHILE BEING THE MAIN COURSE OF A FEEDING FRENZY[/B]. This just goes to show that I don''t hate indiscriminately. Have you ever heard me complain about vampires? Of course not. Hey! I married one, for crying out loud! \r\n\r\n[IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/DSA%20Pump%20Action%20Shotgun%20Slug/zombies.jpg[/IMG]\r\n\r\nAnyway, how do you kill a zombie or make dead of the undead [B](wow! That&#8217;s deep)[/B]. You either blow its head off or sever all major limbs along with its primary biting organ. I know it&#8217;s a gruesome end but totally justifiable when you consider what this thing is capable of doing even with extremely limited intelligence. Okie! You can chop off its genital organs too and take away its chances of reproduction as well but isn''t that a bit excessive/harsh? I mean the poor thing is going to get hacked up anyways.  \r\n\r\n[IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/DSA%20Pump%20Action%20Shotgun%20Slug/Zombie_Attack_by_namesjames.jpg[/IMG]\r\n\r\nBack to the lecture at hand, perfection is perfected, so I am a let &#8216;em understand (Snoop Doggy Dogg): what would I do in terms of personal protection and the ability to feed my family and myself. What would be the most critical tool for the job? \r\n\r\nAmong many things; I would need a reliable firearm with high hit probability, hell and back sort reliability, ability to continue functioning with nothing more than my own spit as a lubricant and bomb proof durability.\r\n\r\n[IMG]http://i998.photobucket.com/albums/af103/12gauge-pakguns/DSA%20Pump%20Action%20Shotgun%20Slug/corpse.jpg[/IMG]\r\n\r\nThats right, when it comes to delivering post-terminal payloads to a rotting zombie corpse, the power factor of a compact 12 gauge cannot be overlooked. Also, the sheer ubiquity of 12-gauge ammo means that even if your ammo supply comes from scouring wrecked houses for loose shells that may have been spilled in the first wave of the zombie outbreak, whatever you find, you''ll be able to use.\r\n\r\nSo&#8230;..that settles it. Its going to be a compact pump action shotgun. however cannot make use of an existing shotgun and upgrade/modify it to fulfill my requirements. It has to be a ground up design as the uniqueness of the circumstances/challenge (The Dead Walk!) call for a specialized pump action shotgun.\r\n\r\n[B]My requirements for a Zombie de-Animator Machine:[/B]\r\n\r\n1. 18inch barreled pump action shotgun with specialized barrel bore to ensure a consistent pattern of 6 to 8 inches from 5 yards to 15 yards.\r\n\r\n2. 20 inch special purpose barrel for slugs with ability to accurately fire slugs at 50 yards as I might need to harvest meat.\r\n\r\n3. Loose tolerances (beyond standard) to ensure reliable operation with a multitude of payloads.\r\n\r\n4. Combat platform as I would rather use a combat shotgun for hunting instead of using a hunting shotgun for combat.\r\n\r\n5. Smooth as silk cycling ability to ensure hit repeatability. I am talking minimum effort to cycle the action so that the shotgun remains on target while I am racking the forend.', '', '5d084aa9efaf39fc50b69d46b0c3cdf9', 1350230448),
