(0x7642466f72756d5f506f7374, 8990, 0, 608, '[QUOTE=Abbas;307845]lol, I was quick on the draw 12G :D\r\n\r\n[URL]http://www.pakguns.com/showthread.php?10003-Pakguns-Official-Merchandise-Official-PG-Caps-FINAL[/URL][/QUOTE]\r\n\r\nBro, kindly reconsider you following post as I think it can potentially create problem:\r\n\r\nSalams, \r\n\r\n MashAllah it is a pleasure to see these caps posted here finally. 12G and I had lots of conversations about them and got lots of samples made which again and again we modified to get exactly what we wanted. The finished product is something we really like. One thing the PakGuns Management is all agreed on is that anything with the PakGuns logo on it will be made to the highest possible quality.\r\n\r\n I was quite demanding that the fabric of the black cap must be ''exactly'' the same as the sample I sent. I find it the most comfortable fabric to wear in both winters and summers. The Skul Kaps provide more comfort for handgun shooting specially. \r\n\r\n The credit for this entire project goes solely to 12G as Denovo and I mostly played the role of advisor''s ( although I''m sure Denovo had to provide the Chicken Malai Boti''s as well  ) Well done brother, excellently executed !\r\n\r\n I would like to announce costs for the brothers wanting to buy more than 1 cap. First cap is Rs. 650, second cap a total of Rs. 1200 and additional caps ordered are Rs. 500 each. So in short:\r\n\r\n 1 Cap = Rs. 650\r\n 2 Caps = Rs. 1,200\r\n 3 Caps = Rs. 1,700\r\n 4 Caps = Rs. 2,200 and so forth. \r\n\r\n I would also like to say that this is not an income generating project for me personally or for any member, rather we spent time and money out of our own pockets to provide brothers here with a high quality PakGuns product at a very reasonable cost. \r\n\r\n Regards,', '', 'cb6e93f29afb92f85f4c5e1b62014a60', 1349852537),
