(0x7642466f72756d5f506f7374, 10022, 0, 7782, '[QUOTE=Usmanh;308097]I had made up my mind about buying the Glock 23 or the Glock 19 and was getting ready to buy one. And suddenly a close friend ''starfish'' put doubts in my mind telling me that it was not worth it and that I should reconsider. So I then decided that I may just get the Dan Wesson vBob which I really like and it is easier to carry. But the only hiccup was that I already have DW Valor full size so was double minded. \n\nSo the search began - Smith & Wesson M&P came to mind - still is a contender but somehow I just dont think it is in the same league. I was suggested the Sig 226 Tacops - which is a great gun. So I figured I''ll get the TacOps and the matter will be settled. \n\nBut I was thrown a curve ball today and a H&K USP was offered to me around the price of G19 - maybe a bit less and this is making me re-think. \nSenior members please help - or should I just go and get the G23/G19 as I originally intended? \n\nTo be honest I dont need a gun and you may ask what is the purpose CC/SD/HD/Range - actually there is none. I just want to add to the collection. Already have plenty of handguns to cover all the bases. :)\n\nI''m open to suggestions if you feel that there is a better handgun this bracket. I''d really like a .40 and I dont have one of those. But I''m happy with a 9mm as well or even a .45 \n\n- Usman[/QUOTE]\n\n\n\n', '', 'f407ad40445b667a53a42c0bcb44103a', 1349863343),
