(0x7642466f72756d5f506f7374, 10550, 0, 14904, '[QUOTE=Aquarius;343081]Totally agreed.[/QUOTE]\nWWC ammo will never come in red boxes.\n9MM NATO just means the ammo is loaded to the mildly higher pressure of most European loaded 9MM ammo.\n+P 9MM is loaded to a still higher pressure level. Any military firearms should be able to handle +P ammo. \n\n90% of all 9MM pistols should be able to eat 9MM NATO all day long and have no problem.\n\nLow end 9MM pistols like my Jennings 9 should not be fired with +P ammo. There just isn''t a large mar\n\n\n', '', '1cfa68ad1532ed49c57f8c519ce12dcf', 1361241109),
