(0x7642466f72756d5f506f7374, 10702, 0, 2223, '[QUOTE=psychiatrist-1;339656].45 had been a famous auto hand gun for USA Army since 1887. I have fired it thousends of rounds because i was in US army. It was used in WWI and WII by US forces. Although, it is powerful and rugged but a lousy, inaccurate, and ugly heavy gun. Therefore, US army exchanged it with Beretta 9mm. Whoever buy it will regret. It is not a good gun,thou  famous. US army rejected all US made models including S&W, Ruger etc and u want to buy it. It is a joke with soldiers that ACP 45 is like a sherman tank which frequently broke down catch on fire without getting hit..................45 is compared with a Jack ass who is blind from one eye, limps, and can not carry its own weight. Rest is your decision.[/QUOTE]\n\nDearest Psychiatrist bro its a real pleasure to see your post after such a long time.. we missed you very much on the forum..\n\nRegarding 1911 which you explained very well & I absolutely agree with you but the ones used by US army (by Colt) are now almost 100 years old models & with such a long usage, the accuracy must be compromised no doubt.. its a collectors item presently. But many new companies still produces it eg S&W, Springfield, Les Baer, Kimber, Dan Wesson, Sig Sauer, Wilson Combat, Para,Taurus & many more. Why ?? because they are trendy and addictive.. even the US army & cev', '', 'd04684c5cdcf5258693858cc4d0bceca', 1360071742),
