(0x7642466f72756d5f506f7374, 10320, 0, 1408, '[QUOTE=Omkhan;318917]bhayyion, a pistol caliber will remain a pistol caliber irrespective of the barrel length. 9x19 or 7.62x25 do not become some magical hard hitting long range rounds when fired out of a carbine length weapon. They are NPB (provided its not FA) and the weapon is called a pistol not a rifle.[/QUOTE]\n\nA bullet being fired is essentially a controlled directional explosion of slow burning agent so the longer that explosion is contained and directed the more acceleration it will impart to the projectiles o it does change the range an effectiveness of the round.\n\n\n\n\n\n\n\n', '', '1de9478478c21cfa9f885e59f779d3ec', 1352882759),
