(0x7642466f72756d5f506f7374, 8801, 0, 8733, 'Dear Mian Sb, I will relate a short story of how the things we want to achieve CAN be achieved given some time and a little bit of expense(relatively speaking), and a LOT of patience. The system CAN be worked. \nBefore I start, please accept my disclaimer, whereby I state that it is entirely possible that the following example might not apply to the shooting association and/or I am completely ignorant of what the ground reality is. \nHaving said the above here is what happened, I was living in the US for about 10 years and then when I decided to move back to my beloved PK in 2004, I decided to import 3 motorcycles with me, my father also warmed to this passion and over a few years we have accumulated about 7 of them...all of them above 600cc. Now the problem is, if you want to ride bikes, big ones that is,  and you live in lahore, the air is full of diesel fumes, and you ride for 5 mins, your face is black with soot, and your butt is on fire because of exhaust heat and your head is boiling in the hot weather. In other words, if you want to truly enjoy riding a big bike in lahore, I mean truly ride, (not posing infront of mcdonalds) it is not possible. Ofcourse, if you live in islamabad its a completely different story. \nA couple of times, my father used his connections, and got the Motorway Police IG to give us special permission to go on the motorway\n\n', '', 'c4e41c6a93a5aa1b21d7cd9cd18ad044', 1352811503),
