(0x7642466f72756d5f506f7374, 10272, 0, 3150, '[QUOTE=Mian-50;316290]AoA brother,\n\nMost of the SXS shotguns are trouble shot by opening the TRIGGER guard metal.\nIf you like DIY jobs,then you need to have the following:\n\n1.Multi-head screw drivers  set (Needs grinding sometimes to make it according to\n   GUN SCREW head size.)\n2. Hard rubber head hammer.\n3. Screw loosning lubricant or spray(WD-40,brunox etc.)\n4. Set of punches to remove pins for taking out firing pins.(Clogged if not broken).\n\n Open the Trigger guard to expose another screw under it,it should now dislodge the stock out\n of action.Find the screw holding the top lever,Inspect it whether you find a loose bolt or cracked\n part.Try to thoroughly clean the whole action with DIESEL and operate the TOP lever after TIGHTNING.\n\n Repeat the same process for firing pins,inject diesel with a SYRINGE from outside and shake it well to\n dry out the action,although DIESEL has lubricating qualities also.Now operate the lever and do the coin n"TOSS" check\n with firing pins...................\n\nCool guidance, but in the protocol, please replace the coin with some other hard surface as using the coins for such purpose is not justified. \n\n Without fixing stock,assemle barrel and forearm,just to load the hammers,Disassemble again and place any\n coin over firing pin hole and press the triggers turn by turn in order to check whether strikes of both pins are\n equal or not.\n\n In any case,you fear to ruin your gun, then go to Mr Akram (Basement Buksh Elahi-Lahore) to get the good repair\n job.[/QUOTE]', '', '462f7793cc2c785290e2a0d6ed947417', 1352158109),
