(0x7642466f72756d5f506f7374, 8320, 0, 7421, '\n[COLOR=#000000][FONT=Helvetica]PAKISTAN GUN PRICES (01/01/2013)[/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica]\n[/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica]\n[/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][FONT=Tahoma, Calibri, Verdana, Geneva, sans-serif][COLOR=#3e3e3e]The stars are based on the performance, accuracy, durability & handling.[/COLOR][/FONT][/LEFT]\n[LEFT][FONT=Tahoma, Calibri, Verdana, Geneva, sans-serif][COLOR=#3e3e3e]\n[/COLOR][/FONT][/LEFT]\n[LEFT][FONT=Tahoma, Calibri, Verdana, Geneva, sans-serif][COLOR=#3e3e3e]Most of the weapons which are brand new boxed, you will find the starting price from 40+[/COLOR][/FONT][/LEFT]\n[/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica]\n[/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][COLOR=#3E3E3E][FONT=Tahoma]1. [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma]RUGER MARK III (U.S.A) [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma].22 [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma]Rs: 80,000 - 150,000 [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma](5 STARS RATING *****)[/FONT][/COLOR][/LEFT][/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][COLOR=#3E3E3E][FONT=Tahoma]2. ISSC M22 (Austria) .22 Rs: 40,000 - 67,000 [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma](4 STARS RATING ****)[/FONT][/COLOR][/LEFT][/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][COLOR=#3E3E3E][FONT=Tahoma]3. [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma]Walther P22 (Germany) .22 Rs: 44,000 - 65,000 (3 STARS RATING ***)[/FONT][/COLOR][/LEFT][/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][COLOR=#3E3E3E][FONT=Tahoma]4. BROWNING BUCKMARK .22 Rs: 55,000 - 85,000 [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma](3 STARS RATING ***)[/FONT][/COLOR][/LEFT][/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][COLOR=#3E3E3E][FONT=Tahoma]5. TAURUS 941 (Brazil) [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma].22 Revolver [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma]Rs: 44,000 - 55,000 [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma](3 STARS RATING ***)[/FONT][/COLOR][/LEFT][/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][COLOR=#3E3E3E][FONT=Tahoma]6. [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma]SIG Mosquito .22 Rs: 48,000 - 60,000 [/FONT][/COLOR][/LEFT][LEFT][COLOR=#3E3E3E][FONT=Tahoma](2 STARS RATING **)[/FONT][/COLOR][/LEFT][/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][COLOR=#3E3E3E][FONT=Tahoma]\n[/FONT][/COLOR][/LEFT][/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][LEFT][COLOR=#3E3E3E][FONT=Tahoma]\n[/FONT][/COLOR][/LEFT][/FONT][/COLOR]\n[COLOR=#000000][FONT=Helvetica][COLOR=#333333][FONT=Verdana]Personally ISSC M22 is better than Walther P22. One of the main reason is because it has a Glock Look, Good weight & Recoil handling is better. THAT''S JUST MY OPION.[/FONT][/COLOR]\n\n[COLOR=#333333][FONT=Verdana]ISSC M22 Price Range From RS: 40,000 TO 67,000 [/FONT][/COLOR]\n\n[COLOR=#333333][FONT=Verdana]IF YOU BUY IT NOW. [/FONT][/COLOR]\n\n[URL="http://www.pakguns.com/attachment.php?attachmentid=16638"]Attachment 16638[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16639"]Attachment 16639[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16640"]Attachment 16640[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16641"]Attachment 16641[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16642"]Attachment 16642[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16643"]Attachment 16643[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16644"]Attachment 16644[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16645"]Attachment 16645[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16646"]Attachment 16646[/URL][URL="http://www.pakguns.com/attachment.php?attachmentid=16647"]Attachment 16647[/URL]\n\n[COLOR=#222222][FONT=Verdana]Model Early 2010 Price: RS: 37,000 Depending On The Dealer.[/FONT][/COLOR]\n[COLOR=#222222][FONT=Verdana]Late 2010 Price: RS 45,000 Depending On The Dealer.[/FONT][/COLOR]\n\n[COLOR=#222222][FONT=Verdana]Model Early 2011 Price: RS: 45,000 Depending On The Dealer.[/FONT][/COLOR]\n[COLOR=#222222][FONT=Verdana]Late 2011 Price: RS 55,000 Depending On The Dealer.[/FONT][/COLOR]\n\n[COLOR=#222222][FONT=Verdana]Model Early 2012 Price: RS: 60,000 Depending On The Dealer.[/FONT][/COLOR]\n[COLOR=#222222][FONT=Verdana]Late 2012 Price: RS 67,000 Depending On The Dealer.[/FONT][/COLOR]\n\n[COLOR=#333333][FONT=Verdana]THESE PRICE ARE BEEN CHECK BY 18 DIFFERENT DEALERS IN DIFFERENT CITIES. MOST OF THE DEALER''S SELLING THE 2010 MODEL FOR 45K OR HIGHER. BECAUSE OF THE .22 CAL WHICH IS NOT VERY MUCH USED IN PAKISTAN SO THE STOCK OF .22 REMAINS & THAT''S ONE OF THE REASON WHY THE MOST OF THE DEALER''S STILL HAVE BRAND NEW BOXED 2010 MODELS IN THEIR STORES. [/FONT][/COLOR][/FONT][/COLOR]\n\n[COLOR=#333333]\n[/COLOR]\n', 'Price &amp; PerfCompare', 'c2d3469e665149085a3f1193be51e714', 1357554800),
