(0x7642466f72756d5f506f7374, 10608, 0, 6464, '[QUOTE=Leon;330529]Bro! First of all kindly update (in your profile) your location.\n\nPlease state your purpose e.g. Self Defense, Home Defense, Conceal Carry, etc.Then please give us idea about you budget.\n\nBTW, the cheapest pistols (price wise) available in the market are Chinese. There models are NP42 (aka CF98), NP22 & NP34.  Search the forum, you will get to know the details. These will cost you between Rs. 40,000 to Rs. 50,000 (depending upon location). \n\nNobody on this forum will ever suggest you Pakistan Made pistol.[/QUOTE]\nexactly right sir Leon,9mm pak made are available but because of poor metallurgy  .i will humbly suggest to purchase chinese 9mm ,if our brother budget still does not allow hi then I will\n\n', '', '11f0046597f29620b08f18d83a42e8ec', 1356721240),
