(0x7642466f72756d5f506f7374, 7224, 0, 608, '[QUOTE=Nazim Sahib;326642]I dont think CZ 999 is a budget gun.It is an outstanding quality handgun in a v decent price.[/QUOTE]\r\n\r\nBro, CZ 999 Scorpion is indeed a budget gun. kindly look at its price internationally and you''ll get the idea. it is produced in a country quiet similar to Russia as far as labor dynamics is concerned thats why it is also similarly priced to Russian counterparts.\r\n\r\nas far as quality is concerned...well... the answer to that relies in the definition of quality. if quality is finish then I am afraid it still leaves a lot to be desired.\r\n\r\n[QUOTE=Nazim Sahib;326642]It was initially a very expensive handgun but due to political trouble in Serbia the price was lowered (and rightly so i believe)\r\n\r\n\r\nThe gun has passed alot of tough tests and has been found to be supremelly reliable.To get a very good idea about how good it is just see the comparison done when it went up against the Caracal.The thread is here on Pakguns and is a very very fair comparison.[/QUOTE]\r\n\r\n[QUOTE=SIGlock;326727]I personally agree with Nazim sb... In my humble opinion, the reason is that CZ999 is considered to be a better pistol than NP22/34... I never had the opportunity to shoot with CZ999, but have used NP22, currently using NP34 and REALLY like it... According to many senior members/ users of NP22/34 & CZ999, CZ999 is FAR better than NP22/34... AND... if its better than NP22/34, then it MUST be a "HELL OF A GUN"... I don''t know about the political scenario, but the only reason of CZ999 being cheap rather "economical" is that in Pakistan, unfortunately, Serbian guns don''t have that much of demand, compared to Turkish guns... Unfortunately most of the people in Pakistan, go for the looks rather than functionality... But people who have "the knowledge", would always opt for CZ999/ EZ9/Compact rather than Turkish weapons...[/QUOTE]', '', '1b9622493225f7c681e35c476acfe413', 1361127207),
