(0x7642466f72756d5f506f7374, 11041, 0, 8368, '[QUOTE=Enigmatic Desires;357588]Nopes. it is around 65k or so these days give or take a few  thousands.  However I prefer the local version over the turkish one. \n\nWhy. Well... The original M1919 ;may; handle a few slugs but its not recommended. besides it comes with 5 round mags. The local offering is definetely not slug capable while it comes with 7 round mags. I likes. :)\n\n Besides the local one has a warranty. and the imported one does not. And Akdal has been known to give issues. So if U get a bad imported peice u r pretty much  stuck with it. but in the case of a local one made by RAC they claim that they will either change it or repair it free of cost. \n\nLooks wise they are almost the same. \n\nThe same goes for semi auto 30 bore ak and m 16 type pistols. They r the rage with security agencies these days. i have personly seen a well made one at the Airmen club and it ate everything thrown at it with aplomb. BTW if i recollect u had made a license before inspite of your age? what happened? was it fake?[/QUOTE]\nNah its not fake.', '', 'c2d811bfd04bd79785b3340bdd1b0280', 1365949312),
