(0x7642466f72756d5f506f7374, 12232, 0, 15152, '[QUOTE=mehranbiz;400864]I always doubt polymer frame pistols because we have no previous history about the performance and life of polymer frames,  70 years old metal guns are still alive around us and in use...[/QUOTE]\nCertainly metal is more desirable in many ways, but the qualities of polymer are far from unproven. In fact, polymer has proven itself quite well over the last century. Keep in mind, Glock is far from being the first high stress application of polymer, nor is it the first polymer framed firearm. That distinction goes to the Remington Nylon 66. It was a semi auto rifle chambered in 22. It was manufactured from 1959 until the late 80''s. Also predating the Glock by over one and a half decades was the HK VP70 9mm pistol. Not to mention all the other heavy duty uses since it''s invention in the 1800''s, such as military gear and automotive parts, containing corrosive liquids such as brake ', '', 'b4833a1bb1d3020fbf09a8d92ee22f82', 1382230071),
