(0x7642466f72756d5f506f7374, 11117, 0, 15033, 'go for a hammer fired gun unless ur buying a glock. "in pakistan glock is ridiculously priced, multiplying 4x or more by the retail price that is absurd" \nanyhow hammer fired are safe, if u have issue of gun being concealed behind clothing then u can always go for BOBBED hammer, and if bobbed hammer is not available u can BOB your spurred hammer by ur self.\nwith a loaded chamber a de-cocked hammer is as safe as a DA/revolver\nmost importantly in case of an ammunition-related failure to fire,                       all that is needed is an additional second or third squeeze of the trigger                       without the need of first pulling the slide back to re-cock the pistol.', '', '764949a2c14b69c21839ae1042619fb8', 1363469879),
(0x7642466f72756d5f506f7374, 4004, 0, 14904, 'The best gun for SD/HD is the one in your hand at the time its needed.\nStress will be unbelievable. Tunnel vision and loss of hearing is almost guaranteed. Time will slowdown to the point that you will not be able to react. \nThere will be no recoil, but your hand eye coordination will be gone.\nIf its a HD situation  where are your kids/wife?\n\nI''ve accidently touched off a 7,62X39 AP round. in my parents house many years ago. Taught me a good lesson.\nThe bullet went through a speaker cabinet,through our exterior wall, through a wooden fence. through our neighbors wall, through a sink cabinet, into the neighbor garbage disposal. \n\nIn a HD fight I''m going to be capping off 5 rounds of 00 buck in a second or two. That''s 45 lead balls of death coming at you. No pistol will match that.\nI''ve seen my brothers HK Benelli Super 90 fail.', '', '3b1ac1f9b9da0aa5254e2ac93eaa7392', 1361167010),
(0x7642466f72756d5f506f7374, 7853, 0, 1253, '[QUOTE=Abbas;341212]@TriggerHappy Congratulations on becoming "PakGuns Elite" ! You surely are. \r\n\r\n@ED How''s it going brother ? All well ? Talking of titles I just noticed, I think you and AK47 are front runners of being the first "[B]PakGuns [/B][B]Emeritus" [/B]Looking forward to seeing that under your nicks.\r\n\r\n@Leon Thank you for the kind words brother, sorry could not reply earlier. \r\n\r\nAs for Caracal vs DUTY, I like them both and carry them alternatively but I think after using both the guns for more than a year I''d pick the Caracal over the Duty. It just is a better gun. I remember when I said it''s as good as a Glock but cheaper (it was blasphemy back then lol) but seriously it really [B]is [/B]as good as a Glock.  (I smell something burning in Rawalpindi) ;)[/QUOTE]\r\n\r\n+ 1 Abbas bhai though it burns. U mean only in', '', 'e64ae03671330444329a3a9d638803a4', 1361170997),
