(0x7642466f72756d5f506f7374, 11060, 0, 4098, '[QUOTE=TRX;349942]> CHILLED SHOT (I wonder what does this mean\n\n Normal shot is cast in a "shot tower" several stories high.  Air cools it while it falls.  At the bottom the shot turns down a ramp into bins.  Air-dropped shot is soft.\n\n Sometimes shot is dropped into water, which cools it rapidly.  This "chilled" shot is harder than air-dropped shot.  Shotgunners choose shells with shot appropriate for what they intend to do.  Mostly, I see chilled shot in shells loaded for shooting clay pigeons.[/QUOTE]\n\nTRX Bro ! No need to wonder, you are absolutely right.\n', '', 'cff7db27f8457af689023e519659115f', 1363284771),
