(0x7642466f72756d5f506f7374, 0, 328908, 162, 'Salams All!\n\nCitrus season!\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/PG upload/OrangeBloss_wb_zpsfc9b1553.jpg[/IMG]\n\nThis beloved forum and community of best friends has always been sincerely helpful with anything asked for, so I was wondering with respect to a new venture if we had any knowledgeable Pakgunner fellow on board here, with some know how on orange trees plantation?? \n\nI needed some help - [I]especially from our Punjab quarters[/I] - with respect to selection of the [I]best n'' right [/I]sort of citrus trees to have planted on a newly acquired piece of land over here, purchased just a few days back.\n\nQuite some local land owners over here are turning towards plantation of orange trees over the traditional trend of apricots farming and it does bear good fruit.\n \nYou may probably already have heard of red blood oranges from Khanpur area, outskirts of Taxila. It''s my favorite citrus, though a bit to the sourer side.\n\nI really don''t want to entrust the befooling roadside nurseries around with this investment, since this may involve hundreds of trees and these people just make you nurture, caress plants for years which later on turn out to be fakes and all hard work, efforts go down the drain. \n\nTherefore requiring some sincere suggestions on the best type of sweet orange trees/red blood to have planted and guidelines on from where to purchase these in Punjab with a guarantee stamp, that it''s genuine stuff and no "clone work".\n \nBest would be if some helpful fellows here could assist the acquisition personally or at least arrange it through very personal friends, so that I can get the right stuff in. And rest assured, there''ll be a van full sent directly to the door every year, God willing!\n\nKindly provide info also on how many trees to plant on 3-4 acres of land, as I''ve guesstimated it to be in the proximity of 5-7 hundreds, can''t say, got no prior experience.\n\nInputs would be highly appreciated since plantation season is around in a couple of months and I may do a Punjab visit soon. My anticipation is rather low, but who knows, if there''s a citrus guru around among blasting gunners here, lol!\n\nBelow pics were taken few days back for beloved 12G bro, who wanted to have an idea of the site and the scenic whereabouts, adjacent to my ancestral village:\n\n[B]Western angle:[/B]\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/PG upload/Land1_zps3530af51.jpg[/IMG]\n\n[B]South:\n[/B]\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/PG upload/Land3_zps054a45ac.jpg[/IMG]\n[B]\nEast:[/B]\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/PG upload/Land5_zps531e44de.jpg[/IMG]\n\n[B]North:[/B][IMG]http://i1136.photobucket.com/albums/n497/wahstar1/PG upload/Land2_zpsd724796a.jpg[/IMG]\n\n[B]Another angle:\n[/B]\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/PG upload/Land7Medium_zpsf4c64ecb.jpg[/IMG]\n\nAnd the ready made "range", 765 feet end to end, just need to boundary/cushion it well:\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/PG upload/TheRange_zps4a7bd140.jpg[/IMG]\n\nI am planning to make it a PG rest house for trivial fun, outings, picnics, boar hunting, etc, God willing.\n\nAwaiting some[I] juicy[/I] inputs.\n\n\nRegards.', '', '31a10ddcb7b738aa184db41116cadbd3', 1356065788),
