(0x7642466f72756d5f506f7374, 0, 341452, 430, '[QUOTE=Asad Sagarwala;341392]Salam Everyone! \n\nI''m new to this forum and to the Arms. I need help in selecting my first handgun. I don''t prefer to go with the style or looks or sound. What I want is accuracy, low recoil and compactness for conceal carrying. \n\nI''m looking for a 9mm and my budget is between 50-70k tops!  \n\nI live in karachi. \n\nI personally like the Sig Sauer 229 (which is way out of my league) and CZ RAMI (Which I just saw at Tactical Arms Bhadurabad Karachi - asking price was 56k) \n\nMy License is on its way and will be arriving within this week. :) \n\n\n\nIf possible plz suggest something that is in two-tone if not its okay! :)\n\n\nThanks all[/QUOTE]\n\nA Rami. at 56k [I]asking price[/I] at TA!!! :o \n\nIs it just me or is there something seriously wrong here???\n\nConceal carry Asad bhai means different things to different people... Some people are comfortable with even full sized 1911s while others wont go beyond .25 or .32 pocket pistols. \n\nIMHO if she is your first gun and its for something as important as Self defense on a day to day basis then I suggest that realiability and ease of handling would be a more important criteria then esthetics. \n\nThe 809c Taurus would be in your budget and it fits the creteria of been a 2 tone weapon and is also quite compact and concealable. However few people have used it so there is little feedback. Then there is the Tarus model 709 which is also a very small gun. A 9mm weapon that can easily fit a pocket. However either it has a good trigger or a bad one. Some people are happy with it while others consider it junk. \n\nThese r the only 2 weapons  that I know that are both 2 tone and very  small and in 9mm calibre.\n\nAs regards dealers. Just go though our review section. Most ofthe dealers here in Karachi have been reviewed there :) \n\nIf u stil have any issues. Just ask any of the seniors to accompany u.', '', '52102a059c00a51caacfc949e8c2c84f', 1360594225),
