(0x7642466f72756d5f506f7374, 10594, 0, 608, '[QUOTE=sadatpk;330035]a very nice innovation on ur part sir 12 guage, br what is $? I saw a jacket of about same stuff and design at one shop in chen one Multan ,that s price was 7800rs, but this has addition of bag pockets which r extremely elegant looking here[/QUOTE]\r\n\r\nBro, I got this jacket for 3,500 Rupees.\r\n\r\n[QUOTE=shahroze;330499]good buy indeed ? can we order them do they send by courier[/QUOTE]\r\n\r\nBro, I am sure you can order these. why don''t you try contacting the manufacturer and see if any arrangement is possible. I don''t see why they cannot be sent via Courier.\r\n\r\n[URL="https://www.metasco.com/index.php/contact-us"]Metasco International[/URL]\r\n\r\nRegards.', '', '3a7db8e7206d307eda46093005dc39c3', 1356712532),
(0x7642466f72756d5f506f7374, 10244, 0, 3468, '[QUOTE=Abu Al Hawl;330400]Dear All,\n\nThe best mathod to clean a piston is to:\n\n1. swab visible residue from internals with luke warm distilled water.   !Not Miner Water!  \n2. Let the pistol be dipped over a night in Luke warm distilled water.\n3. after drying the pistol swab the whole with coconut oil.\n\nthis is the neat and best way to keep a pistol clean and long lasting.\n\nI''ve been doing this since years and never seen any corrosion on my weapons.\n\nThanks.[/QUOTE]\n\nwe are talking about lubrication of the weapon, whether to use grease or oil, not cleaning', '', '279f36ba70efd1650627e850d5a034d6', 1356743086),
(0x7642466f72756d5f506f7374, 10599, 0, 7858, '[QUOTE=Jibz;330347]I forgot to add that a buddy of mine visited DSA. They showed him a SxS which they normally deliver to the client after an order has been placed. The delivery time period is one month. This guy was given 3 boxes of Shaheen Cartridges and was asked to shoot them with a shotgun at their firing range within the vicinity of the factory. They took measurements of his arm, shoulder and also took pictures in different shooting positions. He is expecting to get his gun by the end of December. The price is only 35Ks. :) He asked them for carvings on the sides of the shotgun along with replaceable chokes and single trigger. All this for 35Ks with DSA standard is a pretty good deal. Thoughts?[/QUOTE]\n\n\n\n', '', '6526bb2be438cac2db7f102717dffa0d', 1356759023);
