(0x7642466f72756d5f506f7374, 11701, 0, 15964, 'Been through 600+ rounds to date. Have had 2 FTFeed (reason: racking the slide with my weaker hand - left). I have been certainly getting better to say the least. I was flinching a lot but with dry-fire practice that problem is diminishing fast. \nMy groups: 5 shots fired at bulls-eye, are all ending up in the Bulls-eye or in the nine circle. The groups are hardly 2-3 inches apart from 10 meters with a few fliers now and then.\nMy home preparation: Lots of dry-fire, I put an empty shell on the slide while I dry-fire, making sure that the shell doesn''t fall off.  Lifting an AK-74U single handed with both left and right for 30 mins every other day. \nAccessories used at range: 1. Ear-plugs (, which I think are a must for first time shooters. Had I known the sound would give me a flinch I would have never ever ever fired my first bullet without ear-protection (first time users, please use ear-plugs, it definitely helps immensely). \n', '', '4ae17227fdf2cd6db0da2455a9a16b48', 1375906368),
