(0x7642466f72756d5f506f7374, 11053, 0, 2223, '[QUOTE=g_ansta1134;384943]I have a question, how often you "lubricate" your PT 92 if you haven''t used(fired) it?[/QUOTE]\nDepends on if you carry it or not.. even if you don''t fire and carry it and you use gun oil for lubrication, you will have to lubricate it after two weeks because eventually with the passage of time and specially during carry your previous lubricated gun oil will evaporate.. if you use grease instead of oil, once a month will be fine because grease doesn''t evaporate that easily as oil.\nNow if you don''t carry your gun and its in a holster, still you have to lubricate it once a month and with grease after three months.\nIf the gun is lubricated and packed properly, no need of lubrication for four to six monthny seasons s either if its lubricated with oil or grease but you have to keep a regular check on it after every two to three weeks and specially during rai', '', 'eeb3f3d69bf0fd7f20df341fd38e502c', 1377042987),
