(0x7642466f72756d5f506f7374, 12505, 0, 7332, '> Caracal\n\n Caracal had a lot of money; enough to hire the best engineers available, buy all new machinery of good quality, and start with a new workforce trained to their standards.  I still haven''t seen a definitive report of what was causing their problem, but it doesn''t necessarily mean they were negligent in design or manufacture.  I felt they may have been a bit slow in acknowledging a problem... but they are selling worldwide, in countries with different laws on product liability and marketing of goods.\n\n Sometimes, even with the best of intentions, things happen that are hard to predict.  Fire up your browser and look for "Tacoma Narrows Bridge", "DeHavilland Comet", or "R-16 launch explosion."', '', 'cae5600454dbbc4fac6f491a21484073', 1388424897),
