(0x7642466f72756d5f506f7374, 0, 387835, 15152, '[QUOTE=Leon;387757]I have been following the thread for past 2 / 3 days. All we are doing is to blame ammo but nobody doubted quality of the gun. Had it been ammo issue, the chamber or barrel should have exploded. Whereas in this case lug has broken which takes the least pressure. The braking of lug clearly indicates the metallurgy issue.\n\nIMHO, we should take up the matter with CZ in the same manner as we did with Caracal. We should contact the owner through our Pakgun Member and invite him to the forum. Meanwhile, we should guide the owner to e-mail CZ and seek their reply on the issue. We can also take up the issue through forum and invite CZ to expalin the issue. After all we have good number of CZ User and Prospective buyers on the forum. Difference of Opinion is one thing but we must stand united and make CZ to expalian as we did in case of Caracal. I don''t believe that a company like CZ will disown its product and fault.[/QUOTE]\n\nSee posts 67-69, I don''t think any major corporation, especially one as established as CZ Uhersky Brod, will come chat on an internet forum to discuss a broken part.', '', 'fb8b3c8b06045a94acead500c815cf41', 1377684537),
