(0x7642466f72756d5f506f7374, 11959, 0, 5135, '[QUOTE=SIGlock;388387]Will check and let you know as early as possible... In the meanwhile, I would like to share my experience as it might be helpful for others... The first dealer who I had contacted, told me that he would have to get a new copy issued, report the original one lost/stolen which would cost around 15-16K, then getting the receipt would be another 5-6K and few more Ks for entering the gun on the licence and in the DC''s office... The total amount would''ve been around 24-25K...!!! Basically he wanted to have the whole chicken rather than a golden egg... So I contacted napalm dealer and he got it done in 9K... The breakdown goes like this: 1K for the bore change, 5K for the receipt which one needs to have in order to get it entered in the DC''s office and the rest 3K was to enter the gun on the licence and then in the DC''s office which couldn''t cost 3K but I ignored it as there was a big difference between 25K and 9K... ;-)[/QUOTE]\nSo,you have entered a rifle on your license which you dot own actually', '', '13a7532ae2b7ea1a8df822a12568d36d', 1377846929),
