(0x7642466f72756d5f506f7374, 11955, 0, 4360, '[QUOTE=Fudgepacker;400252]Actually when it comes to commercial devices, which a gun is, the highest standards of quality controls is in the aerospace industry... and airplanes, helicopters and space shuttles still break. Maybe I''m not understanding the market there, but like I said, guns break, they always have, they always will. What is significant is the manufacturer''s warranty service, and how many factory certified armorers are in your city. Furthermore, firearms are sold to civillians as a sporting device, if you choose to use it as a weapon, the responsibility and consequences are yours to bear... not the manufacture, the distributor, nor the local gun store. Besides, even "mil spec" weapons and all sorts of other "duty and patrol" equipment sold "for military and law enforcement use only" break all the time, it is disappointing, but its to be expected. Complaining about it will accomplish nothing, preparing for it may save your life.. Instead of wasting energy writing emails asking the company why this and what about that (they don''t care), if you are truly concerned about your wellbeing, do something for yourself...  practice failure drills, malfunction clearing, speed reloads, tactical reloads, drawing a backup from deep concealment, hand to hand combat...[/QUOTE]\n\n', '', 'f1886e420bbbd53c21e575b08ed4cf1a', 1388077745),
