(0x7642466f72756d5f506f7374, 0, 419866, 15152, 'Game bro, online investigation of profiles and memberships is fairly common procedure here now, not only by law enforcement, but even by potential employers. Though that''s not to say it happens in 100% of all cases. I can''t say for sure, but I doubt your firearms hobby would affect your application. I do know however that both sexes are subject to strip searches should airport security or customs officials deem necessary. They are always executed by officers of the same sex, but I do not know the circumstances under which, or if, one can be refused. Don''t worry about it though, should it be required, it''s not overly invasive nor painful.', '', 'c14d4f08f1002a2093582081955a6d21', 1389265824),
