(0x7642466f72756d5f506f7374, 12497, 0, 15152, '[COLOR=#222222][FONT=Times][QUOTE=K-203;419247]Dear Fudge bro can u pls shed some light on feeding these beauties with modern rounds since the bullets; one behind the other with one''s point on the primer fuse of the other ... even if one uses flat tips isn''t there still a chance of accidental discharge ...\nIts just a wild thought .... may be I m altogather wrong ...[/QUOTE]\n[SIZE=4][FONT=arial]Good observation, that is definitely a concern! That''s why the 30-30 is a flat point bullet, as are most lever gun bullets. In terms of projectile design, the one truly modern ammo development for tube magazine fed lever actions is the Hornady "Leverevolution". The bullets are actually pointed, but the tips are polymer. They definitely have a significant advantage in terms of energy, and the only consideration is that the cartridges can''t be kept loaded in the rifle for extended periods, otherwise the tips will become deformed. Alternatively, there are lever actions where the bullet shape isnt an issue, such as Browning''s BLR and Winchester 95, which use a box magazine.[/FONT][/SIZE]\n[/FONT][/COLOR]\n', '', 'e35c14e42953ab24182d71e640322b70', 1389125166),
