(0x7642436d735f41727469636c65, 0, 790, 20743, '[ATTACH=CONFIG]28770[/ATTACH][ATTACH=CONFIG]28773[/ATTACH][ATTACH=CONFIG]28771[/ATTACH][ATTACH=CONFIG]28772[/ATTACH]Hello all,\nI''ve been surfing through Pakguns and other airgun forums for the last few months, looking for info on PCP''s after my interest in airguns was rekindled after a long hiatus (decades), shooting powder burners in the meantime.\nMy search began looking for a Diana P1000 but Badruddin in Rawalpindi had sold the last piece when I went to him. I went looking for a Weihrauch HW100 ( which I''ve now found out through my research to be a better gun) but these too we''re sold out.\nFinally, I decided to import an airgun. Importing to Pakistan is a big headache but if one is successful the reward is great - you get to own a gun of your choice. \nI searched and went from BSA to Air Arms to Weihrauch to FX, when one day a new genre of airguns caught my fancy - bull pups !\nBull pups are small but as powerful and accurate as the conventional PCP''s with the same shot count per fill.\nI wanted to share my joy, with all the avid airgunners, of owning a bull pup PCP. Here are a few pics:', 'Airguns: Kalibrgun Cricket .22', 'f171af8e64c6dee0c42161c37dfb8d85', 1392751816),
