(0x7642466f72756d5f506f7374, 0, 390318, 15152, 'Allow me to offer my opinion for another point of view. The only Russian guns that are considered desirable here, are Ak''s. Baikals are available but not very popular. I''ve yet to come across somebody who owns one, so i dont have any experience with them. Compared to Norinco, Tauruses cost more and may look nicer, but that doesnt make them perform better. Ive never been a fan of the 92, and besides that, there''s really nothing Taurus makes that is worth having. I hope not to offend anyone, but their 24/7 is famous for being junk, and their revolvers are getting close to Smith & Wesson price, but far from Smith quality. To be fair, their guns are ok for a price point, but that price is half of what they''re being sold for. However even over here, the Cf 98 and NP 22 are renowned for their reliability and value. To get a better gun performancewise, you need to look at Glocks and Sigs, which cost a lot more in both our countries. So regardless of budget, it''s a matter of spending "X" amount and not getting your money''s worth. Or, spending "Y" and getting more than what you paid for. Again, that is my opinion which is a product of the market I am in, your experience may differ.', '', '4c0788d62ff61b7c94d9d01986fa0bb1', 1378462944),
