(0x7642436d735f41727469636c65, 0, 0, 4360, '[COLOR=#333333][FONT=Verdana]In 1970''s when Beretta 92 made its way to North America as a choice of their military side arm it at the same time gained popularity in the South...hence Brazilian Army also wanted Beretta 92 as their side arm but the prices were high due to the high labour costs in Italy and like America Brazil could not afford the guns...therefore, Beretta made contract agreements with the Brazilian Government to produce firearms for the Brazilian Military in Brazil using the Brazilian Labour as Labour costs were very less in Brazil and set up a Factory in Brazil which was called Beretta Sao Paulo manufacturing plant...after Beretta completed its contract and produced the desired amount of guns for the Brazilian Military, Taurus purchased the Beretta plant along with the tooling, technical drawings and all the work force used by Beretta...after this taurus continued producing the 92 under the name of PT92 without the need for licence from Beretta using same tools, technical drawings and the same labour!!![/FONT][/COLOR]\n\n[COLOR=#333333][FONT=Verdana]Hence Taurus is subsidiary of Beretta if you think on a broader spectrum and they never bought rights or licence from Beretta cause Taurus was Beretta Sao Paulo manufacturing plant...only the name changed!!![/FONT][/COLOR]\n\n[COLOR=#333333][FONT=Verdana]Same way a Stoeger Cougar is also a Beretta...Beretta manufactured Stoeger Cougar under the name of Cougar 8000 or Beretta 8000 later they set up a plant in Turkey under the name of Stoeger Industries which is a subsidiary of Beretta...hence, the stoeger you purchase should not be considered Turkish it is actually a BERETTA!!![/FONT][/COLOR]', '', '06134c426b908b80d25e48aca6edb64a', 1387649947),
