(0x7642466f72756d5f506f7374, 0, 416401, 14583, 'When I bought my first handgun, the guy behind the counter happenned to be an International competitive shooter. I asked him for a gun that was accurate, he looked at me, sizing me up, then asked how much experience do you have shooting handguns, I said little. He replied any gun here is more accurate than you are! \nBuy a reasonably priced one and shoot the hell out of it, look online for guidance, ask other shooters at the range etc, once you know that you are more accurate than your gun then buy something better. Most important to me in a gun is grip, feel and balance and ofcourse trigger weight. Heavy, creepy trigger is a big turn off.\nthe feel of both will be different, ', '', '32630a3b50835fe6fe73268da5ae9f11', 1387750927),
