(0x7642466f72756d5f506f7374, 0, 406575, 17721, '[QUOTE=Leon;406422]Bro,\n\nFor everything related to firearms, security or defence, you need relavant license. For gun shop, you need arms dealer license from provincial government. For security company, you need license from either federal or provincial government. For gun accessories other than gun parts, you don''t need any kind of license.[/QUOTE]\n\nAh, yes, I am aware of the licensing and the general procedure.  What my concern was hearing from many people that the industries are tightly controlled where its not encouraged to start such businesses unless you are connected otherwise these type of things may happen:\n\n- Your application is suddenly "lost" at the office\n- Your application is rejected for a ludicrous reason\n- Bribe may be asked\n- Your application is never processed, or it keeps being put at the bottom of the pile.\n\nIf this is not true, please clarify, as I have heard these stories many times but never found evidence of it.  Most of the people who say such stories are not ambitious people and seem like they are people of despair but they were more knowledgeable about current Pakistan affairs more more than I was.\n\nI h', '', 'b88f2355b502689ab87ceaf6412c8409', 1384268352),
