(0x7642466f72756d5f506f7374, 0, 411340, 8354, '3.08% increase in diameter is too large for handling & braking. Plus sizing to 15" rims from 185/70/14 should be 195/60/15 (-0.16% increase or 0.16% decrease and that''ll be fine). Floating feel drive is experienced\n\nIn addition, please do assure that the Offset of the 15" rims you are putting on is the same or very close to OEM specifications - over 5mm offset variance, be it +ve or -ve, is discouraged as this will put additional stress on suspension components causing early failures. Suspension gets the most hammering in every car so best to stick with OEM spec offset for any aftermarket wheels. Lots of chinese rims being sold in PK, and resellers are oblivious of Offset and majority buyers fall in the same bracket too - as long as wheels fit (i.e. PCD matches), the purchase is made. I''d recommend Forged Aluminium wheels as those would be lighter and stronger than stock wheels, a true upgrade. Koreans make very good wheels and are way ahead of chinese aftermarket wheels manufacturers. \n\nHTH', '', '660f445d7172d8068f38394aeabba95f', 1386023412),
