(0x7642466f72756d5f506f7374, 11146, 0, 16386, '[QUOTE=hdaackda;352253]Another way to make a pellet catcher. I have used it successfully and was able to re-use more than 50% of my pellets.\n\nAnd its almost free!! :)\n\n1.) Take an old shoe box\n\n2.) Fill it with newspapers. As many as you can. There will be a natural gap between papers which will help keep pellet safe :)\n\n3.) Close the box once full. Paste a target on one side. (New tagets can be pasted + newspapers recycled).\n\n4.) Happy shooting\n\nAfter shooting, open the box and voila!! Most of your pellets will be safe for re-shooting! \n\nWe used this for shooting competitions with airguns. Cheap and effective![/QUOTE]\n\n', 'Home made target case', 'dfc67881358df043bffd737a15b0732b', 1380907032),
