(0x7642466f72756d5f506f7374, 7604, 0, 16854, 'Very impressed with your result.[QUOTE=Abbas;226641]Salams, \n\nI''ve been messing around with my .22 LR BRNO these past two months. Shooting it and rifle shooting in general seems like a piece of cake after handgun shooting at 25 meters. The first target I shot two months back was around 90% and I was quite happy with it. The accuracy of the gun was surprising and I wanted to see if I could shoot a perfect score. Although I got close quite a few times (shot atleast 10 targets of 495+) but 50 X''s out of 50 bullets was a hard task. Finally got it today. Pictures below:\n\nThe target was shot sitting down with a wobbly rest for support, in approximately 15 minutes.\n\n[ATTACH=CONFIG]5838[/ATTACH]\n[ATTACH=CONFIG]5842[/ATTACH]\n[ATTACH=CONFIG]5839[/ATTACH]\n[ATTACH=CONFIG]5840[/ATTACH]\n[ATTACH=CONFIG]5841[/ATTACH]\n\nThe Rangemaster and other senior shooters were present and watching the target being shot. The target was signed and acknowledged.[/QUOTE]\n\n', '', '16b23b748d02bbad428d4e9d508a9750', 1384289621),
