.postimage.org/8m0jA.jpg[/IMG][/URL]\n\n[URL="http://postimage.org/image/gyyv5ick/"][IMG]http://s4.postimage.org/8mzeA.jpg[/IMG][/URL]\n\n\n[B]CZ 97B .45ACP.[/B]\n\n\n[URL="http://postimage.org/image/gz8sdlb8/"][IMG]http://s4.postimage.org/8mOcr.jpg[/IMG][/URL]\n\n[URL="http://postimage.org/image/gzc3gaas/"][IMG]http://s4.postimage.org/8mTbJ.jpg[/IMG][/URL]\n\n[URL="http://postimage.org/image/gzno7pr8/"][IMG]http://s4.postimage.org/8n9EJ.jpg[/IMG][/URL]\n\n[URL="http://postimage.org/image/gzsmtr8k/"][IMG]http://s4.postimage.org/8nh89.jpg[/IMG][/URL]\n\n\n[B]Chinese TT 30 bore.[/B]\n\n\n[URL="http://postimage.org/image/h00wihpg/"][IMG]http://s4.postimage.org/8ntBS.jpg[/IMG][/URL]\n\n[URL="http://postimage.org/image/h05v4j6s/"][IMG]http://s4.postimage.org/8nB5i.jpg[/IMG][/URL]\n\nThe below handguns which I had, has been swaped.\n\n[B]Stoegar Cougar 9mm.[/B]\n\n\n[URL="http://postimage.org/image/h0ch9x5w/"][IMG]http://s4.postimage.org/8nL3S.jpg[/IMG][/URL]\n\n[URL="http://postimage.org/image/h0hfvyn8/"][IMG]http://s4.postimage.org/8nSyi.jpg[/IMG][/URL]\n\n\n[B]Smith & Wesson Clone, 9mm.[/B]\n\n\n[URL="http://postimage.org/image/h0rd41lw/"][IMG]http://s4.postimage.org/8o6w9.jpg[/IMG][/URL]\n\n[URL="http://postimage.org/image/h0wbq338/"][IMG]http://s4.postimage.org/8od_A.jpg[/IMG][/URL]\n\n\nThe last two handguns has been swaped not because I didn''t like them, but because I didn''t have spare MOI and I need the [B]CZ 75b [/B]and [B]CZ 97B [/B]very badly....  :)\n\n\n\n\n\n\nThese are the addition.\n\nCZ 75 Sp01 Shadow.\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/301120103251.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/301120103253.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/301120103280.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/301120103269.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/301120103262.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/301120103259.jpg[/IMG]\n\n\n\n\nTaurus Tracker .357 Magnum.\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/070320113391.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/070320113394.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/070320113400.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/070320113390.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/070320113408.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/070320113377.jpg[/IMG]\n\n\n\n[IMG]http://i1235.photobucket.com/albums/ff423/asghar7/070320113402.jpg[/IMG]\n\nWith the help of our esteem & beloved member "Naveed" bro, I manage to grab the last peice of this Sig+CZ hybrid.. without Naveed bro it would have been impossible because I searched the whole Peshawar market but couldn''t find one.. heard from someone its available in Lahore, so without wasting anytime I rang Naveed bro to find me one, because when it comes to Lahore nobody is as efficient as our dear Naveed bro & the very next day he told me that he searched the whole Nila Gumbat and only one (NIB) piece is left with Hira Arms.. I told him to grab it and the very next morning I was on my way to Lahore.. would love to stay there for some more time but couldn''t manage because of schedule, so just went to Nila Gumbat, enter it on my License and returned the same day.. don''t forget that I was driving alone although had a company of my better half but she was afraid of driving on motorway which is far more easier than driving in busy Cities.. "O these Women"..\n\nKasam se badan chakna choor ho gaya tha jub me ghar pohancha.\n\nNow something about the gun.\n\nIts Sarsilmaz K2 .45ACP having magazine capacity of 14+1.\nErgonomics are excellent so is its trigger.. its trigger is like you have already put some 1000 to 1500 rounds through your CZ to smoothen it up.. has a nice beavertail.. grips are comparatively slimmer than my imagination to house a 14 rounds of .45acp.\nOverall the gun looks solid and the internals looks well built.\n\nFew eye candies.', 'My Handgun Collection.(updated on page 1)', '2f2904ef6bb4b733922aa9d0a046e311', 1383986796),
(0x7642466f72756d5f506f7374, 12232, 0, 15033, '[QUOTE=mehranbiz;401090]Every one is sure about Metal frame, I see my self 60 70 years old gun and still they are the best\nNo body have evidence about the life expectancy of polymer frames  \n\ntime will tell the effects of hot cold dry and wet weathers on polymer frames[/QUOTE]\n\nAOA\nPolymer wonders are here to stay and I assure you they will last longer than steel(regarding hot and cold weather) polymers has an added advantage of being cheap to manufacture\nAnd other very plus', '', 'd9b0fa0a746c23f4ca732160675b7e03', 1382536075),
