(0x7642466f72756d5f506f7374, 0, 410688, 7198, '[QUOTE=Enigmatic Desires;410104]In Karachi a local darra made .303 goes for around 15k to 45k to 55k or so. And Ammo is not available at all. I f found I am sure it will be in the range of 300 a pop minimum.\n\nA POF one should be much higher\n\nHence the exclamation marks![/QUOTE]\n\nHuge amount for local guns that 2 very old. Ammo is also available in dara, 70-80 a pop all 303,7mm,8mm and 308(G3 I guess)\nBest way is to hunt for these guns in village as currently I am doing. 2,3k for revolvers and 5k max for bolt action.\nI am in swabi just came from friend arms shop, they are selling cougar(very nice,neat) copy for 25k and when I ask about my hobby, they say', '', '9bd429d1b7fd4232f212fc0e2683903a', 1385807499),
