(0x7642466f72756d5f506f7374, 12275, 0, 17432, '[QUOTE=hdaackda;402909]This happened yesterday. I was going to Malit Cantt to meet a serving officer. On the way, got stopped at a temporary rangers check post.\n\nNaturally I complied. Didnt want to become another sarfaraz or tht poor taxi wala.. told thm I hav a licensed weapon.. gave license n weapon\nAlso told em its loaded! Now comes the funny n stupid part.. rangers guy handed it over to a senior.. a three star something. . He couldn''t unload my weapon. Lols. Kept exerting force. . I told him Sir, pls unlock it first.. \n\nAftr that he asks me, what type of a bullet is this?? Told em its a Hollow point (he should have known this!)\n\nThen he takes it to another senior. That senior looked very arrogant and was in civilian clothes (with extra civilian guards)\nHe checks my license thoroughly,  asking me for NIC as well.. than gave It to three star guy saying weapon was loaded. Keep it. We will return it to him after verification! \n\nI''m like, Sir its a computerised license!  He''s like It was loaded..\n\nKhair other guy says dont worry, we will just verify it. You can come and take it back from us NEXT WEEK. I''m like WTH!! I can''t come this far again.. give me a receipt etc.. Khair I  went to big senior again\n\nBig senior tells me we r keeping the weapon, we can also keep you!! The @^$*@*$*$. Really pissed me off. Threating honest law abiding citizens!  No wonder everyone hates rhem!\n\nI then say its a computerised license.  I am a teacher. He asks me do I have a 144 permit. I say Yes! Its in the licence!  Look.. (its the one without any date!)\n\nHe looks at it and exclaims,  why do you have a permit of 200 bullets. What will you do with 200 bullets?  I''m like Target practice.  I go to different ranges.  I have also gone to the Rangers range and took part in competition.  Besides now ALL licenses have 200 limit minimum. Was he stupid or just acting like one? should have known this too!!\n\nHe is like but Halat are kharabb why are you carrying with bullet chambered! I am like exactly for this reason!! Idiot (didnt say idiot out loud. Lols) Bad Guy will give me time to load my weapon??? Finally he''s like ok, u look like a person who knows his weapon.. you can take the weapon and go!!!\n\nAnd I thought. . Bad guys also know how to handle their weapons.. thats a lame reason! \n\nAnyways Thank god they didn''t keep my weapon!  \n\n:)[/QUOTE]\n\n\nif ever some police rangers etc stops you and asks that much questions and creating that much problem, simpl\n', '', 'c38f2b808cbe4fece234c0346f42e84d', 1382887087),
