(0x7642466f72756d5f506f7374, 12275, 0, 8112, '[QUOTE=Verve;407489]Was about to post my experience today in Texla area. Mrs and I were going to the farmhouse and got pulled over by the police. Open the boot, nothing in there and then the policeman asks if there is a weapon in the car and I said ''ji, licence bhi sath hai'' and then he asks to get it out. For some odd reason, I decided not to have it on me in belt holster as usual when leaving home and it was in its original box.\n\nGood to hear that \n\nI pull the box out from front seat and hand it over along with the licence. The officer removes the mag and starts cocking the hammer back again and again immediately.  Had to say in rush ''sir, chamber main goli hai aur safety bhi lagi hai, issay khali kar lain pehlay''. \n\nThen he puts the gun in open box and takes it to the senior officer (gun still chambered and safety on), the senior asks junior where the gun was and he said in the front of the car and in box. Then senior tells me that Section 144 is in place, checks the licence number against the one on gun and says ''theek, aap jayain'' handing the everything back. so I ask when did the 144 get imposed as it is imposed in Karachi that I know of, so I will get permit immediate and he said ''kall se kuyunkay Rawalpindi main katal hoi hain''.\n\nThey were all polite and no talk of confiscating the weapon or verifying the licence etc. We shook hands, I got in the car and off we went.[/QUOTE]\n\n', '', '59cb24688802b24cfa44bf7d765da9a7', 1384976151),
