(0x7642466f72756d5f506f7374, 7272, 0, 15220, '[QUOTE=fahad_dawra;413612]So here is my comprehensive question,\nMy whole reason for getting a Mak is CCW so here is how it goes (I would have not gone for this calibre if I had a better option, I love my CF-98 which I am currently using for CCW)\nShould I go for the one with 8shots mag , because\nIt has slimmer waist line\nIt weighs a little less\nMags for 8 shots are available,\nBut then\nMag release is near the mag\n4 less rounds\nand a little less market value\nVice Versa for 12 Shots\n(I would have not gone for Mak if I had a better ccw option.)\nKeeping this in mind advise me which one should I go for ?[/QUOTE]\n\nI have both CF98 and Baikal 442 PMM 12 shots and in my sincere opinion if you are good with CF98 do not purchase another weapon just for CCW for certain reasons\n\nFirst of all 9mm Makarov is different from 9mm regular ammo, although it is freely available but it lacks power. 9mm is the minimum caliber to which I would go ( just my personal preference/opinion may be incorrect )\n\nSecond you are compromising on number of bullets / mag. 15 rounds vs 8 shots\n', '', '00c6ec1c053b3f6b9772c4f356f52a6a', 1387024701),
