(0x7642466f72756d5f506f7374, 12479, 0, 116, '[QUOTE=Nazim Sahib;413350]Thank you for the input,I agree with you that for a self defence situation one magazine may suffice,but there are other factors we need to take into consideration.\n\n1:Magazines should be cleaned every once a while,and the process of cleaning a magazine can easily bend or damage a magazine.Bent magazines should be immediately discarded and replaced.\n2:By not reloading a magazine properly the lips may be bent or damaged,another factor we need to keep in mind.\n3:Magazines can be lost as well.\n4:I enjoy boar hunts in which i always carry a handgun.During a wild boar hunt incase things get to crazy a magazine can very easily be dropped or lost or damaged during a reload in the dark.\n\nI realize none of these reasons are major ones but they are still valid and possible.In other words it would be good to know that a major part of a gun,a magazine,will be within easy reach in the market.\n\nThank you for your time.[/QUOTE]\n\nAnd if there was "one gun n one mag" a univeraly \n', '', 'c7a98225b891fbd07252068f091031b4', 1386761076),
