(0x7642466f72756d5f506f7374, 12653, 0, 15152, '[QUOTE=GUNFREAK;421623]I believe it is same price range as glocks abroad. And same range here now that glock prices have come down. So I believe glock would be a better option. I have held and fired a couple of XD''s. To be honest,  It didn''t impress me much. Yes, even M&P would be a better option IMO.\n\nRegards[/QUOTE]\nNow I have to defend my favorite gun. XD(m)''s beat out Glocks in most areas if you ask me. Their grips are slimmer and have a more natural 1911 grip angle, in fact their grip profile is so ideal they don''t even have to follow the trend of having multiple backstraps. Their controls are metal, from mag button, to trigger, to trigger blade. Their sights are metal. They have a grip safety (which is also metal), and by necessitating force to be applied in opposite directions before it discharges, makes the gun infinitely safer without having to consciously manipulate an extra button. ', '', '77efc61b4baa569cd3c22a41c60158df', 1390221367),
