(0x7642466f72756d5f506f7374, 12618, 0, 162, '[QUOTE=Mr. Solangi;419955]Well, KK bullet is pointed one, that is the reason all pointed bullet make a hole and cross through.[B] But a bullet which is not pointed and in ice cold weather could have done the same what is reflected by pictures.[/B][/QUOTE]\n\nWell, you missed my point wrt to the double impact, first on the body, second on the glass. IMHO, a 7.5 grams bullet, or even a 15 grams 230gr .45 ACP round would probably be able to do a heavy 1.st impact (on the body) due to the momentum gained during drop, but would then lose a considerable proportion of momentum to break the glass (second impact).\n\n', '', '4c44b5c617a1d6d78574726c8f62ab5c', 1389451497),
