(0x7642466f72756d5f506f7374, 0, 433349, 998, 'For quite some time, besides his trusted CZ 75 P-01, Dr. Gilani had been on a lookout for another sidearm, with primary purpose of being kept at home for HD. In his quest, I am sure he discussed several options with other members of the forum including myself and thus one fine morning we set off on a mission to look for handguns, particularly an SP-01. I wouldn&#8217;t bore you with the details of what happened during this venture, however on our way back he mentioned that he had had some discussions with Mr. Noor-ud-Din of DSA regarding carrying out some test on their new handgun, 9x19 Trushot. I pointed out to Dr. sb that we should check out this handgun and in my books, if it clears 300 rounds test, it&#8217;s good to go as a budget handgun for HD. The ammo suggested by me was Chinese (Red Box) for the reason that its inexpensive; trustworthy dealers have more probability of having the original Chinese and not the local reloads; they generate more residue and would be an excellent litmus test for any resultant FTF/FTE. The decision was made that Gilani sb would request the concerned at DSA to provide one of their handguns for our test and if cleared, Dr sb would go for it. Now I need to point it out here that we were not exactly planning to do a review of Trushot as such rather the intention was (and for me it still is) that we should check if Trushot can land as a budget gun for Dr Gilani with primary purpose of HD.\n \n[B][U]PG Member&#8217;s in Action:[/U][/B]\nThe day was not far, when Dr Gilani called me and stated that 300+ rounds have been procured and now the ball was in my court to reserve the range. I was utterly unsuccessful in this ONLY task assigned to me and could not do the same. Then came to our rescue Mr. Noor-ud-Din of DSA after Gilani sb presented him the possibility of carrying out this test at DSA&#8217;s facility and hurrah we were back in the game. \nColt1911, Ameer, Ka_Khan and Aquarius sir were informed at the eleventh hour, yes it was literally 11:00 pm, and to our dismay only brother Colt1911 could make it and the rest had to excuse themselves due to their other commitments; well next time, InshAllah. Interestingly, Nazim Sahib and Fraz had already scheduled their plan to come to Peshawar on the very day when we were testing Trushot. I informed them to come to DSA facility for testing the Trushot as it will be an excellent opportunity for them to Ganga-ay-ho-to-nahaty-hi-chalo. lol\n\nSome pictures at the range:\n[URL="http://s1341.photobucket.com/user/Jibz77/media/IMG-20140406-WA0003_zps0b0d2ba5.jpg.html"][IMG]http://i1341.photobucket.com/albums/o744/Jibz77/IMG-20140406-WA0003_zps0b0d2ba5.jpg[/IMG][/URL]\n \n[URL="http://s1341.photobucket.com/user/Jibz77/media/IMG-20140406-WA0004_zpsfb2c8ff5.jpg.html"][IMG]http://i1341.photobucket.com/albums/o744/Jibz77/IMG-20140406-WA0004_zpsfb2c8ff5.jpg[/IMG][/URL]\n\n[URL="http://s1341.photobucket.com/user/Jibz77/media/DSC_0700_zps0ee60ca6.jpg.html"][IMG]http://i1341.photobucket.com/albums/o744/Jibz77/DSC_0700_zps0ee60ca6.jpg[/IMG][/URL]\n\n[URL="http://s1341.photobucket.com/user/Jibz77/media/IMG_0427_zps1a505af7.jpg.html"][IMG]http://i1341.photobucket.com/albums/o744/Jibz77/IMG_0427_zps1a505af7.jpg[/IMG][/URL]\n\n[URL="http://s1341.photobucket.com/user/Jibz77/media/IMG_0426_zpsedc678da.jpg.html"][IMG]http://i1341.photobucket.com/albums/o744/Jibz77/IMG_0426_zpsedc678da.jpg[/IMG][/URL]\n\n\n[B][U]Basic FTE and FTF Test:[/U][/B]\nAt 10:15am we were at DSA and almost a dozen of their support staff was already present at their testing range to extend all possible support to us, for which we are thoroughly grateful to them. Nazim Sb and Fraz joined us somewhere around 10:30am. \nI was the first one to go and in a jiffy 3 mags of 15 rounds each had been fired without a single hiccup; No FTF/FTE. We checked the temperature of the barrel with the laser fitted temperature gauge and it was 83F/ 28C. Within next minute or so I had fired another 3 mags making a total of 90 rounds and checked the temperature yet again using the same device; it was still at 83F/ 28C. \nAfter the first 90 rounds we had a small tea break and soon after that it was Dr sb&#8217;s turn to had his way with the Trushot (I hope this didn&#8217;t come out the way I didn&#8217;t intend it to.. hahhaha). Dr Gilani also shot 3 mags 15 rounds each. Temperature of the barrel was checked and it had soared up to 93F/ 33C. I need to mention it for the record that while firing the 3rd clip, the handgun didn&#8217;t fire its last (15[SUP]th[/SUP]) round. I guess that was because the magazine was not properly tapped while insertion and thus the round didn&#8217;t chamber. The clip was not properly seated in its place and the round didn&#8217;t feed in the chamber with the forward movement of the slide. After a solid tap on the magazine, the slide was racked by Dr sb and the game was on. The temperature of the barrel was checked and was found to be 105F/ 40C. The next two magazines went flawless and interestingly in the 6[SUP]th[/SUP] clip, the 13[SUP]th[/SUP] round didn&#8217;t feed for the same reasons mentioned above. (For every magazine fed firearm, it is a must that the clip is properly seated in its place and thus requires a firm tap for insertion). Each time Dr Gilani gave the magazine a firm tap, the round chambered without any issue. At this stage we had fired 180 rounds. Despite the fact that some of our readers must be thinking that the above mentioned case was of FT-Feed; we are of the opinion that it was a simple case of improper magazine insertion which happens to most of the firearms if the clip is not firmly tapped. Here, we want to emphasize on the fact that the issues faced with the chambering were isolated events faced by only one shooter at the range, and as the rest of the gang didn&#8217;t come across this problem, the issue has nothing to do with the handgun itself.\nFraz, Colt1911 and Nazim Sb were next in line and each one of them fired a total of 2 magazines of 15 rounds each. They all went flawless without any FTF and FTE. We had fired a total of 270 rounds in almost 1.5 hour or so (including tea break and our usual chit chat during several breaks). We were constantly checking the temperatures of the barrel and it was noticed that when we were nearing our 300 rounds mark, it had went up to 121F/49C with 131F/ 55C as its last noted temperature. Dr. Gilani sir fired another 2 mags, reaching the 300 round&#8217;s mark and the gun was still going good. \n\nThe 300 rounds videos are as under:\n\n[B]Fraz: Firing two magazines of 15 rounds each\n[/B]\n\n[B]Nazim Sahib: Firing two magazines of 15 rounds each\n[/B][video]http://s1341.photobucket.com/user/Jibz77/media/Trushot 9x19/NazimSb-Trushot-300RoundShots-2Mags_zps186bf653.mp4.html[/video]\n\n[B]Dr Gilani: Firing two magazines of 15 rounds each[/B]\n [video]http://s1341.photobucket.com/user/Jibz77/media/Trushot 9x19/DrGilani-Trushot-300RoundShots-2Mags_zpsc64efeb5.mp4.html[/video]\n\n[B][U]Accuracy Test:[/U][/B]\nIt was decided by the gang that we will test the accuracy of Trushot from 15 meters and then 25 meters but due to shortage of time, we could only test it at 15 meters. Anyways, the primary purpose of the handgun was intended as HD by Dr sb so 15 Meters was a sufficient enough distance for our test. Now, if you ask us for our honest opinion, it produced somewhat satisfactory results, considering all factors. i.e. The target was an A4 size page, we were shooting the handgun for the first time; using Chinese ammo which are not consistent wrt propellant gramage for accuracy testing; the front and rear sights were not fixed and were made of polymer type material and had probably not been zeroed by DSA the way other international manufacturers do; I guess the grouping was pretty good. \n\nThe following video links would give you gentlemen some idea:\n[B]Colt1911: Testing the accuracy of Trushot\n[/B][video]http://s1341.photobucket.com/user/Jibz77/media/Trushot 9x19/Colt1911-Trushot-AccuracyTest_zps95b0b2c7.mp4.html[/video][B]\n\nFraz: Testing the accuracy of Trushot\n[/B][video]http://s1341.photobucket.com/user/Jibz77/media/Trushot 9x19/Fraz-Trushot-AccuracyTest_zps046fb279.mp4.html[/video]\n\n[B]Dr Gilani: Testing the accuracy of Trushot\n[/B][video]http://s1341.photobucket.com/user/Jibz77/media/Trushot 9x19/DrGilani-Trushot-AccuracyTest_zps525c3d56.mp4.html[/video]\n\n[B]Nazim Sb: Testing the accuracy of Trushot\n[/B][video]http://s1341.photobucket.com/user/Jibz77/media/Trushot 9x19/NazimSb-Trushot-AccuracyTest_zps2566b9a5.mp4.html[/video]\n\n[B]Jibz: Testing the accuracy of Trushot\n[/B][video]http://s1341.photobucket.com/user/Jibz77/media/Trushot 9x19/Jibz-Trushot-AccuracyTest_zps26c60fb7.mp4.html[/video]\n \nYou can see that most of the groups generally landed on the 7oclock position. This may mean that a general shooter has a higher probability of landing his shots on a 7oclock position with the current sights of the Trushot.\n \n[B][U]Water Dunking Test[/U][/B]\nDespite lack of our comprehension, why a water dunking test is required for a handgun which Dr sb is considering for HD, Nazim sb was adamant that it is imperative that this test should be carried out. Falling prey to the fear of Nazim Sb&#8217;s gangster looks, each one of us humbly submitted ourselves to the test!!! Oops sorry, it was the handgun actually which underwent the test. \n\nThe result is well described in the following video. \n[video]http://s1341.photobucket.com/user/Jibz77/media/Trushot 9x19/WaterDunkingTest_zps33cc5782.mp4.html[/video]\n\n[B]Part-I:[/B] A 15 round magazine was loaded and with a chambered muzzle, Nazim sb went ahead and dipped the handgun in a water drum for a reasonable duration. He then straight away fired 15 rounds without any issue of FTE or FTF.\n[B]Part-II:[/B] Nazim sb loaded another magazine; chambered a round and re-did the dunking process. Now he had fired only 7 rounds when the pistol stopped making any more bangy sounds. lol\n[B]\nComments on Water Dunking Test[/B]\nYes. The firing pin broke from it&#8217;s rear-end where the hammer strikes. Now here started another debate among ourselves in which we were trying to comprehend the reasons behind breakage of the firing pin. Some of the members were of the opinion that it was the result of rapid temperature changes which resulted in accelerating the stress reversals; and after firing 15 rounds of the first clip for Water Dunking Test, the firing pin broke on the 7[SUP]th[/SUP] round of the second clip. Now my thoughts on the subject are that there is a very insignificant temperature change in the firing pin even if one fires 100 rounds constantly. With [B]insignificant[/B], I mean the type of change which would not subject itself to becoming brittle with temperature change. For becoming brittle, the difference in temperatures (highest and lowest) needs to be quite high. For example, a sudden decline in temperature from 80C to 20C would most probably result in any metal becoming brittle and consequently breaking after being hit with a hammer. However the significantly high temperatures of a hot barrel or slide cannot transmit to the firing pin at the same levels and thus the rise or drop in temperature of a firing pin does not make sense. \nReference to my discussions with Dr. Gilani, he was in agreement with my point of view to the extent that firing pin had exhausted/fatigued due to 400+ rounds but he was also of the opinion that dipping in water and overall changes in whole pistol temperature which was carrying/holding/encasing the firing pin went under accelerated wearing/fatigue/stress. He thinks that if the pistol was not dipped in water then the firing pin would have not at least failed during the 15+7 rounds of the Water Dunking Test and would have fired even more than 550+ rounds. We would highly appreciate the feedback and comments from other members of the forum. If I have to state a reason for the breakage of the firing pin, it is because it was time for it to break. Yes you heard me right; I think the life of the firing pin was 400 rounds and it did so when it reached its threshold. The Water Dunking Test has nothing to do with firing pin breaking. \n \n[B][U]What Worked Well:[/U][/B]\n1.    The gun has controlled recoil and can be easily governed by anyone who has occasional pistol shooting experience. \n2.    No FTF/FTE during the 300+ rounds which we fired. (To be exact we shot 357 rounds with it and we were told that DSA had already tested the same handgun with 48 rounds, making a grand total of 405 rounds).\n3.    It has a comfortable grip which suited all of the shooters present at the range. \n \n \n[B][U]What Didn&#8217;t Work Well:[/U][/B]\n1.    Trushot has a very long trigger rest and if a shooter is trying triple tap or more, it takes like ages for the trigger to reset. (We are sure this issue can be easily addressed by DSA).\n2.    As I was the first one in the gang to give it a go, I felt a very minute creep in the trigger during the second stage but after firing 300+ rounds, it completely vanished and at least I didn&#8217;t feel it at all during the accuracy test. \n3.    The front and rear sights need to be made out of metal as the ones on Trushot is polymer. \n4.    There is almost no space on the sides of the front sight tip once it is aligned with the rear sights. For shooters like me, who utilize this space to align the intended target, it is a big downer. \n5.    [I]In case if the shooter is Dr Gilani sir,[/I] it is a [U]must[/U] that the clip is firmly tapped for its proper seating. DSA is seriously considering entering these instructions in their user Manual of Trushot with special reference to Dr sb; joking. lol \n6.    There was also a particular incident where the slide went forward and chambered a round when Nazim Sb firmly tapped the magazine in its place. Here it important to specify that this didn&#8217;t happen every time, however, to explain the problem to the technical staff of DSA, Nazim sb tapped the clip several times and 4 or 5 times the slide didn&#8217;t go forward without even pressing the slide release. It is something which is not safe and shouldn&#8217;t be happening. DSA needs to look in to this shortcoming which could be due to a week spring of the slide catcher.', '', '4d2e3deb667cce88d597f7173a14e883', 1397481639),
