(0x7642466f72756d5f506f7374, 0, 428048, 17432, '[QUOTE=Fudgepacker;428047]High tech steel is something else that intrigues me with knives, unfortunately the use of exotic materials (such as Timascus, G10, micarta, C-tek, lightning strike carbon fiber, and S30V, along with natural materials ranging from sting ray skin to Washi paper) on guns is either not as prevalent or non existant. For those who havent been bitten by the blade bug yet, and if you appreciate art, or just like cool stuff, take a closer look at some high end and custom knives on YouTube, you will find they can be much more than just a sharp piece of metal!\n \nAnyways AKA777, 154cm is special for its high carbon content and mix of Molybdenum. That gives it very good edge retention and a potential Rockwell hardness rating of 60-61, but sacrifices some corrosion resistance due to the carbon. It is also relatively tough when tempered properly. Remember, when talking about blades, toughness (breaking strength) and hardness (edge retention).\n Sorry if that was more than you wanted to know, it''s just that super steels + blades = pure awesomeness to me :D[/QUOTE]\n\nwhat about flexibility and shock absorption ? and wieght reduction\n', '', '94a52a11808caa1c60cdc003dcee7274', 1393461904),
