(0x7642466f72756d5f506f7374, 2454, 0, 20743, '[QUOTE=Verve;436771]Brother it is, I agree .. and majority of us pay bribes to get our weapon licences. Paying above anything other than official licences charges is a bribe.\n\nLegal, not halal, way is to declare the real price of air rifle to Pakistani customs, for example FX Bobcat is $1800. And then pay 30% or thereabouts customs and GST on top. Customs and gst are all prohibited in Islam anyways.\n\nBtw, income tax is not Halal either for an islamic country''s government to impose on the muslims population :)[/QUOTE]\n\nAirgun import is allowed but the duty is 30% plus 20% of some other tax and when all put together, another 17% GST. Then 4% of something else plus 1% iqra. Anyway, all in all it adds up to close to the value of the airgun including shipping!\n\nUnfortunately, customs rules are made in a way which encourages corruption. Everyone knows this but rules are not modified. Why? Because if people start paying duties, the money goes to the treasury and stake holders lose.\n\nAn old retired judge once told me that when he started service, a senior of his advised him that if he wanted to make money he should create difficulties for people. As an example, it is quite difficu for a decent, honest man to get an arms license but ask a dishonest thug and he''ll get it in a wink.\n\n\n', '', 'd5f34a58dcf25fa565ba68b1a33c8d17', 1398791440),
