(0x7642466f72756d5f506f7374, 9142, 0, 4053, 'You guys (Ahnab, ED and there was another dude i can''t remember)tempted me to buy this gun. You guys always said how its better then Caracal F. I needed Caracal F''s replacement so i bought it. Lets see how it goes. \n[URL=http://s1113.photobucket.com/user/bilal_qureshi1/media/20140503_195641_zpsb43f2b2f.jpg.html][IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/20140503_195641_zpsb43f2b2f.jpg[/IMG][/URL]\n[URL=http://s1113.photobucket.com/user/bilal_qureshi1/media/20140503_195625_zpsa6998375.jpg.html][IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/20140503_195625_zpsa6998375.jpg[/IMG][/URL]\n[URL=http://s1113.photobucket.com/user/bilal_qureshi1/media/20140503_195742_zps5843a5e7.jpg.html][IMG]http://i1113.photobucket.com/albums/k512/bilal_qureshi1/20140503_195742_zps5843a5e7.jpg[/IMG][/URL]\n\nInitial impression of this gun are its average made, like most Turkish guns are. Nothing special. Good sights though. Good accessories, and good fire power(18+1). The gun is heavy for the Polymer gun and felt heavier then Caracal F. Trigger pull of this gun is insanely heavy. Both in DA and SA. I mean i can''t pull the trigger 3 times in a row in DA mode. Same was the case in so called Lighter SA, When i fired the gun, i couldn''t fire more then 10 shot in a go. ', '', '875e65c4e3a526740ab81a1f6cdd6b0c', 1399210431),
