(0x7642466f72756d5f506f7374, 12799, 0, 116, '[QUOTE=alirablm;427492]AoA,\n\nDear friends I have searched many forums and googled a lot of sites, but could not fully comprehend the answer.\n\nI want to make my pistol from black to silver (stainless steel).\n\nCurrently I have SP-01 shadow - It is in factory black (original) - I want to make the black into silver (like Taurus PT 92/99 AFS).\n\nI only want this as a cosmetic change - on the frame, slide etc.\n\nPlease let me know if it is possible - how much would it cost in Pakistan - or can I just spray silver paint on it.\n\nAny suggestions are welcomed.\n\nRegards,\n\nAliRabLM[/QUOTE]\n\nAli bro; Refinishing a firearm doesnot mean painting it with another shade of your choice; you have to strip current/old finish off completely. Surface have to be made ready to take new finish & this surface preparation is done in different ways for different type of finishes.\n\nSimplest route is to dis assemble slide \nOnce you are done with getting rid of black and a shinny surface of metal is all what you see........ you have what you wanted your pistol to look like ;) \n', '', '7f5a57ffa41015abd2ab1bcaaf846675', 1393267158),
