(0x7642466f72756d5f506f7374, 0, 425472, 162, '[QUOTE=bkhan;425365][B]Ok, I was cleaning and a[SIZE=5] piece of cloth got stuck in the middle of 7mm rifle[/SIZE]. It''s not moving in any direction,  any idea plz?[/B][/QUOTE]\n\nNo Panic! Absolutely no panic. I hope you haven''t [I]manhandled[/I] your rifle so far.\n\n1) Fill the barrel with any good oil from the end where the cloth is farthest away, so most oil can get into the barrel. Leave it overnight, rifle in standing position, so oil doesn''t get out from the end that you filled it in from.\n\n2) Next day, turn your rifle around and fill some more oil [B]from the other end[/B], and again leave it in standing position for a couple of hours at least. \n\n3) Once you can see the oil has penetrated the cloth from the other end also, use a long enough cleaning rod and gently, very gently, tap your cleaning rod with something and push the cloth out, making sure you do it from the end that the cloth has to travel the least.\n\nIf the cloth stuck in your barrel was too thick, you may need to let it absorb oil for 2-3 days even, as to enable a[I] smooth[/I] extraction.\n\nPS!\n \nI have seen the craziest of ideas that people get when something like this happens. I once entered the house of a friend who had tried for hours and was about to load around into it. Since he had told me on the phone about his trouble, I was quick \n\n\n\nRegards.', '', '7afe6c182dbce414bd332e9ae44e5d51', 1392136197),
