(0x7642466f72756d5f506f7374, 0, 433618, 16453, 'Sorry for the late comments...\n\n1st of all... \n\nWell done, Dr. Gillani Sb, Jibz, Fraz, Colt1911 and Nazim Sahib brothers...\n\nThanks for conducting long awaited review of DSA True Shot 9mm.\nAnd specially writing it and conveying in a honest manner...!\n\nHowever, I think if Jibz Brother had posted some pics in the post (not a link) it would be more colourful and time saving to get the true picture of true shot.\n\nWell, suggestion aside, I thank DSA for their full support and hospitality to our fellow members..! (Though I were not there :p) This shows their confidence in their product and eagerness to establish it as an affordable solid pistol...!\n\nHowever, I think that there is need for improvement in True Shot (Just based this assumtion on the review of it here and on a video available on their FB page)... its not a criticism... respected DSA should not mind this... \nI think many of us want DSA and thier products to flourish including True Shot... and compete with international weapons...! And I seriously think that its achievable goal... but True Shot at the moment does appear lacking.. (pardon me if I am overstating)... as 300 or so rounds are nothing. A gun should atleast have a life of few thousand rounds... atleast...IMO... after all, buyer would be spending around 25 tlor 30 K or so for this gun... but then its DSA first step in the arena of 9mm so, I think with a continuous development and tests, true shot can become a solid, reliable and durable handgun. In Sha Allah.\n\nSo, no worries DSA, if you take a little time and make True Shot a solid and reliable gun...!\n\nI hope DSA won''t mind this...  Its just a humble opinion from a humble enthusiast... who wish and pray that you may become a renowned arms company of Pakistan in International gun market. Aameen.\n\nP.S. DSA, your customer support, and giving customers'' satisfaction a premier importance is appreciable. .. but does this only mean that we come their and enjoy your hospitality in shape of Charsi''s Karrahi or Kababs..? :)\nComon why are you not active and a little bit customer friendly over the internet brothers??? I mean no query asking system on your website nor you reply emails...!!! :noidea:', '', '4f0bf75ac988c96b350caddc7894dbf4', 1397151455),
