(0x7642466f72756d5f506f7374, 9113, 0, 23074, 'ashes bro what is dry firing i dont know plz tell me is dis is dangerous or any other thred for this quary let me know thanx in advance[QUOTE=Ashes;437930]Buddy, I wouldn''t recommend dry firing any gun.\n\nAs for the trigger, you''re right it can''t be compared to the others. But in my case, the TP9 was my first ever gun :) I had never fired a gun in my life before it, so I didn''t know what to expect or how to compare and to me it was how a trigger should be! :D\n\nI later tried the Caracal, CZs and other hammer-fired guns and thats when i realized the difference. But having learnt on the TP9 made it great for me coz now I can do double-taps on even my wife''s Smith & Wesson Revolver in DA mode! hahahaha\n\nSo i guess it''s all about perspective, though I would love to meet you at the range and try out your Life-Taker to get a proper feel (and also coz I miss my first love)[/QUOTE]\n\n', '', '9d7c508ec1238bf51ec0c3dea4739875', 1401220821),
