(0x7642466f72756d5f506f7374, 12992, 0, 7444, 'Hi\nFirst establish which deer will be the regular quarry - small deer-smaller calibre will suffice (.222R/.223/.243W). A larger calibre (.308W/.270W/30-06) will still do smaller deer but may be more damaging depending on bullet and placement. Furthermore, more expense feeding (ammunition)/noise etc. as well as the need to become proficient with it without bad habits (flinching).\nI have Sako (.17hmr), Tikka (222), Parker-Hale (.243W), Beretta (.270W), Steyer-Mannlicher (.300WM), Winchester (.375H&H) - all work for their purposes.\nBrno, CZ, Howa (Japanese), Remington (lots of after market stuff available), Winchester, are all fit for purpose if you do your bit. Pre-owned BSA, Parker-Hale also good from yesteryear.\nSako & Tikka rifles better all round but more expensive, probably twice as much if not more - like optics ''buy once-cry-once'' but will hold their value better.\nBy the way not teaching Grandma how to suck eggs but military surplus bullets should never be used for hunting - they will also invariably not shoot to the same point of impact if practiced with.\n\n', '', 'c475efbb89bc2ee52f0c8ab3a512e2df', 1399756576),
