(0x7642466f72756d5f506f7374, 13437, 0, 15746, '[QUOTE=Nazim Sahib;460996]Where can i find professional help?I myself am a student of psychology and come from a family where everyones a doctor but i never thought there was professional help available.\nI welcome your assistance and guidance.\nThank you for your support and time.[/QUOTE]\n\nI don''t know about the medical/psychological aspects of the treatment, but I can give you some tips about the social aspects.\n\n#1- The first thing you need to do to quit smoking is to take a break and live in a company of people who don''t smoke. If possible, 3 months straight. At least 2 weeks.\n\n#2- You cannot leave a void in your habits. If you quit one habit, you must adopt another to fill the gap. Develop a good habit. It can be any, but it has to be frequent. Sketching, origami, solving sudoku/chess puzzles, etc etc\n\n#3- For at least 3 months, starting from day 1 of no-smoke, quit all your smoking friends. This is gonna hurt at first, but knowing you will reconcile after 91 days as a smoke-free person would be the motivation you require.\n\n#4- Always keep something to chew (usually almonds, walnuts or pista are recommended) in your pockets. When you feel the urge for smoking (specially after eating), pick one of these and keep chewing on it. The urge for smoking is 20% an urge for nicotine and 80% your psychological urge to "do something". That feeling of restlessness is more psychological than chemical in nature. It might feel strange, but thats how it is. Know it that the urge is not really for smoking (although it would defo feel like it), but to do "something". Change the smoking part with the dry fruits part. Some ex-smokers strongly \n', '', 'c9147a9471b7b8f7acff71992f44e835', 1412099983),
