(0x7642466f72756d5f506f7374, 148, 0, 1408, '[QUOTE=czman;454541]Awesome! another Arma-er\nTell our pakgun buddies how good the game is. \n\nBut i replied earlier knowing that his build was on a budget, a bit better mix-n-match would yield a better system.\n\nBut you seem to be a rich assasino, getting a pc for...about 1.3-1.7 lak? Go nuts. but once again, man, 16gig ram is only used in hardcore rendering like autocad, servers, or running multiple VMs. pre-rendered worlds that you only need the image of, 6-8 gigs at max crysis 3 and FC 3 both are code-restricted to use only a maximum of 6-8 gigs. and seriously man, a gtx 780? do you know how much money your wasting?\nBuying the top end card is usually a waste, as its only marginally faster then the previous card. Usually about 5-10%. sometimes 12. A better choice would be two gtx 770s in sli. You get redundancy, less heat problems, more performance,  according to you the 780 gives you a steady 50fps. a 770 itself would give you a 40. Slight overclocking would pretty much give you a 780 right there. then double it. Voila! instead of getting 50 fps, you get double that! ( a general rule is that for the first sli/crossfire card, you get 90% of the performace. then third is a 70% and fourth is a 50%.) so for the same price ( a 770 goes for about 300-350 USD, and the 780 for a nice shiny 550-600 dollars) you get double the performace, a backup in case one card dies, and enough fps to play smoothly even in 3d mode, ( as 2  frames need to be rendered, one for each eye, a 100 would become 50FPS. )\n\nSee what i mean? if you take your time, and research well, you can end up with a choice that is much more reliable. a setup like ^ will not need any upgrades for about 4 or so years, to max out every game on a 2k resolution, compared to a single card unit. \nI dont care how much money you spend, i care if you spent it WELL.[/QUOTE]\n\nYeah i agree 16 gig is bit too much for 2014 but what bout 18 months from now ?\n\nBTW GTX 780 MRSP is $499 i got it from a online sale for $729 with the overclocked cpu\nThe rest of the system cost me about $600\n\n\n\n\n\n\n [TABLE="class: specs"]\n[TR]\n[TD="class: value left"][/TD]\n[TD="class: vs"][/TD]\n[TD="class: value right"][/TD]\n[TD="class: description"][/TD]\n[/TR]\n[/TABLE]\n\n\n\n\n\n\n', '', '1108b201037c3df43b793c0c527e2ed9', 1407923989),
