(0x7642466f72756d5f506f7374, 8, 0, 4695, '[QUOTE=Fraz;445361]Dear Sir,\n\ni have interacted with Shams ud Din & Sons quite a few times, when i first went at their shop they asked me to show my licence to them. After seeing my licence they showed me all the pistols and i bought a pistol from them at the lowest rate as compared to the others. My licence has a picture of me in uniform, after that incident they never asked me for a licence whenever i purchased ammo from them, later on i referred a friend who showed them is service card and they sold him a pistol. Yours appears to be a case of mis-communication. You should have told them who you are and they would have entertained you in a better way, in the present security situation we should appreciate that they are not showing weapons to strangers without licences. I used to deal with Ali at the shop, who was murdered outside their factory a few months back. \n\nRegards[/QUOTE]\n\n      no...people dont understand....my only problem is that they should have \n', '', '51b0ee5fdc05deac9ae69823774e07e7', 1402821304),
(0x7642466f72756d5f506f7374, 12883, 0, 15152, '[QUOTE=Sturmgewehr;445593]... no new ones have been manufactured in about 10 years lots of refitting and refurbishments going on it seems.[/QUOTE]\nThat is not surprising as its a common practice of many nations. It seems to surprise those who have no military experience that the army would use junk... well, believe it. Of course its not an armed forces protocol to buy crappy equipment. They specify what they require from a piece of equipment, and then more often than not, the contract to produce those items simply goes to the lowest bidder. Take for example two notorious cases in the recent history of the US Army. First, when the M9 pistol won out over the Sig226, and the slides blew back into soldiers'' faces. Then, when the M16 was introduced without cleaning kits, and they started jamming in combat. Those were not engineering issues, that is, to make a gun that doesn''t blow up, or to know that automatic weapons being used in hostile environments would need cleaning, would seem to be basic tenets of weapons design. Those were budget issues, where decisions were made to be as "cost effective" as possible. \n\nFor those who believe that the soldiers who risk their lives fighting for their country deserve only the best equipment money can buy, that''s a noble sentiment, but don''t be naive, war is big business.', '', 'e8e00b2adc2ca7f9343d97ea12feed6a', 1402993595),
