(0x7642466f72756d5f506f7374, 12916, 0, 15655, 'Visited DSA factory and met with mr.Murad & bought the piece, mr.murad was quite corpora-ting.\nFired about 20 rounds, the trigger pull was very clean/good & not a tricky one.\nThe looks are attractive, i like the slide finish the most coz it looks very aggressive specially the front serrations, the lock works fine & easily and when lock is on the trigger pulls freely with a lost connection with the hammer, but if the hammer accidentally sets free it wont fire coz the firing pin will be facing upwards at some degree which means a chambered round with safety on is quite safe, i don''t like the grips from the start when i first saw them & they are still the same, they feel too bulky & recoil was less but the grips made the control harder for me. I would request DSA to provide some different styles of after market grips.\nAll the rounds were fired smoothly but one FT-fire caused, the reason was the same i think DR.Gillani faced, & it fired that round right after tapping the magazine.\nOverall i think its the best choice in its price range, I am already in love with her, will share every AAR Insh-Allah.\nMay Allah bless you all with his unlimited Rehmat in the holy month of Ramazan.\nPics.\nTrigger guard is made large so fingers can get-in-out easily & can easily get behind the trigger when needed, the mag capacity, as well all know is 14+1.\n[IMG][URL="http://s102.photobucket.com/user/legionlad/media/DSA-Trushot_zps96c91071.png.html"][IMG]http://i102.photobucket.com/albums/m88/legionlad/DSA-Trushot_zps96c91071.png[/IMG][/URL][/IMG]\nThe lock is ambidextrous.\n[IMG][URL="http://s102.photobucket.com/user/legionlad/media/mm_zps96bcecac.png.html"][IMG]http://i102.photobucket.com/albums/m88/legionlad/mm_zps96bcecac.png[/IMG][/URL][/IMG]', '', '12045054b769447c55bf0014a503d836', 1404478284),
