(0x7642466f72756d5f506f7374, 13190, 0, 16207, '[QUOTE=DAUDSONSARMOURY;449648]The trigger guard was justified previously as well. The Design of the guard is here to stay and a major reason is that the Trushot maybe considered by Law Enforcement agencies that require their personnel to wear combat gloves. When wearing gloves, the dexterity is greatly enhanced while in handguns with smaller trigger guards the fit is very tight and uncomfortable.  This was our major design criteria for a different style of trigger guard. The serrations have been added as per suggestions received from PG members.[/QUOTE]\nThe trigger guard is almost always large enough on duty or service handguns. In case of Trushot, ', '', '2ac702ff7c1cb8805b095302a911f506', 1405002329),
