(0x7642466f72756d5f506f7374, 0, 454888, 15152, '[QUOTE=D3AD!;454849]6000 rounds is an average calculated figure , to be on the safe side 5000 rounds will be the best to assume the service life, Gun manufacturers are bussiness mans they always tend to list more than the maximum ,reason bussiness tactics you know , who''s gonna buy if you state that the gun''s average life is 6000 rounds at 3000rounds it will give you best precision at 4000 rounds the precision efficency will be decreased at 5000 rounds it might need parts replacement and blah blah...[/QUOTE]\nOn the contrary, that stated barrel life is extremely conservative estimation. Barrel wear occurs mostly during continuous rapid fire with extremely high temperates, and that is how they come up with a figure, like in those endurance tests in videos. If you [B]continuously[/B] shoot[B] as fast as you can[/B], the barrel [B]may[/B] need replacing after 6000 rounds. But, that is not how people shoot. When you go to the range, do you load up 10 mags, empty them all as fast as you can, then pack it up. Even if you shot 500 rounds every session, it''s not going to be continuous rapid fire. Sure you might do a mag dump every now and then, but you''ll probably fire off a couple rounds, check your group, fire some more, reload your mags, put up a new target... you know, like "normal" people :lol: Anyways, that''s why most manufacturers don''t even state a "barrel life", it''s almost impossible to determine, and most people won''t wear out a barrel in their life time anyways. I know of people who have S&W revolvers who have at least 50,000rds fired, and they''re still using the original barrel. For what it''s worth, my CQ is 10 years old with an estimated 10,000 rounds, it''s as accurate as I need it to be, I''ve never changed the barrel, nor do I intend to anytime soon.', '', '9e83b8b9c03048055556aa49d972cbda', 1408134776),
