(0x7642466f72756d5f506f7374, 11182, 0, 16461, '[QUOTE=asdx10;451434]international users are preferring canik tp9 over walther p99 \nthere is some problem with the p99 it misses fire and its cost is 2 times higher then canik tp9.\nInternational users preference these days is canik tp9 :-)\nCanik tp 9 grip is better then walther p99\nmore magazine capacity.[/QUOTE]\n\n', '', '16ac56c314cc9ebfa4e1572b8740d4c5', 1406115081),
(0x7642466f72756d5f506f7374, 13135, 0, 4848, '[QUOTE=Enigmatic Desires;451786]I have seen the PX 3 myself and I have no doubt what soever that it was an imported product. Being a regular buyer and user of local products. I can say with a slight degree of confidence that I maybe able to distinguish between the 2. \n\nBesides the documents shared here clearly stated that the PX 3 has been imported and indeed some Karachi dealers are importing the same. \n\nThe ones I saw did not have any tool marks on em.  I have seen clones of the NP 22/34 platform and I have also helped a fellow member buy and later sell his NP 22. Handled it, fired  it and was thougly satisfied before purchase.  \n\nThe Px 3 is of the same quality, fit and finish. Yes, since the NP 22 has clones its very likely its .30 bore counterpart has them too. \n\nYou have to keep in mind that Orient too is a dealer. Dealer and reliability been mutually exclusive terms\n\n A dealer who more ever did not have the requite weapon in stock. It has been my experience that when a dealer does not have something he tends to run it into the ground. However if he has htat particular product. Nothing like it in the world. \n\nAs Dr. Zakir put it. Both imports and locals are available .. Just like Local and imported CF 98 and NP 22.[/QUOTE]\n\nbingoo ! \n\n', '', '78e24ed9ac6d7257cf67e454fbc328a0', 1406266310),
(0x7642466f72756d5f506f7374, 13307, 0, 4695, 'hello all. We talk of self defense, home defense, reliable weapons and ammo etc. we spend time and money on all this. Is there any thread on pakguns that registers experiences of members how many time did they need a gun for self defense in their whole life? i remember it was once in 1985 when my uncle living next to our house has to shot 2 rounds in air to deter a pair of decoits who were making a forceful entry into our neighbours house. never ever i have seen a gun being used by me or our family members ever other than that. so my question is. why dont we talk of self-correctness rather than self-defense, introspection rather than gun/ammo reliability? \n', '', '9cc482728d08bc3328478d6beb66ed9e', 1408960390),
