(0x7642466f72756d5f506f7374, 8599, 0, 16461, '[QUOTE=Enigmatic Desires;451560]40k for a  4.5k license and not a penny in bribe!!! \n\nEh.. err.. I honestly am at a lost for words.. Am I the only one who is at a loss for words?\n\nAnd as regards computerised licenses.. and photo machine not working.. Umm more bullshit sir. I have personally seen fresh issued computerized licenses. Delivery time 1 week. Last I saw one was.. yesterday. With yesterday''s date on it. \n\n\nIf the contacts are strong enough no DC Qambhar route. Fresh issue sindh computerised  licenses without back dating. \n\nThe DC Qambhar to Home department route licenses are for 20k at Lucky Star. But dealers will only do them at license holders risk.  And only work on them on extremely strong references..  \n\nI am tempted to try one out since I never pay even a single rupee up front. But only when the license is issued. And even then in installments stretching for months. After receipt of the lisence. \n\nI would still not recommend anyone to get it though. Since most people use those licenses to buy guns. Unlike me. Rather then guns I am more of a collector of licenses.[/QUOTE]\nBro h', '', 'b37b3e381d6cdada83b35400681fa7ab', 1406198277),
