(0x7642466f72756d5f506f7374, 200, 0, 746, '[QUOTE=cancer_doc;459706]AOA\n\nGot two more Balochistan Provincial Licenses, issued by DCO Quetta ( Valid for all over Pakistan ). One for 9mm and the other for .30 bore. For 9mm I have not decided anything yet but for .30 I will sure go for Winamax but price is insane ( Baksh Elahi quoted 55K ).\n\nThanks to God for getting these licenses.\n\nIn a couple of days I will post scanned copies of one of these licenses because this is the first time I am getting a license from another Province though I have two MOI card licenses also. Now I think I have reached my target of 12 licenses ( Okay I admit there is no target and when licenses are open I will apply for a couple of more :) ).\n\nI will recheck about their originality through my own source.\n\nRegards[/QUOTE]\n\nSalam,', '', '7aae5fc00ec7f7f0487c4c316a5ee6ab', 1411233296),
