(0x7642466f72756d5f506f7374, 0, 459695, 15152, 'Glock''s "Safe Action" refers to a system which incorporates 3 passive safeties that are sequentially disengaged as you pull the trigger. \nThe first safety is the one most people are familiar with, as it''s the only one in plain view, and that is the trigger safety. It prevents the trigger from moving back unless a deliberate action is made to press it.\nSecond is the firing pin block that obstructs the striker channel.\nThe last feature to be disengaged is the drop safety. Similar in purpose to the firing block, but instead of obstructing it from the front, the drop safety interferes with unintended striker movement from the rear via the firing pin/striker lug.', '', '4cf77de9007b08c2be5122eaf7dcab6e', 1411081479),
