(0x7642466f72756d5f546872656164, 0, 0, 6306, 'Dear Brothers in arms!\n\nSome time ago I bought one of the world''s most famous rifles of all times THE K98K- Karabiner 98 Kurz (K98) 7.9257mm Mauser. The gun is a DOU 44 ( means the rifle was manufactured at German army captured rifle factory at Bystrica Czechoslovakia, located in the former Austro-Hungarian territory of Slovakia).This is the same factory that produced the all time loved CZ rifles.\n\nThe rifle is among the most accurate rifles of twenteeth century having an effective kill range of 1000m, when fired by an expert sniper.\n  \nI have been researching on fitting a telescope on the K98K. The problem is fitting the mount over it. Nazi Germans also had a tough time doing that back in the 1940s. The original mounts \n\n   \n\n  \n\n\n', 'Karabiner 98 Kurz (K98) 7.9257mm Mauser', 'b729d178b58c592b61298d1477baf903', 1411317852),
