(0x7642466f72756d5f546872656164, 0, 0, 32588, 'Bought my first airgun called Paragon 55. Its a local gun not as good as the guns you all have but I am surprised with the accuracy.\n\n\nI don''t have any experience with shooting apart from games and BB guns but I can easily hit a small soda can each and every single time (although haven''t tried at more than 20 metres).\n\n\n\nI need some help. \n\n\n1) Gun is smoking after firing.\n\n\n2) Gun is louder than air guns I''ve observed.\n\n\n3) Do I clean its barrel or something? After how many shots? After every session I fire a blank shot and blow into the barrel to clean it.\n\n\n4) I''m not reusing any pellets even those perfectly formed after hitting a soft target. Is this the right thing to do?\n\n\n\n5) I want to buy a cheap scope so the gun looks good. Where in RWP can I buy one? In LHR the gun with a cheap scope was 3800 but in RWP the gun is worth 5000 and the scope is higher quality starting from 5500.\n\n\n\nAlso tell me anything else I should do. Images attached.', 'Local Paragon 55 - Need advice', '9ba8919bf7cf31f5356f5185940561d0', 1425666402),
