(0x7642466f72756d5f506f7374, 200, 0, 8802, '[QUOTE=1stranger;470814]Bughlol brother, waisay its a misconception... even if he is in armed forces still he needs a license, army personals can carry one weapon only that is generally known as service weapon, without license. But for other weapon they need licenses as general public.\n\nBut unfortunately law is for the weaker only... hence this misconcpetion.[/QUOTE]\n\nactually for a serving officer, they get the Authority letter from their Unit CO stating that at any given time they can carry 2 Pistols or 2 Revolvers - please note here that it is just for Hand guns and not rifles / Shotguns.\nSOme officers get one ID Card type card made with their Picture and credentials endoresed and duly signed by CO.\n\n', '', 'ac9bdacf37fdf27fe10c783b7f395445', 1420546144),
