(0x7642466f72756d5f506f7374, 11334, 0, 32507, '[QUOTE=chohan;358828]Dear PG Brothers,\n\nWhy did you opted a gun, with 10,000 shot barrel life in 43500/- Rs whereas you could have got sarsilmaz B6 from POF wah outlet for 50,000/-, by spending 7000 more you could have got a gun with 25000 shots barrel life., more than double the barrel life.Doesnt it make sense, and turkish quality is faar more better than chinese.\n\nHere is my new "first self purchased" handgun, Norinco NP42 II gen. I was planning to buy CF98, but this boy caught my interest. ED Bro thank you for advising me to have a look at NP42 and thanks for providing me your ref at H M Traders, Abbas is a very nice guy to deal with, but unfortunately we could not make a final deal.\n\nPurchased from Saddar Armoury Lucky Star @ 43.5K, Purpose for buying is HD and sometimes CC. \n\n[B]General Description is as under:\n[/B]\nCaliber: 9MM\nMuzzle Velocity: 350m/sec\nEffective Firing Range: 50m\nMagazine Capacity: 15 rounds\nWeight with empty magazine: 840grms\nBarrel Life: 10000 rounds\n\nI did not fired any round yet but hope to test it very soon. The grip is very comforting and it fits really good in my hands. Its a very good piece in this price. It has manual safety, Loaded Chamber indicator, Flouresent dot sights, Rails for laser,and double recoil springs. \n\nHere we go with pics\n[ATTACH=CONFIG]20483[/ATTACH]\n\n\n\n[ATTACH=CONFIG]20484[/ATTACH]\n\n[ATTACH=CONFIG]20485[/ATTACH]\n\n[ATTACH=CONFIG]20486[/ATTACH]\n\n[ATTACH=CONFIG]20487[/ATTACH]\n\n[ATTACH=CONFIG]20488[/ATTACH]\n\n[ATTACH=CONFIG]20489[/ATTACH]\n\n[ATTACH=CONFIG]20490[/ATTACH]\n\n[ATTACH=CONFIG]20491[/ATTACH][ATTACH=CONFIG]20482[/ATTACH][/QUOTE]\n\n', 'NP 42', '32035ccc6829598dbefbc2449a97a77a', 1425845200),
