(0x7642466f72756d5f506f7374, 12655, 0, 7332, 'So, I''d been carrying this gun for about a year, but never had a chance to take it to the range.  \n\n Bad news.\n\n It would shoot three or four times, then either stovepipe or get a three-point jam.  I had two different brands of ammunition on hand, the original magazine, and a new aftermarket magazine.  Same thing for everything.\n\n I stripped the gun and examined it when I got home.  I can''t see anything obviously wrong.  The GKK is a rare gun here, and FEG is out of business, so there''s nobody I can ask for help.\n\n The mechanism is too different from a 1911 for 1911 diagnostics to help.\n\n After thinking about it for a while, I decided to try some different ammunition to find something it might like.', '', '2b7f014973a05fd6a5b7a1893ae99cb1', 1412299384),
