(0x7642466f72756d5f506f7374, 2288, 0, 27357, 'I did write a detailed process but can''t find the page in this thread to ref to. \n\nYou''ll have to visit the SO Arms in Ministry of Interior building on Constitutional Avenue - he won''t entertain agents or didn''t then. Change of weapon was straight forward (broken/damaged/rusting weapon is a good reason), but change of Cal he resisted initially. Then he finally granted after I said I really had no utility of a 12g shotgun anymore, especially in ISB, and wanted a smaller .22lr pistol instead (change of cal was on one licence, from 12g to .22 pistol). It is all at the discretion of the SO.\n\nAfter he agrees, you write a hand written application to him with your licence numbers, weapon numbers etc and that you want change of weapon/cal etc that he signs. You give that signed letter to his office on same floor and they issue you an official letter with all your details giving the permission to sell your existing weapons to authorised arms dealers and buy permitted replacement cal weapons. Your file number will be on that letter. Make sure you visually verify that file number of the letter and the actual paper file is the same! Their filing system is ... well ... poor!\n\nOnce you''ve done the weapon changes at dealers, you take original dealer purchase and sale receipts (keep copies!) back to the same office and they issue a letter for you to submit to NADRA. This letter states your details, licence numbers and old and new weapon numbers and their respective cals. The letter is electronically submitted to Nadra by MOI. You take the letter to NADRA along with fresh pictures, fill up licence modification forms at the office, and pay 1500rs per licence modification fee and collect your token(s). They will punch your older card licences the same day. \n\nIn a week or 2 you''ll get the demand notices with 2 months validity (but NADRA will extend for one month but don''t risk it!!). Take them back to the dealers for the new weapons to be entered on them, and then to DCO for stamping (get the dco bit done by an agent, for 1k per DN). Once that is done, submit the completed DNs along with copies of purchase receipts to NADRA. 2 weeks or so for new licences to be ready for collection. Make sure you take punched licences, a copy of your CNIC and original tokens when collecting new licences. Modified licences will have ''AB'' followed by same number as punched.\n\nI''m not sure who the current SO is. Last info I had was that due to protests/dharnas etc change of weapons etc was all on halt. This is the process I went through. With MOI, anything change is possible. As usual, dealing with NADRA was straight forward as their SOPs are well defined. Go to G-10 (regional HQ) or Nadra CHQ if in ISB.\n\nHTH[/QUOTE]', '', '3095a27b02c1751f87a27682a0538dd5', 1413281514),
