(0x7642466f72756d5f506f7374, 13532, 0, 998, '@ Doktar sad to hear about the incident. This is indeed very shameful act what he has done not only with you but with all Pakguns Community.\n\nDoktar bro in my opinion you should disclose his identity to Administration so that he cannot do this again with any other member. We will look into the matter and Management will decide what to do with him. If he has done intentionally he doesn''t belong to be a part of this community.\n\nAlso this is a heads up time for all members who makes deal without knowing eachother. When ever makes a deal consult with some senior member or ask from fellow PG members about him that do anyone know him or not. Then proceed further . This is for both seller and the buyer. \n\nPakGuns community us growing day by day. We have many members here who help there fellow memebers upto the best they can and sometimes they go out of the way to do it. We don''t allow "a few " to destroy this so easy. \n\nP:s Doktar bro looking forward for your email with his\n\nRegards', '', '11ccfe75ea494e5cfeaef6ad749cfcf2', 1414335754),
(0x7642466f72756d5f506f7374, 12974, 0, 18582, 'they are [QUOTE=Sand;463563]I''ve watched them both, Raid 1 and 2.\n\nThe story of Raid 1 is awesome, although the action sequences aren''t too inspiring. There are also several factual flaws in the realness of the movie. For example, the hero does not pick up any of the villain''s henchmen''s guns laying around and goes on to have a martial arts fight with one of the end bosses. All in all, its ok, but not overly great.\n\nRaid 2 also has an epic story, although the filming and locations destroy all the fun. The action sequences are also far less satisfying than original Raid.[/QUOTE]\n\n\n', '', '566e3c17f722e18c3435dbb9b00169c1', 1414266226),
(0x7642466f72756d5f506f7374, 11209, 0, 162, '[QUOTE=Ahmad;353741]@AK 47, when move to [B][COLOR="#FF0000"]Lucky7[/COLOR][/B], choose some [B]rimfires[/B] as well, you wont regert them.\ncheers[/QUOTE]\n\nSir......Lucky Seven got hit yesterday and I followed suit on your suggestion, adding rimfire .22 with CZ 75 Kadet 2 handgun.\n\n[SIZE=5][COLOR="#FF0000"][COLOR="#FF0000"][B][B]UPDATE :[/B][/B][/COLOR][/COLOR][/SIZE]: \n\nFollowing 2 beauties got added to the Magic 5:\n\nCZ-75 PO-1, NATO approved toughie compact, and 75B Kadet .22 for fun plinking and grooming of my son, into the world of men''s sports:\n\n[URL=http://s1136.photobucket.com/user/wahstar1/media/IMG_20160310_104244_699.jpg.html][IMG]http://i1136.photobucket.com/albums/n497/wahstar1/IMG_20160310_104244_699.jpg[/IMG][/URL][URL=http://s1136.photobucket.com/user/wahstar1/media/IMG_20160310_132812.jpg.html][IMG]http://i1136.photobucket.com/albums/n497/wahstar1/IMG_20160310_132812.jpg[/IMG][/URL]\n\nWhich brings the standing of Lucky 7 to:\n\nGlock 19\n\nSIG P 226R\n\nCZ 75 .40 S/W\n\nCZ 75 PO-1 9mm\n\nCZ 75 Kadet .22\n\nTracker .357 Magnum, Taurus\n\nPT 1911 - .45 ACP.\n\nAlso got my Glock 19 upgraded with Zev Fulcrum trigger unit.', '', '8d004bf3d390bed084344d80d7454af4', 1457636512),
