(0x7642466f72756d5f546872656164, 0, 0, 9434, 'I have been a target practice enthusiast all my life and experimenting with airguns is the real fun. Today i polished my airrgun trigger and it works like a charm but haven''t yet tested on target ... I have a fair accuracy in airguns so imparting some knowledge (as i see it) .. correct me where i am wrong and let me know where it is confusing .. I''ll mention the important areas only\n\n\n[U]Target Practice with a rest under arm[/U]\n.. Body movement : Just remember the key when u''ve zeroed at target u must hold for 2-3 seconds and then fire .. total it will be 7 seconds approx ... further explaining  . when ur almost zeroed hold breath now aim .. hold for 1-2 seconds at zero position and now squeeze trigger which is already half pressed so 3 seconds for trigger press .. i wish it is notconfusing else i have explain it with the help of a video\n\n.. trigger squeeze :  the most smoothest action is required ... no jerks .... like scrapping knife through butter .. ', 'Acheiving accuracy in airgun shooting', '0c80abcd1347a8279a4a933a72c47de8', 1425928384),
(0x7642466f72756d5f506f7374, 0, 472574, 15152, '[QUOTE=Bhatti1965;472572]Yes Bobba I did, It worked just fine. The only problem is that I have a muzzle break at the end of my rifle and when I fire a .223 the gasses are dissipated and felt recoil is reduced but [B]when I fire a .22LR using this muzzle break a lot of energy is lost which causes accuracy issues as well as the round losing a lot of velocity[/B]. I compared it''s accuracy with my friend''s bolt action .22lr and at 50 yards mine was making much bigger groups compared to his rifle. PS, this muzzle breaks really reduces the recoil on .223, its almost like youre shooting a .22LR.[/QUOTE]\nMuzzle brakes don''t actually affect velocity or accuracy. AR barrels are designed for .223Rem/5.56NATO bullets which are .224" in diameter. Most 22lr bullets are .223" in diameter and LRN instead of FMJ. So although you can shoot 22lr out of an AR by changing the bolt, the barrel''s bore size and twist rate is still inappropriate, which is why you''re getting poor accuracy.\n\n\n', '', 'f1f94de31c4da40e5dd1cc2a169f8f1c', 1422583852),
