(0x7642466f72756d5f506f7374, 13545, 0, 17130, '[QUOTE=Bhatti1965;465868]Alikami you are right it should be that way and it was that way in the past as well, by the past I mean pre 2003. Between 2003 and 2012 the rules changed and .223 was specifically excluded from the .22(bore) category. The 9 years that it was excluded it was PB, ARs could not be imported nor could they be sold via normal procedure so people lost the idea and so did our home department. In Post 2013 the .223 exclusion was removed and people started registering them onto licenses that specifically now said .223. I am very sure you license is not pre 2003 because before 2003 you could purchase a .223 semi auto rifle in punjab and register it onto a license. Just a fun fact, back in the 90s for a period of 5 years even 7.62 semi auto rifles were NPB. But those days are long gone.[/QUOTE]\n\n\nhaaa ... punjab government is sometimes too wicked at things ...  \n', '', '37ff80b3ab2b9741cb71b58dbd4f0f09', 1416041005),
(0x7642466f72756d5f506f7374, 0, 466447, 5032, '[QUOTE=Fudgepacker;466426]That is some serious gunsmithing <IMG class=inlineimg title=Lol border=0 alt="" src="images/smilies2/lol.gif" smilieid="60">[/QUOTE]\n\nHa ha ha! I am looking for the brain who gave this idea.\n\n[QUOTE=Fudgepacker;466430]I''ve not seen this "pipe extension", but generally anything that contacts the bullet or touches the barrel will affect accuracy. Whether that effect is significant, is a whole other issue.[/QUOTE]\n\nIt is cosmatic change and not meant to fire while it is attached.\n\n[QUOTE=Ali D;466431]It''s an add on tube without rifling. I would imagine the bullet doesn''t come in contact with this tube. But the flash suppressor/muzzle brake is obviously at the end of this tube.[/QUOTE]\n\nYup! Flash Supprssor is attache at the end of this pipe.<BR><BR>[QUOTE=Bhatti1965;466434]If there is an addition of a desi pipe then no thank you. Is every CQA this way?[/QUOTE]<BR><BR>It is pure "Valaiti"(Chinese) pipe.<BR><BR>[QUOTE=Bhatti1965;466437]Still an ugly cosmetic feature and serves no purpose, Id rather get a 14.5 left behind, or get the pipe removed somehow.[/QUOTE]<BR><BR>Somehow? I removed it with my bare hands.<BR><BR>[QUOTE=Ali D;466435]The pipe is factory fitted. Purpose is just cosmetic and to comply with the 18" regulation about the barrel length. How it affects performance is moot.[/QUOTE]<BR><BR>You got it.', '', 'c1af9bd2cb93c9d8eb10e97deb203b08', 1416376990),
