(0x7642466f72756d5f506f7374, 13637, 0, 15152, 'Organized price control or "price fixing" is actually illegal here, it''s just what the market demands.  I guess it helps to have some more choices. For instance, there are four gun stores within 15mins of me, several more if I go further, and hundreds more online. So a dealer can ask whatever he wants, but its his competition that ensures reasonable prices.\n\nCorrect me if im wrong, but it doesn''t seem like there''s a shortage of gun dealers in Pak, so the market ', '', 'bbb00be9e5c1baeccfa8c8ec9e173e44', 1417349251);
