(0x7642466f72756d5f506f7374, 13361, 0, 5054, '[QUOTE=Fudgepacker;469307][COLOR=#222222][FONT=Times][FONT=arial][SIZE=4]One of the biggest variables affecting accuracy when shooting long ranges is: bullet drop at unknown distances. Some scopes can help eliminate that variable with a series of dots on their retical (crosshairs). The dots are are called mildots and can be used to estimate range. At 100 yards, the distance between two dots is approximately 3.5", at 200 yards it''s 7", at 300 it''s 10.5", and so on. If there is something of a [I]known[/I] height by your target, you can see how many dots it fills up in the scope, and then do the math to figure out your distance to it. For example, a residential door is usually 6.75-7 feet high, if its two dots high in the scope, then we can figure that it''s just over 1100 yards away because at that distance, each dot represents approximately 40 inches. With an appropriate ballistics table, bullet drop can then be compensated for, in order to ensure a first shot hit.[/SIZE][/FONT][/FONT][/COLOR][/QUOTE]\n\n\n', '', '2f65ae4ac8c4b2b690224f716e6e8921', 1418674052),
