(0x7642466f72756d5f506f7374, 13595, 0, 14710, ' Data taken from POF site fo\nSemi Automatic Precision Sniper Rifle PSR 90 [IMG]http://pof.gov.pk/proimages/IW_SniperRiflePSR90.jpg[/IMG]\n   The Semi Automatic Sniper Rifle, PSR 90 cal. 7.62 mm x 51 NATO is  amodern combat rifle combining the accuracy of a sniper rifle with the  firepower of a machine gun. It is produced in accordance with the most  advanced manufacturing methods. The rifle is designed for semi-automatic  fire and can be fired from any shooting position. The Sniper Rifle is recoil operated weapons with free floating barrel  and delayed roller-locked bolt system and is fed from a 5 or 20 rounds  magazine. Each rifle is provided with means to mout a telescope. \n        [TABLE]\n[TR]\n     [TD="class: table-heading, colspan: 3"]TECHNICAL DATA(Semi Automatic Precision Sniper Rifle PSR 90)[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Cartridge\n[/TD]\n     [TD="width: 610"]7.62 x 51 mm (.308 Match)\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Operation\n[/TD]\n     [TD]Roller delayed blow back    Semi-automatic\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Muzzle Velocity\n[/TD]\n     [TD="width: 610"]870 m/s\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Effective Range\n[/TD]\n     [TD="width: 610"]1000 M\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Feed\n[/TD]\n     [TD="width: 610"]5 or 20 rounds magazine\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD]Weight with tlescope\n[/TD]\n     [TD="width: 610"]8.1 kg (empty magazine)\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]overall length\n[/TD]\n     [TD="width: 610"]1158 mm\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Barrel\n[/TD]\n     [TD="width: 610"]Heavy (Polygon profile)\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Barrel length\n[/TD]\n     [TD="width: 610"]600 mm\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Rifling\n[/TD]\n     [TD]Polygonal four grooves right hand    twist\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Trigger Pull\n[/TD]\n     [TD="width: 610"]1.6 kg (Optional)\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Sight\n[/TD]\n     [TD]Telescope 5.5-22 x 50 NXS    (optional 6 x 42 Telescope)\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Accuracy\n[/TD]\n     [TD="width: 610"]90 mm group at 300 M\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Butt stock\n[/TD]\n     [TD="width: 610"]Fully adjustable\n[/TD]\n   [/TR]\n   [TR]\n     [TD="width: 36"][CENTER][IMG]http://pof.gov.pk/images/bullet3.png[/IMG][/CENTER][/TD]\n     [TD="width: 276"]Optional\n[/TD]\n     [TD]Suppressor, telescope and carrying    sling\n[/TD]\n   [/TR]\n   [TR]\n     [TD="colspan: 3"][B]Packing[/B]\n[/TD]\n   [/TR]\n   [TR]\n     [TD