(0x7642466f72756d5f506f7374, 13729, 0, 10283, '[QUOTE=Fraz;471973]Dear Brother, Sorry to hear about your father''s demise. May Allah give you and your family the courage to bear the loss.\n\nYes in case of death of a licencee the licence can be transferred to the spouse or children of the licencee. For this you would have to apply to the issuing authority for transfer of licence to your name. You would also have to submit an affidavit signed by your mother and siblings that they have no objection on transfer of the licence to your name. The weapon would have to kept in the custody of a dealer till the time it is transferred to your name. The process has also been discussed in other threads. \n\nHope this helps.\nThank you very much brother for detailed info.\n\nRegards[/QUOTE]\n\n', '', 'b3f8b8527c9b16f6cb46acdacc389248', 1421954180),
