(0x7642466f72756d5f506f7374, 725, 0, 15220, '[QUOTE=Disturbed_owl;484876]All i see here is you guys are tossing information at each other of what is legal and what is not without any reference (if you do have then please post it) though you also have no idea of the legality of what bores are prohibited and bla bla bla :argue:\n\nAllow me to clear all of your answers in this single post \nMy reference From [B]Punjab Arms Rules 2014 Latest\nand MOI Arms Policy\n[/B]This is the Exact Wording of PAR 2014\n\n[CENTER][B]CHAPTER III[/B]\n[B]PART A[/B]\n[B]LICENSED FOR PROHIBITED AND NON- PROHIBITED BORE ARMS\n[/B][/CENTER]\n[B]29. Prohibited bore arms.&#8211; The Government may, by notification in the [/B][B]official Gazette, declare prohibited bore arms and the following shall be included [/B][B]in the prohibited bore arms:\n[/B][B](a) revolver or pistol with a bore of over .46 inch;[/B]\n[B](b) non-automatic, semiautomatic and automatic rifles[/B]\n:moony:[B]excluding[/B]:moony:[B] sporting rifles with a bore of 0.22 inch or 7 mm bore nonautomatic [/B][B]rifle;[/B]\n[B](c) sub-machine gun, machine gun, stein gun and others; and[/B]\n[B](d) carbine.\n\n[/B]\n[B]30. Non-prohibited bore arms.&#8211; The non-prohibited bore arms shall mean [/B][B]the arms which are not prohibited under rule 29 and which may include:[/B]\n[B](a) revolver or pistol if not of a prohibited bore;[/B]\n[B](b) rifle if not of a prohibited bore;[/B]\n[B](c) single or double barreled shotguns whether non-automatic, semiautomatic,[/B]\n[B]automatic or pump-action; and[/B]\n[B](d) sword.[/B]\n\nSo a pistol or revolver exceeding a bore of .46 is Pb\nand all semiautomatic/bolt action rifles from .22 or 7mm are NPB \n.308 is NPB because it falls under the category of 7mm\nAll automatic weapons whatever bore they have are PB\nAnd someone here asked if .44 Non automatic is PB or NPB the Answer is Given Above but i think i should clarify that All non automatic/semiautomatic rifles exceeding 7mm are PB where .44 falls under the category of 10 mm So Its PB\n8mm Rifles semiautomatic/bolt action are PB\n\nOne Thing More As Notified By Ministry of Interior \n\n[B]Provision of PB Weapons to the Licensees[/B]\n[B]18. Except for Pakistan Ordinance Factory Wah, no other business entrepreneur in the country is legally authorized to manufacture / sell PB weapons. Therefore, many of the PB licences holders resort to the unauthorized practice of getting PB weapon in the form of gift from tribal people / authorities. Ministry of Commerce and Trade may take necessary steps to ensure provision of prescribed PB weapons to the licensees.[/B]\n\nHope this clears most of your confusions and i will be here if some one needs further assistance. :spy:[/QUOTE]\n\nThat is old reference please see the one of 10 June 2015\n\n\n', '', '158ddfd42ee393f02c921838ad0f7e3e', 1439068205),
