(0x7642466f72756d5f506f7374, 10763, 0, 6294, '\nHope all members are well. Just spent December - First week of Jan in Pakistan on vacation. had a bit of fun. Attended the Toss Show 2015 on its last day. went out and about on a few so called hunting trips, well more of a laugh than hunting as the season was almost over and it was more of a picnic with friends in other words. \n\nComing to the main point now, I had a Hatsan Escort Combo NIB on top of the shelf since Dec 2012, never used since it was purchased, so this time I decided to unbox and test it. It was not a very pleasant experience unfortunately, as the first round always missed, and only fired when \n\n1)the single fire button was pressed or the first \n2) the first missed round was ejected out and then it would start firing from 2nd round onwards, don''t know why.\n\nAnyhow I was very disappointed and thinking what to do. I couldn''t take it back to the dealer I bought it from as it had been 3 years.\nI then contacted a dealer friend who has a shop, he sounded interested, so took it to him, he liked it as it was still almost brand new with all its packing and wrappers etc, I wanted to buy a Baikal MP 153 But as most of you are aware they are currently out of stock, but he had a boxed MP 155, I was hesitating after reading here on Pakguns and from other people regarding a few issues with MP 155 but the dealer assured me that it will not let me down so I paid money on top of my Hatsan Esc Combo and bought the MP155. Here''s snap.\n\n\n\n\n\n', '', '52d9b3abde1317e5b148219f74ba1ec5', 1453661288),
