(0x7642466f72756d5f506f7374, 14058, 0, 5674, '[QUOTE=Abbas;485422]Salams,  [TABLE="width: 500"]\n[TR]\n[TD]I totally agree with you, its a nice move, but who implement this, the butchers! who are sitting in our assembly and doing nothing, I don''t know how they came with our votes, not doing any legislation, obviously the criminals are stronger, carrying illegal weapons and doing what ever they want, and the common men not allow to carry his legal weapon for just in self defense,  they made the system so  difficult for weapon licensees and verifying the character of noble citizen from the corrupt police.  \n\nI don''t know about the other provinces, but in karachi sind        [/TD]\n[TD][/TD]\n[/TR]\n[TR]\n[TD] [/TD]\n[TD][/TD]\n[/TR]\n[TR]\n[TD][/TD]\n[TD][/TD]\n[/TR]\n[/TABLE]\n\n\nI''ve been away for a while but watching things progressing in the background. It seems every week there is a new statement about gun laws in Pakistan. Revalidation, Cancellation, Limitation or some other "ation". It will never work. If the Government is really serious then we need a sensible and workable framework which addresses the genuine concerns of the Gun Community of Pakistan and solves the genuine security concerns of the Establishment. Some things have to be said clearly and in point form on behalf of the Gun Community of Pakistan.\n\n1). We [B]are [/B]Pakistan. \n2). Disarming us the citizens will only weaken the country.\n3). We will not be disarmed.\n4). We wish to be legal and law abiding citizens of Pakistan. Don''t make laws which force us to break them.\n5). Don''t take away or limit our right to protect our homes, businesses and families.\n6). Firearms run in Pakistani blood. It is our culture.\n7). An armed and trained population is a country''s greatest strategic asset (Ref Switzerland). In case of any shortcoming in the armed forces they become the resistance. \n8). Legal Firearms owning citizens of the country are [B]not [/B]terrorists or potential terrorists. They are the greatest deterrence [B]to [/B]terrorists. \n[CENTER]\n\n[/CENTER]\nNow as for [B]the solution,[/B] let me give that in point form as well for clarity. \n\n1). All weapons in Pakistan must be registered and computerised. \n\n2). No new licenses should be issued without a training program modelled on the Canadian Firearms Safety Course (CFSC).\n\n3). One License should be issued which is for the [B][I]PERSON [/I][/B]and not the [B][I]FIREARM[/I][/B].\n\n4). The Citizen should be able to buy [B]any [/B]number of Firearms on the license which is issued to his PERSON.\n\n5). [B][U]The purchase of Firearms should be as follows: [/U][/B]\n\na). Every Firearms Dealer should have a computer which logs into "A Firearm Dealer Database". On that database the dealer should be obligated to keep an inventory of all firearms in their inventory.  \n\nb). When a customer with a PERSONAL Firearms licence walks in. He should ask for his PERSONAL license, verify it''s authenticity in the online database by entering the License number or swiping his card. Once verified the license is genuine he can sell the firearm to the license holder and transfer the firearm from the online dealer inventory to the customers PERSONAL license. A photo can be taken via webcam which verifies the person at point of sale and attached to record. This is the most secure form of transaction. \n\nc). A customer selling a Firearm can do the same process in reverse. Ie Firearm owner walks in with the gun, sells it to the dealer who transfers it from the online database to his dealer inventory and gives the seller a receipt which only prints from the online database saying it has been transferred to them. \n\nd). The benefits of it are, ownership of firearm is firmly established. Government keeps a track of sales for Tax purposes. There is no need for DCO stamps or touts which offer to get things done for you underhand. All three parties, the Government, the Firearms Dealers and the Firearms Owners would directly connect in a ''FAST, NEAT & CLEAN'' dealing. \n\n6). When an Arms Holder is stopped at a Security Check point, the official can simply get his thumbprint and verify if he/she is indeed the owner of the weapon being carried. \n\n7). Dealers should be allowed [B]FREE IMPORT [/B]instead of QUOTA''S which is a very inefficient & corrupt system. It only encourages under invoicing, smuggling and black marketeering. The Quota system is an obsolete system in today''s free market economies and only used in the past to dole out favours to the courtiers of the elite. It is [B]not [/B]in the interest of Citizens of Pakistan. \n\n8). Government should actively negotiate with the European Union and the US to allow free export of non automatic firearms to Pakistan. The problem has always been end user certification and the small arms falling in the hands of criminal outfits but the new system does away with those issues as the same countries have no problem selling firearms to Pakistani armed and security forces. [U]Please make those countries stop thinking the entire population of Pakistan is criminal.[/U] \n\nThe number of arms sold in Pakistan remains the same, only difference is we are shooting Chinese, Brazilian and Russian guns instead of European and American ones. If used in a crime a firearm works the same regardless of which country it is manufactured at. That is not to say American or European small arms are not available in the market. They are flooded with them infact, the only difference is that middle men, smugglers and black marketeers are pocketing the money which belongs to the Citizens and the Government of Pakistan. If for example the Government negotiates with the US to allow export of firearms then a Glock which sells for Rs. 300,000 ($3000 USD) can be bought at $450 USD, have $100 of misc expenses to transport to Pakistan and after paying a 100% duty (450x2=900) be sold in the market legally for Rs. 900+100+20(dealer profit) for Rs. 120,000 ($1200). That''s Rs. 45000 per gun that goes into the National Exchequer and Rs. 180,000 the Firearm Owner saves in money which he would have paid to a BLACK MARKETEER / SMUGGLER who is much more likely to be a criminal. \n\n9). Banning weapons or issuing a call for a mass cancellation of licenses will not be in the interest of the Government of Pakistan nor the People of Pakistan. That would only result in making millions of weapons ILLEGAL and people holding them Criminals. Is that the aim of the Government, to make hundreds of thousands of LAW ABIDING Citizens Criminals by the stoke of a Pen ?\n\nI would like to request the Government to please approach this in a sensible manner which is in the interest of all parties. Gun laws need [B]a completely new framework[/B] in Pakistan. These quick fixes will only have negative results. \n\n[B]\n@All\n\n[/B]This is just a first draft which I only wrote because I saw no one else was coming forward. Please feel free to share your suggestions. Also I would request that since this is something which is very close to our hearts and extremely important to us[B] please share with as many people who you think can help with this or are concerned with this. [/B]Thanks.[/QUOTE]\n\n', 'Gun Laws', 'a1ecf108344675ba2a7766e20bc70727', 1441427366),
