(0x7642466f72756d5f506f7374, 14221, 0, 861, 'I am using the A400 with the Kick off. It is a light gun that handles very well, I have experiences a funny problem of a sore right thumb when shooting 2 or 3 boxes in a hurry the loading causes the sore thumb. The second issue is getting used to the damp recoil it is not crisp and feels very different; how ever the gun is very fast for follow up shots and the recovery is accurate and speedy.\nOne issue I had twice or thrice is a cartridge getting stuck with the follower in the bottom of the feed recess when the gun is reloaded hurriedly, perhaps this will vanish with a little use. The gun is capable of firing 3 inch Magnum Cartridges, I fired 56 gramme cartridges which are punishing but not in the A 400 it gives a dull push.\nI like the gun every bit, but if I was to use only 34 gramme cartridges I find it n ', '', '6bd88f0c299cc27abd6946a4507d7133', 1456581640),
