(0x7642466f72756d5f506f7374, 1620, 0, 4848, '[QUOTE=Sikander Panhwar;481659]Panhwar\nFrom Wikipedia, the free encyclopedia\n\n[hide]This article has multiple issues. Please help improve it or discuss these issues on the talk page.\nThis article may need to be rewritten entirely to comply with Wikipedia''s quality standards. (September 2011)\nThis article may require cleanup to meet Wikipedia''s quality standards. (September 2011)\nThis article needs additional citations for verification. (September 2011)\nPanhwar or Panwar (Urdu: &#1662;&#1606;&#1726;&#1608;&#1575;&#1585; &#8206;) are a Muslim Rajput tribe found in Sindh, Punjab and Azad Kashmir in Pakistan. The term Panwhar is used for the Parmar Rajputs clans that have converted to Islam, and are settled in what is now Pakistani territory.\n\nHistory[edit]\nThe Panhwar or Panhwer originate from the Parmar Rajputs they converted to Islam during the reign of the Samma Dynasty. Many of the Panhwar even originate from Sufi masters and particularly identify themselves with the legendary story of Umar and Marvi.[citation needed]...this is what wikipedia says,i have to confirm from my elders...i really m weak in history.as long as im muslim that is great feeling and proud of:))))))[/QUOTE]\n\nwah Sikandar bhai " Panhwar" word is also sung in one of folk \n\n', '', 'c3f1b50641899e955319bab688ae604e', 1433872411),
