(0x7642466f72756d5f506f7374, 14018, 0, 4287, '[QUOTE=czman;484311]Buddy, that was not directed at any forum member. That was my opinion about the author of that ....wonderfully written article by that well meaning but misguided man that had a showing on a news site. \n\nIf you want to start nitpicking i can just as fairly say that you are getting personal with me by inquiring about my \n"[COLOR=#333333]May I inquire about your education in sociology or psychology and your expertise with firearms?"[/COLOR]\n\n[COLOR=#333333]Those who have not spent enough time with a certain thing should not be judging it. It is the same as " Not judging a book by its cover " [/COLOR]\n[COLOR=#333333]If you want more examples i can easily provide plenty[/COLOR]\n\n[COLOR=#333333]The western worlds view of islam, [/COLOR]\n[COLOR=#333333]The previous generations view on video games [/COLOR]\n[COLOR=#333333]Western public opinion about motorcyclists [/COLOR]\n[COLOR=#333333]Pakistani opinion about family planning[/COLOR]\n[COLOR=#333333]Pakistani public opinion that every member of the government has to be corrupt no matter what , and every person who is well off got rich by stealing and criminal acts. \n\nIts a simple matter of holding your tongue unless you have gained enough experience to say anything. \n\nMany anti-gun advocates have not fired a weapon in their lives and cannot identify a carbine from a bolt action. Yet they spew nonsense- be it in good faith or bad. \n\nFinally skywalker, the issue is that you immediately assumed that i was getting personal / and taking my words in the context in which YOU wanted it to be.( negative and inflammatory )\nMight as well start opening the quran , pointing out any slightly violent verse and then start preaching nonsense to the rest without understanding context. \n\nWhen you look for something you want, you will bend it to suit what you want it to be. Clouds are just that, clouds, it is us that tell ourselves that " That one looks like a face, that one looks like a cat " \n\n\nI still think the way to solve this is simple really. Once again, a mandatory account of every round fired and showing of empty cases to prove it. That will curb almost all misbehavior with licenced firearms, and then afterwards we can just point the finger at those who still own guns that are not licenced through a goverment backed advertising setup, much like what happened with cigarettes in the post WW2 years.   [/COLOR][/QUOTE]\n\nNofense.ut t\n', '', '563ff593e94737ea9cce5b6b870a81d0', 1437707375),
