(0x7642466f72756d5f506f7374, 14058, 0, 15426, '[QUOTE=Abbas;485422]\n\n[COLOR=#333333]2). Disarming us the citizens will only weaken the country.[/COLOR]\n[COLOR=#333333]7). An armed and trained population is a country''s greatest strategic asset (Ref Switzerland). In case of any shortcoming in the armed forces they become the resistance. [/COLOR]\n[COLOR=#333333]8). Legal Firearms owning citizens of the country are [/COLOR][B]not terrorists or potential terrorists. They are the greatest deterrence [B]to terrorists. [/B][/B]\n\n[/QUOTE]\n\nAbbas,\n\nI don''t fully agree with these points. You''re using the Swiss example ignoring that country has mandatory military service, like Israel. The guns they have are government issued tools. I think every one who''s physically fit should be required for military service, at least in the reserve Army. Then, sure, having a gun can be considered a "right". Otherwise, it''s just a privilege that can be taken away if the government (who should have a monopoly on violence) wishes.\n\n\n', '', 'c7c67fec8c314bf07a5296a2a7da843a', 1440856091),
