(0x7642466f72756d5f506f7374, 494, 0, 39173, '[QUOTE=AK47;12139]A King wanted some strange things from different parts of the country and sent 3 servants out on mission. After some months they returned to present their discoveries before the King. Man No 1 went inside and presented his specialty: A huge, giant water-melon." What is this asked the King:? "Your highness, this water-melon is enough for your entire castle to eat". The King rejected it, "Strange, but nothing new". Man No 2 came in and put forth a giant Lemon. "What is this", asked the King. "Your highness, when squeezed this would be enough lemonade for your entire Kingdom", said the man. The King brawled" Is this all you folks could bring back"? "No" said man No 3," I have something new for your highness", and brought forth a cannister/ Large tin full of stones of small sizes. "What is this", asked the King? The man came forward and close to the ears of the King started shaking the cannister violently: "Ghar ghar ghar ghar...". "What the hell is this, don"t we have stones in this land"?, yelled the King. "Your Highness, its not about the stones, its about the sound of them". "Its Pushto"....[/QUOTE]\n\n', 'Lol &#55357;&#56833; Funny! Despite story is incomplete, what was king response on pusht', 'f78e3ed81ea087abc45b315bfc31bdf6', 1458192887),
