INSERT INTO `blog_text` (`blogtextid`, `blogid`, `userid`, `bloguserid`, `dateline`, `pagetext`, `title`, `state`, `allowsmilie`, `username`, `ipaddress`, `reportthreadid`, `htmlstate`) VALUES
(1, 1, 592, 592, 1290150316, 'Salam,\nnice to see new feature on PG [B]The Blog[/B]. congrats to Admin Mods and members for on more good step towards the healthy community.\nsince i am first one to write here,but its not any article nor any review.Just a congratulatory messege and a QUESTION.\njust want to know What is Blog ? do we have two forums at a time now? \nsecond purpose of this writing is to know whether if have any errors,bugs in our new Blog system.\nmembers are welcome to contribute whether they have find it fine or is there any error.Also please clear my confusion about BLOG... are both Forum and Blog equal ? what is technical difference between them\nWELCOME TO PG BLOG.', 'Welcome to PG Blog', 'visible', 1, 'Topak', 1868047453, 0, 'on_nl2br'),
(2, 1, 116, 592, 1290165385, 'Topak bro, blog definition,\n\n[B]Definition: [/B]  an online diary; a personal chronological log of thoughts published on a Web page; also called WEBLOG or WEB LOG. \n[U] [/U]\n[B]Example: [/B]  Typically updated daily, blogs often reflect the personality of the author.\n\n So start writing your diary of your daily Court, Justice system, Laws etc experiences', '', 'visible', 1, 'Denovo87', 2006796667, 0, 'on_nl2br'),
(3, 1, 1, 592, 1290179000, '+10 Denovo I could not have put it better.\n\nBlogs are a personal web space for Senior PG members. They can share parts of their lives with the online world. Our only rules are no politics, no religious discussion and no auto weapon talk. All else is welcome. \n\nMembers can also completely customize the outlook of their Blogs. \n\nA list of some good blogs: [URL]http://technorati.com/blogs/top100/[/URL]', '', 'visible', 1, 'Abbas', 1941577990, 0, 'on_nl2br'),
(4, 1, 861, 592, 1290181562, 'Lots of wild Boars are active near the border and I am lucky to be invited by a friend to a shoot. I am going to reload 300 grain hard cast  bullets for my .44 Magnum Colt Anaconda, I will be using Blue Dot Powder and CCI Large pistol primers. Recheck the zero on the range at 50 Ms hitting about 2 inches high so I am on at a hundred Ms. The Anaconda with an 8 in barrel is from the Colts Custom shop and shoots into one inch at 50m with a 2 power Leupold Pistol scope on it. It is fixed in Burris no drill no tap mounts and rings.\nWill post pictures of this beauty with a bite, and also the boars I may get', '', 'visible', 1, 'Skeeter60', 974887009, 0, 'on_nl2br'),
(5, 1, 1507, 592, 1290182013, 'Sir Skeeter \r\nSome day I will share pictures of my maternal grandfather with you. \r\nBest of luck on your hunting.', '', 'visible', 1, 'Vik', 1941587853, 0, 'on_nl2br'),
(6, 1, 116, 592, 1290200916, 'Sir Skeeter, is that border near Sialkot? in case it is, dont forget to give a buzz after or before dealing with the boars.', '', 'visible', 1, 'Denovo87', 2006796667, 0, 'on_nl2br'),
(11, 1, 3657, 592, 1290491103, 'MashAllah, you brothers have upgraded this site to a higher level.  The only problem is now I get to spend more time at PakGuns ??  As Tony the tiger says ... "This is Greaat!!!!!".', '', 'visible', 1, '1911', 1847863974, 0, 'on_nl2br'),
(9, 1, 861, 592, 1290403503, 'Well I will tell you when things are finalised', '', 'visible', 1, 'Skeeter60', 974887009, 0, 'on_nl2br'),
(10, 1, 281, 592, 1290447822, 'Hello Guys,\nNot actually much blogging going on around here.\nI am not seeing any Tab for creating a new Blog, do i not qualify or is there something wrong with my browser?', '', 'visible', 1, 'Adeel Ahmad', 3393523611, 0, 'on_nl2br'),
(12, 1, 4152, 592, 1290498436, 'I am using an over under 12 gauge Russian shotgun for hunting pigs, fox  and deer. I want to know which cartridges should i use and i am not  familiar with chokes can u help me with it.Plus i have a problem with  the aim i am using heavy cartridges i AA and BB normally termed as SG  and LG.', '', 'deleted', 1, 'ally', 1969623842, 0, 'on_nl2br'),
(13, 1, 116, 592, 1290502384, '[U][B]Adeel bro[/B][/U], nothing wrong with your browser but your other guess is right, making a blog facility is set to cater 1600+ post members, so you need to run fast to that mark.\n\n[U][B]ally bro[/B],[/U] this is not the place to ask such questions, please post your query in forum''s relevant section/thread to get a quick reply, deleting your query from this blog.', '', 'visible', 1, 'Denovo87', 2006807148, 0, 'on_nl2br'),
(14, 1, 83, 592, 1290505772, 'Welcome to the world of Blog :) \nCongratulations to the Team Pakguns for taking it one step ahead.\nAbbas...any more surprises ? :)', '', 'visible', 1, 'Ka_Khan', 2006517318, 0, 'on_nl2br'),
(15, 2, 1, 1, 1290524593, 'Salams everyone, \n\nI would like to welcome everyone to the world of Blogging. It''s an interesting way to share with others what''s happening in ones life, random thoughts or on a specific topic. Blogs can be personal, professional or hobby oriented. I will keep mine a mix of personal and hobby oriented. The only two topics which I will not comment on are religion and politics. \n\nMore to come.\n\nMany friends have asked me what is required for having a blog on PakGuns. It''s just another free service we provide to members of good standing here at PakGuns, they are required to have atleast 1600 posts on board.', 'First Post', 'visible', 1, 'Abbas', 1941578367, 0, 'on_nl2br'),
(16, 1, 68, 592, 1290574206, 'I''m due to write a Blog here in 2012, Insha Allah.', '', 'visible', 1, 'TAREEN', 1847920674, 0, 'on_nl2br'),
