(60, 9, 162, 162, 1295601240, 'Check out how this firearm, the HS 2000 of Croatia, equivalent to the Springfield XDM handgun, is being through-roughly exposed to severe torture/endurance testing. Did anyone say anything about polymer handguns?? Fabulous! \r\n\r\n[url]http://www.hs-arms.com/te-hs-torture.php[/url]\r\n\r\nRegards.', 'Endurance testing the hs 2000!!', 'visible', 1, 'AK47', 2006612740, 0, 'on_nl2br'),
(61, 9, 2342, 162, 1295623973, 'I am not an admirer of the XD shape and looks. But [B]jadoo tusee kanday hoo tay wat thik he ho see Malook (AK47)[/B].', '', 'visible', 1, 'ACHILLES', 2006519336, 0, 'on_nl2br'),
(62, 9, 162, 162, 1295637736, 'Lols, ACHILLES bro, love your Hindko!', '', 'visible', 1, 'AK47', 2006591016, 0, 'on_nl2br'),
(63, 5, 704, 519, 1295799392, 'I loved that show, I have it on HD 720p ALL six episodes along with Supernatural ALL Seasons, Dexter ALL Seasons, Sparticas All of Blood and Sand (awaiting Gods of the Arena).', '', 'visible', 1, 'Moeen', 3412278969, 0, 'on_nl2br'),
