(66, 10, 116, 116, 1296028686, '4 hours stay at Muscat international, reached here at 9am, flight (Oman air) to London is at 1pm. Enjoying business lounge''s excellent food :hungry:, drinks (hallal only :rain:), hostesses :whistle:and computer :tongue:\n \nMuscat airport although is as big as Dubai, Bangkok or Hong Kong but is clean, beautiful interior, smaller but full of goodies duty free shops and lot of Pakistanis & Indians ;)\n \nMy only problem (as usual) is smoking, airport has only two smoking rooms (non is business lounge) full of smoke produced by 100 different brands of cigarettes. Going there after every half an hour to smoke a [B]tasteless[/B] cigarette is quite torturous.\nI am sure world can be a smoke free place in 30 days if all the places (including homes) are implemented with same smoking restrictions as we have  at airports ( Pakistan airports exclude as they are situated in a very free country).\n \nwill try to write regular blog telling you people everything kinky n non-kinky I come across to, during this visit. So keep checking in ;)', 'Great Britain via Muscat', 'visible', 1, 'Denovo87', 1387398702, 0, 'on_nl2br'),
(67, 10, 1, 116, 1296048700, 'Great, here I was thinking of calling you today and you''re half way across the world ! Looking forward to you and Slayer shooting down some clays !', '', 'visible', 1, 'Abbas', 1969630360, 0, 'on_nl2br'),
(68, 10, 162, 116, 1296076939, '@Chief.................I caught our UK/Muscat travelling bro, right when he was packing off yesterday eve!\n\n[B]@Den[/B]......Lolz on all the " [I]halal[/I] " bro, ha ha ha! Enjoy it bro, take the full load of "heart-feed", while you''re there and share ''em all exposed in next thread of yours, we''ve been calling the guns "babes" for a little too long now, lolz!\n\nNice start to the blog also, now keep us updated, you''ll be missed, and for a couple of days switch over to smokeless E-cigarette with a good load of cocoa flavor, lolz!\n\nRegards.', '', 'visible', 1, 'AK47', 2006613924, 0, 'on_nl2br'),
(18, 2, 168, 1, 1290660380, '1600 posts? wowwwwwwww. Guess at my current rate, I''ll be posting my first blog after six years. Anyhow, can we view the blogs and "mustafeez" hon?;)', '', 'visible', 1, 'Bullseye', 3523382550, 0, 'on_nl2br'),
(19, 4, 162, 162, 1290763711, 'Salams! \n\nI already have the extreme pleasure and honor of being well acquainted to most of the honorables around here, and enjoy many a personal relations/interactions with most of you as simply the best things that ever happened to me in my entire life. Thanks everybody, I really value your friendships beyond expression. :)  \n\nAnd for those who do not know me, well, I''m a simple straightforward young guy from WAH, still an amateur, with a few junk items, yet wishing to learn and gain from all of you. Salams.  \n\nIt''s my firm belief that the present state of law and order prevailing in our beloved motherland, and the surroundings, not to mention increased criminality as consequence of deteriorating socio/economic conditions - [I]and increasing proportions of unlawful weapons in the hands of outlaws[/I]- necessitates the possession of legal weapons, by all means, in order to safeguard one''s family/honor/dignity/possessions with some valor at least, or compulsion, and we can only pray that conditions do change for the better, hopefully. \nAny &quot;optimist&quot; smiley around anywhere?  \n\nWeapons came to many of us as part of family traditions. For others, they came as part of security arrangements, due to hostilities. Finally, there are pure gun enthusiasts who neither have family traditions nor security treats, yet still they like weapons for the thrill and sports of it. Perhaps this is the &quot;true love&quot; category, I don''t know, but to me weapons came both as part of family traditions as well as necessary security arrangements.\n\nFour years old, I''d run away with my Grand Pa''s long rifle bullets, and they would all be worried about me, that I wouldn''t hammer those 30-06/3-0-3 rounds against anything. Lols!\n\nThe Diana got introduced to me at 11 years of age, and I gradually acquired a sight, sharp enough to blow up bees and lizards, I believe a common teenage Diana fun! \n\nAlso there was quite some dove and pigeon hunting as well. I later added up with a 25 pellets magazined El-Gamo, .177, airgun which was a wonder by itself, in terms of just having to break the barrel and shoot again.\n\nUnfortunately no pics around of the El-Gamo airgun, but I still miss it lots and it was a beauty indeed with pistol grip and very handy size, brought in by myself from abroad. :plane:\n\nAt 14 I did my first actual firing with a real caliber gun, a [B]Webley .32 revolver[/B].\n\nThen a .455 revolver[B] HELLFIRE[/B], belonging to my Grand pa! \n\nLater on a full-auto cal. 32 pistol followed, 10 shots, along with a .30 as well, both local stuff. Also my first items to be stolen from me, in that a new servant ran away with both holsters at night, whilst I was sleeping. Lols! :mad2:   \n\nThis lead to my first Type 56, discussions spared plz!   \n\nI believe I was 18 then.\n\nIn between, there was a period during which the zeal somehow had dampened, you know, some [I]prettier[/I] things were around!   \n\nThen, lately, during past 3-5 years the urge reappeared from the deeper abyss, and I started again with a few &quot;non mention-ables&quot;! \n\nLooking around for some gun dealers on the net, I came across this wonderful site and all of you! And that was the absolute turning point! From zeal and urge, it has now developed into a [I]non-curable[/I]! :lol:\n\nThough most of you do already know of my few scrap items, allow me for the completion of this blog to share some of the pics with you again.\n\nIn security items -This little wonder is a permanent front-seat passenger during eve''s time:\n\n[B]Pump Action, 4+1, Barrel 14"[/B]:\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/My%20Guns/Tomahawk%20Cruiser/MyChoiceSmall.jpg[/IMG]\n\nAnd in Hunting section:[B] FN 30-06[/B]\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/Rifles/30-061.jpg[/IMG]\n\nFor [B]SD/CCW[/B] :\n\n[B]Cal.45[/B]:\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/My%20Guns/PT145Fobus.jpg[/IMG]\n\n[B]SD/ CCW 9mm [I]sub-compact[/I][/B]: CZ[B] RAMI[/B] 2075 D:\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/SD%20DUO/RAMI1Small.jpg[/IMG]\n\n\n[B]SD/CCW 9mm [I]semi- compact[/I][/B]: \n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/My%20Guns/Pic6Medium.jpg[/IMG]\n\n[B]HD 9mm Full Sized[/B]:\n\n[IMG]http://i1136.photobucket.com/albums/n497/wahstar1/My%20Guns/Kilinc5Medium.jpg[/IMG]\n\nNext few items desired and pending mainly due to MOI unrest:\n\n1. Caliber .45 handgun, all steel.\n\n1. 9mm Handgun in Polymer?? Preferably high-end.  \n\n1. Makarov, hopefully. \n\nI would feel myself &quot;content&quot; then, though this greed has absolutely NO LIMITS attached, too many &quot;fevers&quot; and &quot;viruses&quot; in the air, let''s see when the MOI re-opens and the right amount of &quot;[I]anti-biotics[/I]&quot; is around!       \n\nHope you enjoyed my &quot;test blog&quot;, regards!', 'My Hobby and Guns', 'visible', 1, 'AK47', 2006591780, 0, 'on_nl2br'),
