(46, 7, 519, 519, 1293174218, 'one beautiful gun. drool! \r\n\r\n[url=http://www.postimage.org/][img]http://s3.postimage.org/d6kd58vff/goy_tm_tfb.jpg[/img][/url]\r\n\r\nOfficial press release:\r\n\r\nThe 2011 Gun of the Year is custom made with a 24 karat gold plated barrel bushing and screws on the grip panels and ornate embellished slides. The serpentine Colt logo and "2011 Gun of the Year" text is featured in a 24 karat selective gold fill on the right side of the firearm''s slide with sculpted roll engraving boasting a scrolling banner with the phrase "Military U.S. Standard" alongside the names of every major war it participated in. The left side slide features the rampant Colt horse and "Colt 1911 100 Years" embellished in 24kt gold fill and sculpted roll engraving showcasing four military vehicles."', 'The new colt centennial 1911', 'visible', 1, 'Starfish', 3399698370, 0, 'on_nl2br'),
