(77, 10, 116, 116, 1297191817, 'Now back home, could not update you people because of my stupid laptop''s stupid wifi settings which I have been fighting with during the whole trip but they never let me hook to any network so first thing I did after getting back was to restore it to original factory settings, hopefully it will work on next trip . It was a great trip as far as business part is concerned but a very dull as far as pleasure is, due to continues rain, 60 mph gusts and cold weather. \nMet Slayerjutt bro on last day in Manchester (just before I was leaving) for only half an hour,thanks Slayer bro for coming to the hotel and sorry again for not being able to contact you earlier, will have fun on my next trip Inshallah.\nI would like to share one very unusual (for me atleast) thing that I witnessed, me and my friend (whom I call A''aqa because of his very peculiar kinky habits :tape2:  ) were roaming in a street with lot of homo;) clubs, there we saw 2 policemen walking around, A''aqa said lets have some fun with them, I was like "what? I dont want to spend a night in Manchester''s Hawalat" but he went to them and had this dialogue,\nA''aga... Hi guys, what are these clubs like, we tried to go in but they say it only for GAYs?\n\nP.M.: [B]Sir[/B] these are Gays only clubs.\n\nA: What is Gay?\n\nP.M.: I am sorry [B]Sir[/B] but you can ask anyone outside the club.\n\nA: But why dont you tell me what Gay is, you are here to help.\n\nP.M.: [B]Sir[/B], absolutely we are here to help but the thing you want helping in is something we cant.\n\nA: OK I will ask some one else but at least tell me "ARE YOU BOTH GAY"?\n\nnow at that point I started looking for the route I will run to :mod: but to my surprise both policemen looked at each other smiled back and started walking their way. Being called SIR in response to very stupid questions and no consequences faced which we would face here in Pakistan after having this kind of PANGA with a BAWARDEE MULAZIM; was like "what the hell, what''s wrong with English police, are they really GAY????"  but this sweet rendezvous with UK police was something to remember and to share with friends (but never with any Policeman here as I know where I will end up spending next night after a thorough CHITROL :becky:) .', '', 'visible', 1, 'Denovo87', 3065174503, 0, 'on_nl2br'),
(78, 10, 162, 116, 1297228004, 'Lolz! And welcome back Denovo bro!With the sudden cut off, was really wondering since days on your whereabouts there! And then .......THESE [I]whereabouts[/I]!! Lolz!\n\nNow, apart from escaping troubles with the Police, calling them fags/gays, whatsoever, I''d still say, your better luck was escaping the very "zombies" you were asking about, lolz!\n\nSeems though,[I] biz[/I] was combined fairly well with[I] pleasure[/I], still!!\n\nRegards.', '', 'visible', 1, 'AK47', 2006615905, 0, 'on_nl2br'),
